INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (1, 'Phuong Nam Hotel An Giang', 'Phuong Nam Hotel An Giang nằm ở Long Xuyên. Ngoài nhà hàng, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tất cả các căn đi kèm tủ lạnh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Phòng nào cũng có tủ quần áo và TV màn hình phẳng, ngoài ra một số phòng tại khách sạn có ban công. Tại Phuong Nam Hotel An Giang, tất cả các phòng có ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn túc trực để hỗ trợ khách.  Sân bay Quốc tế Cần Thơ cách 55 km.', 0, 320235564, '(+84)6456891664', '0ok7m9e0ge@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (2, 'Khách Sạn Ngọc Hân', 'Khách Sạn Ngọc Hân tọa lạc ở Ấp Vĩnh Phú. Ngoài nhà hàng, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Khách sạn có phòng gia đình.  Tại khách sạn, phòng nào cũng có tủ quần áo và TV màn hình phẳng. Tại Khách Sạn Ngọc Hân, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn túc trực để hỗ trợ khách.  Sân bay Rạch Giá cách 95 km.', 70, 952952059, '(+84)3171028764', 'b35sm2grd0@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (3, 'Hotel Hải Châu', 'Hotel Hải Châu tọa lạc ở Ấp Phước Thọ và có trung tâm spa và chăm sóc sức khỏe. Khách sạn 2 sao này có dịch vụ tiền sảnh và bàn bán tour. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, mỗi phòng đều có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và ban công với view thành phố. Các phòng đều có tủ lạnh.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách Hotel Hải Châu 108 km.', 0, 805602907, '(+84)8686422459', 'zsrix252gh@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (4, 'Paris Hotel Châu Đốc', 'Paris Hotel Châu Đốc nằm ở Châu Đốc và có sân hiên và quầy bar. Ngoài phòng chờ chung, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê xe đạp cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, các phòng đều có bàn làm việc. Tất cả các phòng đều được thiết kế có TV màn hình phẳng, ngoài ra một số phòng tại Paris Hotel Châu Đốc có view thành phố. Tại chỗ nghỉ, tất cả các phòng có ga trải giường và khăn tắm.  Paris Hotel Châu Đốc có phục vụ bữa sáng kiểu lục địa hoặc kiểu Mỹ.  Đội ngũ nhân viên lễ tân 24/24 giao tiếp thành thạo bằng tiếng Anh và tiếng Việt.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách khách sạn 107 km.', 0, 481211282, '(+84)1387397184', 'bun2cmmi8e@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (5, 'Nhà Nghỉ HOA LÝ', 'Nhà Nghỉ HOA LÝ tọa lạc ở Châu Đốc. Guest house cung cấp sân hiên, lễ tân 24/24, cùng Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại guest house, tất cả các phòng đều được thiết kế có tủ quần áo, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách Nhà Nghỉ HOA LÝ 107 km.', 0, 833119331, '(+84)4596718572', 'qb33i2yk7p@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (6, 'Căn hộ Khách sạn cao cấp Marina Plaza Long Xuyên', 'Tọa lạc ở Ấp Ðông An (1), Căn hộ Khách sạn cao cấp Marina Plaza Long Xuyên cung cấp Wi-Fi miễn phí, nơi khách có thể trải nghiệm phòng chờ chung, sân hiên và nhà hàng.  Một số căn có ban công nhìn ra thành phố, TV màn hình phẳng truyền hình cáp và điều hòa.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách căn hộ 53 km.', 10, 992287641, '(+84)4860474636', 'nxzs9rhjvz@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (7, 'Lá Homestay', 'Nhìn ra thành phố, Lá Homestay ở Ấp Mỹ Qứi cung cấp chỗ nghỉ có xe đạp miễn phí, khu vườn, phòng chờ chung, sân hiên và quầy bar. Nhà nghỉ B&B có WiFi và chỗ đậu xe riêng miễn phí.  Tất cả các căn có thiết kế gồm khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, cùng phòng tắm riêng có trang bị đồ vệ sinh cá nhân miễn phí, vòi xịt/chậu rửa vệ sinh và vòi sen. Tủ lạnh, cũng như máy pha cà phê và ấm đun nước đều được cung cấp.  Khách tại Lá Homestay có thể thưởng thức bữa sáng thực đơn à la carte hoặc kiểu Á.  Chỗ nghỉ này có sân chơi trẻ em và BBQ, ngoài ra khách có thể leo núi và đi xe đạp gần đó.  Chỗ nghỉ cách Sân bay Quốc tế Cần Thơ 51 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 912113465, '(+84)3196528205', 'wujqk0yrjc@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (8, 'Victoria Chau Doc Hotel', 'Nằm trên bờ sông Hậu (sông Bassac), Victoria Chau Doc Hotel cung cấp chỗ nghỉ ấm cúng với tầm nhìn ra quang cảnh dòng sông, các khu chợ nổi nổi tiếng và các làng nuôi cá bè trên sông, cũng như những khu làng Chăm. Khách lưu trú tại đây có thể ngâm mình trong hồ bơi ngoài trời hoặc thưởng thức các bữa ăn tại nhà hàng ngay trong khuôn viên.  Tất cả các phòng và suite của khách sạn đều được trang trí trang nhã và có cửa sổ lớn đón nhiều ánh sáng tự nhiên. Truyền hình cáp màn hình phẳng và tủ lạnh mini cũng được trang bị để tạo thuận tiện cho khách. Một số phòng còn có ban công riêng. Phòng tắm riêng đi kèm với tiện nghi vòi sen và dép đi trong phòng.  Victoria Spa của khách sạn tọa lạc tại vị trí lý tưởng trên sân thượng và có 5 giường mát-xa với tầm nhìn tuyệt đẹp ra quang cảnh Sông Hậu yên bình. Đội ngũ nhân viên tại quầy lễ tân hoạt động 24 giờ có thể hỗ trợ quý khách với nhiều dịch vụ, bao gồm thu đổi ngoại tệ, phòng giữ hành lý, cho thuê xe đạp và các dịch vụ trợ giúp đặc biệt khác.  Nằm trong vùng Đồng bằng sông Cửu Long, Victoria Chau Doc Hotel cách thành phố Cần Thơ 3 giờ lái xe và thành phố Phnom Penh chưa đến 5 giờ lái xe. Thành phố Hồ Chí Minh cách nơi nghỉ này 270 km (khoảng 7 giờ lái xe). Nhân viên của khách sạn có thể sắp xếp dịch vụ đưa đón.  Nhà hàng Bassac Restaurant của khách sạn phục vụ các món ăn Việt Nam và Châu Âu.', 0, 130700968, '(+84)9883309454', 'g4y70i8jcb@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (9, 'Khách Sạn Nhật Nga', 'Nằm ở Vũng Tàu, cách Bãi Sau 12 phút đi bộ, Khách Sạn Nhật Nga cung cấp chỗ nghỉ có khu vực bãi biển riêng, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Khách sạn 1 sao này có dịch vụ phòng và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí.  Tại khách sạn, các phòng đều đi kèm với điều hòa, bàn làm việc, sân trong với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Tất cả các phòng đều được thiết kế có ấm đun nước, trong đó một số phòng có ban công. Tất cả các phòng đều có tủ lạnh.  Khách Sạn Nhật Nga cách Tượng Chúa Ki-tô 4.3 km và Khu du lịch sinh thái văn hóa Hồ Mây 4.5 km.', 0, 712286105, '(+84)8199558242', '0hprg0p8ef@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (10, 'Lighthouse Homestay Vũng Tàu', 'Với tiện nghi BBQ, Lighthouse Homestay Vũng Tàu nằm ở Vũng Tàu, Bà Rịa - Vũng Tàu, cách Bãi Sau 9 phút đi bộ và Bãi Dứa 1.9 km. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Phòng nào cũng có TV màn hình phẳng, ngoài ra một số phòng tại khách sạn có view thành phố. Tại Lighthouse Homestay Vũng Tàu, tất cả các phòng có ga trải giường và khăn tắm.  Chỗ nghỉ có dịch vụ thuê xe đạp và dịch vụ thuê ô tô. Ngoài ra, leo núi và đi xe đạp là hoạt động được ưa chuộng trong khu vực.  Đội ngũ nhân viên lễ tân giao tiếp thành thạo bằng tiếng Anh và tiếng Việt.  Các điểm tham quan nổi tiếng gần Lighthouse Homestay Vũng Tàu bao gồm Tượng Chúa Ki-tô, Mũi Nghinh Phong và White Rabbit Park Vung Tau. Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách khách sạn 102 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 60, 385161588, '(+84)9928481131', 'b6emcjl7um@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (11, 'Luxury The Song Happy Home Apartment Vung Tau', 'Nhìn ra thành phố, Luxury The Song Happy Home Apartment Vung Tau tọa lạc ở Vũng Tàu và có nhà hàng, câu lạc bộ trẻ em, quầy bar, khu vườn, hồ bơi ngoài trời mở quanh năm cũng như sân hiên. Chỗ nghỉ có điều hòa và phòng xông hơi khô.  Căn hộ có ban công nơi khách có thể nhìn ra biển, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và bếp, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Khách tại Luxury The Song Happy Home Apartment Vung Tau có thể thưởng thức bữa sáng kiểu lục địa hoặc kiểu Á.  Chỗ nghỉ có sân chơi trẻ em, cùng khu vực bãi biển riêng và nhiều tiện nghi thể thao dưới nước.  Luxury The Song Happy Home Apartment Vung Tau cách Bãi Sau 9 phút đi bộ và Khu du lịch sinh thái văn hóa Hồ Mây 3.8 km.', 72, 168549454, '(+84)9257224633', 'n56rut7muz@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (12, 'Joi Hospitality - Central', 'Nằm ở Vũng Tàu, cách Bãi Trước 1.9 km và Bãi Sau 2.4 km, Joi Hospitality - Central cung cấp chỗ nghỉ có sân hiên và Wi-Fi miễn phí cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Một số phòng tại chỗ nghỉ có ban công với view thành phố.  Một số phòng có bếp với tủ lạnh và minibar.  Khách sạn cách Khu du lịch sinh thái văn hóa Hồ Mây 3.2 km và Bạch Dinh 3.6 km.', 63, 177507196, '(+84)0808204599', 'l9fw4ni9k7@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (13, 'Sun Hill Hotel', 'Tọa lạc ở Vũng Tàu, cách Bãi Trước 14 phút đi bộ, Sun Hill Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí và sân hiên. Khách sạn 3 sao này có dịch vụ phòng và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Các phòng được trang bị điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tất cả các phòng đều được thiết kế có phòng tắm riêng với máy sấy tóc, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra thành phố. Tại khách sạn, tất cả các phòng đều có ga trải giường và khăn tắm.  Sun Hill Hotel cách Bãi Sau 16 phút đi bộ và Mũi Nghinh Phong 2.3 km.', 50, 836673914, '(+84)5452903224', 'd0o6npz5li@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (14, 'VILLA ARIA RESORT, THE SEA BY 10m,Biển và hồ bơi riêng', 'Với hồ bơi, khu vườn, phòng chờ chung và nhìn ra biển, VILLA ARIA RESORT, THE SEA BY 10m, Biển và hồ bơi riêng nằm ở Vũng Tàu cung cấp chỗ nghỉ có Wi-Fi miễn phí. Chỗ nghỉ có điều hòa, hồ bơi riêng, bể sục và bồn tắm spa.  Biệt thự có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và lò nướng, cùng phòng tắm chung được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Tất cả các căn đều được thiết kế có ban công nhìn ra hồ bơi.  VILLA ARIA RESORT, THE SEA BY 10m, Biển và hồ bơi riêng có sân chơi trẻ em.  Khuôn viên của chỗ nghỉ có khu vực bãi biển riêng và du khách có thể leo núi ở khu vực gần đó.  VILLA ARIA RESORT, THE SEA BY 10m, Biển và hồ bơi riêng cách Bãi Thủy Tiên chỉ vài bước chân và Khu du lịch sinh thái văn hóa Hồ Mây 8.8 km.', 0, 874757553, '(+84)0393274319', 'b373d44z7j@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (15, 'The Song Vung Tau Apartment', 'Nằm ở Vũng Tàu, cách Bãi Sau chưa đến 1 km và Khu du lịch sinh thái văn hóa Hồ Mây 3.8 km, The Song Vung Tau Apartment cung cấp chỗ nghỉ nhìn ra thành phố, có Wi-Fi miễn phí, khu vườn với hồ bơi ngoài trời, phòng tập thể dục và phòng xông hơi khô. Chỗ đậu xe riêng có sẵn trong khuôn viên.  Căn hộ có sân hiên, khu vực ghế ngồi, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi gồm tủ lạnh và bếp, cùng phòng tắm riêng được trang bị vòi sen và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  The Song Vung Tau Apartment có phục vụ bữa sáng thực đơn à la carte hoặc kiểu Á. Tại chỗ nghỉ, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực địa phương.  Tại The Song Vung Tau Apartment, khách có thể sử dụng bể sục.  Khách nghỉ tại căn hộ có thể chơi bóng bàn trong khuôn viên, hoặc leo núi ở khu vực xung quanh.  The Song Vung Tau Apartment cách Bạch Dinh 4.1 km và Mũi Nghinh Phong 4.3 km.', 0, 718202410, '(+84)1583103476', '3x8uij93ib@hotmail.com', 4);
