INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (22, 'Ravatel Home Bac Giang', 'Tọa lạc ở Bắc Giang, cách Trung tâm mua sắm AEON MALL Long Biên 47 km, Ravatel Home Bac Giang cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Mỗi phòng tại khách sạn 3 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng hồ bơi trong nhà và phòng xông hơi khô. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Các phòng được trang bị điều hòa, TV màn hình phẳng có truyền hình vệ tinh, minibar, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Mỗi phòng đều có phòng tắm riêng với máy sấy tóc, trong đó một số phòng có bếp với tủ lạnh. Tại khách sạn, các phòng được thiết kế có ga trải giường và khăn tắm.  Tại Ravatel Home Bac Giang, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Hoa, Tứ Xuyên và Việt. Bên cạnh đó, họ có thể yêu cầu món chay, không chứa sữa và món thuần chay.  Chỗ nghỉ có sân hiên. Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, Ravatel Home Bac Giang có dịch vụ thuê ô tô.  Sân bay Quốc tế Nội Bài cách 51 km.', 0, 892590183, '(+84)0043773737', 'spranqwoik@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (23, 'DOMINIC HOTEL', 'Tọa lạc ở Hòa Ðình, cách Trung tâm mua sắm AEON MALL Long Biên 27 km, DOMINIC HOTEL cung cấp chỗ nghỉ có nhà hàng, chỗ đậu xe riêng miễn phí và quầy bar. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Đây là chỗ nghỉ không hút thuốc và nằm cách Nhà hát múa rối Thăng Long 33 km.  Tại khách sạn, mỗi phòng đều có ban công. Ngoài phòng tắm riêng với vòi sen và đồ vệ sinh cá nhân miễn phí, một số căn tại DOMINIC HOTEL cũng có view thành phố. Các phòng tại chỗ nghỉ có điều hòa và bàn làm việc.  DOMINIC HOTEL có phục vụ bữa sáng thực đơn buffet hằng ngày.  Khách sạn cách Ô Quan Chưởng 33 km và Hồ Hoàn Kiếm 33 km.', 0, 753526731, '(+84)2815843143', '6a6iiy6qq3@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (24, 'Muong Thanh Grand Bac Giang Hotel', 'Muong Thanh Bac Giang Hotel cung cấp chỗ nghỉ hiện đại và trang nhã với hồ bơi ngoài trời, sân tennis, trung tâm thể dục cũng như WiFi miễn phí trong toàn bộ khuôn viên. Chỗ nghỉ này có lễ tân 24 giờ và chỗ đỗ xe miễn phí trong khuôn viên.  Với tầm nhìn ra quang cảnh thành phố, các phòng và suite gắn máy điều hòa tại đây có tủ để quần áo, két an toàn (trong phòng), TV truyền hình cáp màn hình phẳng, minibar cũng như ấm đun nước điện. Phòng tắm riêng đi kèm tiện nghi vòi sen/bồn tắm, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Tại Muong Thanh Bac Giang Hotel, du khách có thể thư giãn trong phòng xông hơi khô hoặc tận hưởng dịch vụ mát-xa thư giãn tại spa. Chỗ nghỉ cung cấp dịch vụ văn phòng và tiện nghi tổ chức tiệc trong khi dịch vụ giặt là và đưa đón sân bay có thể được thu xếp cho du khách.  Khách sạn có nhà hàng, nơi du khách có thể thưởng thức một loạt món ăn địa phương ngon miệng. Các bữa ăn theo chế độ ăn uống đặc biệt có thể được chế biến theo yêu cầu trong khi du khách có thể thưởng thức đủ loại đồ uống tại quầy bar.  Chỗ nghỉ nằm cách sân bay quốc tế Nội Bài khoảng 42 km.', 59, 527888513, '(+84)4247783987', 'vtirwmbdzd@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (25, 'Serviced apartment with pool- Greenpearl Bắc Ninh', 'Cách Trung tâm mua sắm AEON MALL Long Biên 26 km, Serviced apartment with pool- Greenpearl Bắc Ninh có khu vườn, điều hòa, ban công và Wi-Fi miễn phí. Chỗ đậu xe riêng có sẵn trong khuôn viên.  Căn hộ có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và lò vi sóng, cùng phòng tắm riêng được trang bị vòi sen và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Serviced apartment with pool- Greenpearl Bắc Ninh có dịch vụ cho thuê ô tô.  Chỗ nghỉ cách Nhà hát múa rối Thăng Long 28 km và Ô Quan Chưởng 28 km.', 0, 307283184, '(+84)2108856131', 'ou3unxd05p@hotmail.com', 4);
