INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (27, 'Le Indochina Hotel', 'Với Wi-Fi miễn phí trong tất cả các khu vực, Le Indochina Hotel cung cấp chỗ nghỉ tại thành phố Bắc Ninh, cách thành phố Hà Nội 28 km. Khách sạn có hồ bơi ngoài trời, bể sục và phòng xông hơi khô. Quý khách có thể thưởng thức bữa ăn tại nhà hàng hoặc đồ uống ở quán bar.  Tất cả chỗ nghỉ được trang bị máy lạnh, sàn trải thảm và hệ thống sưởi. Tiện nghi ủi và tủ quần áo được cung cấp. Một số chỗ nghỉ có khu vực tiếp khách cho khách có thể thư giãn. Chỗ nghỉ cũng được trang bị truyền hình cáp màn hình phẳng, ấm đun nước điện và minibar. Phòng tắm riêng trong mỗi chỗ nghỉ đi kèm tiện nghi vòi sen và máy sấy tóc. Áo choàng tắm và dép đi trong phòng cũng được cung cấp để tạo sự thoải mái cho du khách.  Đội ngũ nhân viên giao tiếp được bằng 2 ngôn ngữ tại lễ tân 24 giờ có thể trợ giúp khách với dịch vụ thu đổi ngoại tệ và giữ hành lý. Dịch vụ đưa đón có thể được bố trí với một khoản phụ phí. Tại nơi nghỉ có trung tâm dịch vụ doanh nhân, phòng tập thể dục và cửa hàng quà tặng.  Sân bay Quốc tế Nội Bài cách nơi nghỉ 28 km.', 0, 412892781, '(+84)0224887665', '0cbp31o7ag@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (28, 'Nhà nghỉ Thủy Mười - Bắc Kạn City', 'Nhà nghỉ Thủy Mười - Bắc Kạn City cung cấp chỗ nghỉ ở Bắc Kạn. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ.  Tất cả các phòng ở khách sạn được trang bị ấm đun nước. Tại Nhà nghỉ Thủy Mười - Bắc Kạn City, các phòng đều có điều hòa và TV màn hình phẳng.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách chỗ nghỉ 131 km.', 0, 741752979, '(+84)5612879972', 'rwl0535p21@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (29, 'An Thảo Ba Bể Hotel', 'An Thảo Ba Bể Hotel có khu vườn, phòng chờ chung, sân hiên và nhà hàng ở Ba Be. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp bếp chung và dịch vụ phòng. Chỗ nghỉ này cung cấp karaoke và quầy lễ tân 24 giờ.  Tại khách sạn, các phòng được thiết kế có ga trải giường và khăn tắm.  Khách tại An Thảo Ba Bể Hotel sẽ có thể tận hưởng các hoạt động ở trong Ba Be và khu vực xung quanh, như leo núi.  Sân bay Quốc tế Nội Bài cách 197 km.', 0, 368783944, '(+84)3851814375', '5mm5r4xywz@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (30, 'Pac Ngoi Village Homestay', 'Pac Ngoi Village Homestay có khu vườn, sân hiên, nhà hàng và quầy bar ở Ba Be. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể tận hưởng cảnh núi.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, lò nướng, két an toàn, TV màn hình phẳng, ban công và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tất cả các phòng có tủ quần áo.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách Pac Ngoi Village Homestay 178 km.', 0, 201851205, '(+84)1906185582', 'mbd3f3c79b@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (31, 'Khach san Nam Hotel', 'Khach san Nam Hotel nằm ở Bản Co và có sân hiên. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng, vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Các căn có tủ quần áo.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách Khach san Nam Hotel 131 km.', 0, 475706269, '(+84)5298944372', 'xg13zkxm8w@gmail.com', 2);
