INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (33, 'Saigon-Ba Be Resort', 'Saigon-Ba Be Resort tọa lạc ở Ba Be. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí.  Tại khách sạn, tất cả các phòng đều được thiết kế có điều hòa, tủ quần áo, ban công với view núi, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Các phòng đều có tủ lạnh.  Saigon-Ba Be Resort có phục vụ bữa sáng thực đơn buffet hoặc kiểu Á.  Khách có thể chơi bi-a tại khách sạn 4 sao này.  Sân bay Quốc tế Nội Bài cách 185 km.', 0, 108659490, '(+84)8919597123', 'ntuwua0563@outlook.com', 4);
