INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (44, 'Tu Son Luxury Hotel', 'Tu Son Luxury Hotel cung cấp các phòng nghỉ giữa trung tâm nhộn nhịp và hối hả của thị xã Từ Sơn. Nơi đây có spa và trung tâm thể dục. Quý khách có thể thưởng thức các bữa ăn tại nhà hàng trong khuôn viên. Wi-Fi được cung cấp miễn phí trong tất cả các phòng.  Mỗi phòng tại khách sạn này đều được trang bị máy lạnh và TV. Một số phòng còn có khu vực tiếp khách để quý khách thư giãn. Một số phòng nhìn ra quang cảnh khu vườn hoặc thành phố. Tất cả các phòng còn đi kèm phòng tắm riêng.  Quầy lễ tân 24 giờ có thể giúp khách thu đổi ngoại tệ, thu xếp tour du lịch, đặt vé và cung cấp chỗ để hành lý.  Tu Son Luxury Hotel cách thành phố Hà Nội 15 km. Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách đó 20 km.', 0, 610020935, '(+84)0974077374', '1zkc1a8p74@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (45, 'Hung Vuong Hotel', 'Hung Vuong Hotel có nhà hàng tự chọn riêng và các phòng nghỉ máy lạnh với tầm nhìn ra thành phố/dòng sông cùng Wi-Fi miễn phí. Nơi đây còn có bàn đặt tour, dịch vụ cho thuê xe đạp và tiện nghi hát Karaoke.  Nằm ở trung tâm thành phố Bến Tre, Hung Vuong Hotel cách Sân bay Quốc tế Tân Sơn Nhất 72 km.  Tất cả các phòng đều được trang bị truyền hình cáp, minibar và khu vực tiếp khách. Phòng tắm riêng đi kèm vòi sen và dép.', 0, 454787468, '(+84)1078782409', 'pos1loviib@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (46, 'Mekong Hotel & Restaurant', 'Mekong Hotel & Restaurant ở Bến Tre cung cấp chỗ nghỉ 2 sao có khu vườn. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Thành thạo tiếng Anh và tiếng Nhật, đội ngũ nhân viên luôn túc trực để hỗ trợ khách tại lễ tân 24/24.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách khách sạn 82 km.', 0, 652936257, '(+84)4200063635', '6bhasfhabx@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (47, 'Khu Nghỉ Dưỡng Sen Hong Town', 'Khu Nghỉ Dưỡng Sen Hong Town có hồ bơi ngoài trời, khu vườn, phòng chờ chung và nhà hàng ở Bến Tre. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Khách có thể sử dụng quầy bar.  Tại khách sạn, các phòng đều có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các phòng tại Khu Nghỉ Dưỡng Sen Hong Town có TV màn hình phẳng và điều hòa, trong đó một số phòng có sân hiên. Tại chỗ nghỉ, các phòng đều đi kèm với ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu Mỹ mỗi buổi sáng.  Sân bay Quốc tế Tân Sơn Nhất cách 85 km.', 0, 714820071, '(+84)8611397616', '4wg4eqfgh7@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (48, 'Homestay Bentre Coco Lodge', 'Nhìn ra sông, Homestay Bentre Coco Lodge ở Bến Tre cung cấp chỗ nghỉ có xe đạp miễn phí, khu vườn, sân hiên, nhà hàng và quầy bar. Chỗ nghỉ có Wi-Fi miễn phí và chỗ đậu xe riêng có sẵn trong khuôn viên.  Được thiết kế với ban công, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Hằng ngày, chỗ nghỉ có các lựa chọn kiểu Mỹ, kiểu Á hoặc món chay cho bữa sáng.  Du khách có thể leo núi và đi xe đạp gần đó, đồng thời chỗ nghỉ cũng có dịch vụ cho thuê ô tô và nhiều tiện nghi thể thao dưới nước.  Chỗ nghỉ cách Sân bay Quốc tế Tân Sơn Nhất 89 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 25, 190705872, '(+84)4994096147', '12yy5fc13y@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (49, 'Ben Tre Riverside Resort', 'Tọa lạc tại thành phố Bến Tre thuộc tỉnh Bến Tre, cách thành phố Vĩnh Long 42 km, Ben Tre Riverside Resort có hồ bơi ngoài trời mở cửa quanh năm và tầm nhìn ra dòng sông. Chỗ nghỉ cũng có nhà hàng phục vụ khách. Resort cung cấp Wi-Fi miễn phí trong tất cả các khu vực và chỗ đỗ xe riêng miễn phí ngay tại khuôn viên.  Ben Tre Riverside Resort cung cấp dịch vụ đưa đón miễn phí từ chỗ nghỉ đến Chợ đêm Bến Tre.  Một số phòng nghỉ tại đây có khu vực tiếp khách để tạo thuận tiện cho du khách Du khách cũng sẽ tìm thấy ấm đun nước trong phòng. Tất cả các phòng được bố trí phòng tắm riêng với dép và máy sấy tóc. Trong phòng còn được trang bị TV màn hình phẳng.  Chỗ nghỉ có cửa hàng quà tặng và lễ tân 24 giờ.  Resort cung cấp dịch vụ cho thuê xe đạp và xe hơi. Đi xe đạp và câu cá là các hoạt động phổ biến tại khu vực này. Sân bay quốc tế Tân Sơn Nhất cách đó 74 km.', 30, 809176113, '(+84)2605388399', 'coju2plseb@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (50, 'Mango Home Riverside', 'Nằm nép mình trong khu vườn nhiệt đới, Mango Home Riverside là resort sinh thái tọa lạc trong khu vực Đồng bằng sông Cửu Long. Nằm dọc theo Sông Bến Tre, chỗ nghỉ cung cấp các phòng sạch sẽ, tiện nghi với truy cập Wi-Fi miễn phí trong toàn khuôn viên. Du khách nghỉ tại đây có thể ngâm mình trong hồ bơi ngoài trời hoặc thư giãn trên giường tắm nắng. Resort cũng có sân hiên phơi nắng và lounge nhìn ra mặt nước để du khách chiêm ngưỡng ánh hoàng hôn. Bãi đậu xe riêng có sẵn miễn phí bên cạnh chỗ nghỉ.  Tất cả các phòng đều được bài trí đơn giản với máy lạnh, khu vực tiếp khách, tủ lạnh và tủ quần áo. Du khách có thể tận hưởng tầm nhìn ra khu vườn từ trong phòng. Phòng tắm riêng đi kèm vòi sen và đồ vệ sinh cá nhân miễn phí. Các lợi ích được cung cấp cho khách bao gồm hai chai nước, trà, cà phê và trái cây tươi.  Nhà hàng trong khuôn viên phục vụ một loạt món ăn địa phương chính thống từ rau quả và thảo mộc hữu cơ trồng trong vườn của chỗ nghỉ. Các lớp học nấu ăn cũng được tổ chức và du khách có thể sắp xếp việc đi lại ngay tại bàn đặt tour. Nhân viên quầy lễ tân 24 giờ có thể hỗ trợ khách với các dịch vụ giữ hành lý, giặt và ủi.  Resort cung cấp xe đạp cho khách sử dụng miễn phí và du khách có thể tới chợ thực phẩm tươi trong vòng 10 phút đạp xe. Thành phố Bến Tre cách đó 6 km.', 0, 955050567, '(+84)4468046263', 'ldk7dajhnj@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (51, 'Diamond Stars Ben Tre Hotel', 'Nằm ở Bến Tre, Diamond Stars Ben Tre Hotel cung cấp chỗ nghỉ 5 sao có nhà hàng. Khách sạn có hồ bơi trong nhà, quầy lễ tân 24 giờ và Wi-Fi miễn phí.  Các căn tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tất cả các phòng có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tất cả các căn đều có tủ lạnh.  Sân bay Quốc tế Tân Sơn Nhất cách 85 km.', 45, 911315535, '(+84)6511195675', 'iid6xps2pm@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (52, 'Khách Sạn Vinhomes Huỳnh Hotel', 'Khách Sạn Vinhomes Huỳnh Hotel ở Bến Tre có sân hiên và nhà hàng. Ngoài khu vườn, khách sạn 5 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tất cả các phòng đều có tủ quần áo và TV màn hình phẳng, ngoài ra một số căn tại khách sạn có ban công.  Sân bay Quốc tế Tân Sơn Nhất cách 87 km.', 0, 141140009, '(+84)8299209494', 'k8c8ldvl1r@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (53, 'Hung Dong Hotel', 'Tọa lạc ở Quy Nhơn, cách Bãi biển Quy Nhơn chỉ vài bước chân, Hung Dong Hotel cung cấp chỗ nghỉ có khu vực bãi biển riêng, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Ngoài nhà hàng, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm chung. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Phòng nào cũng có bàn làm việc và TV màn hình phẳng, ngoài ra một số căn tại Hung Dong Hotel có ban công. Phòng khách đều có tủ lạnh.  Chỗ nghỉ có dịch vụ thuê xe đạp và dịch vụ thuê ô tô. Ngoài ra, lặn biển và đi ca nô là hoạt động được ưa chuộng trong khu vực.  Lễ tân tại Hung Dong Hotel có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Khách sạn cách Bãi tắm Hoàng Hậu chưa đến 1 km. Sân bay Phù Cát cách 32 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 41, 297055565, '(+84)2833174248', '7zdfqhuhht@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (54, 'Vien Duong Hotel', 'Tọa lạc ở Quy Nhơn, cách Bãi biển Quy Nhơn 9 phút đi bộ và Bãi tắm Hoàng Hậu 2.1 km, Vien Duong Hotel cung cấp chỗ nghỉ có phòng chờ chung và Wi-Fi miễn phí cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp dịch vụ đưa đón sân bay và dịch vụ cho thuê xe đạp.  Khách sạn sẽ cung cấp cho du khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, két an toàn, TV màn hình phẳng, ban công, phòng tắm riêng và vòi xịt/chậu rửa vệ sinh. Tại Vien Duong Hotel, tất cả các phòng đều có ga trải giường và khăn tắm.  Sân bay Phù Cát cách 31 km.', 0, 760500844, '(+84)7283415736', 'r7a6dw0rt7@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (55, 'Hai Huong Hotel', 'Hai Huong Hotel do gia đình tự quản này nằm cách Bãi biển Quy Nhơn 200 m và chỉ cách bến xe gần nhất 50 m. Khách sạn cung cấp dịch vụ phòng 24 giờ và truy cập Wi-Fi miễn phí.  Các phòng tại Hotel Hai Huong được trang bị khu vực tiếp khách, máy lạnh, truyền hình cáp, tủ lạnh và phòng tắm riêng đi kèm máy sấy tóc cùng đồ vệ sinh cá nhân.  Các dịch vụ đặt vé, giữ hành lý và cho thuê phương tiện đi lại cũng có tại đây. Máy vi tính được bố trí trong khu vực chung để khách sử dụng miễn phí.  Khách sạn cách các quán Bar Hoang Yen và Bar En Viet 3 phút tản bộ. Đại Siêu thị Metro cách nơi nghỉ này 100 m. Khu mộ Hàn Mặc Tử cách khách sạn 1 km trong khi Sân bay Phù Cát cách đó 35 km.', 0, 116192123, '(+84)9017262156', '3pa4ikwj51@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (56, 'Bluesea Hotel Quy Nhon', 'Nằm ở Quy Nhơn và cách Bãi biển Quy Nhơn 1 phút đi bộ, Bluesea Hotel Quy Nhon cung cấp dịch vụ tiền sảnh, các phòng không hút thuốc, phòng chờ chung, Wi-Fi miễn phí ở toàn bộ chỗ nghỉ và nhà hàng. Khách sạn 2 sao này có dịch vụ đưa đón miễn phí và dịch vụ phòng. Du khách có thể thưởng thức đồ uống tại quầy bar.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng hỗ trợ khách lên kế hoạch cho kỳ nghỉ.  Sân bay Phù Cát cách 32 km.', 0, 637145392, '(+84)8504466041', '9ebd1g0nwx@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (57, 'Luu Ngai Condotel Quy Nhon', 'Nằm ở Quy Nhơn, cách Bãi biển Quy Nhơn 7 phút đi bộ, Luu Ngai Condotel Quy Nhon cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Ngoài quầy bar, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và tổ chức các tour du lịch cho khách.  Các căn đi kèm TV màn hình phẳng có truyền hình cáp, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Một số phòng có bếp với tủ lạnh. Tất cả các căn có tủ quần áo.  Khách sạn cách Bãi tắm Hoàng Hậu 19 phút đi bộ. Sân bay gần nhất là Sân bay Phù Cát, cách Luu Ngai Condotel Quy Nhon 31 km.', 65, 592587391, '(+84)1523039516', '2eyf3eu2tz@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (58, 'FLC SEA TOWER APARMENT Hừng Đông GIÁP BIỂN, HỒ BƠI', 'Nằm ở Quy Nhơn, cách Bãi biển Quy Nhơn 4 phút đi bộ và Bãi tắm Hoàng Hậu 1.9 km, FLC SEA TOWER APARMENT Hừng Đông GIÁP BIỂN, HỒ BƠI cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa và khu vườn với hồ bơi ngoài trời.  Mỗi căn đều có ban công nhìn ra biển, TV màn hình phẳng truyền hình cáp, khu vực ghế ngồi, bếp nhỏ tiện nghi, cùng phòng tắm riêng có vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tủ lạnh và ấm đun nước đều được cung cấp.  Khách có thể sử dụng sân hiên tại căn hộ.  Sân bay gần nhất là Sân bay Phù Cát, cách FLC SEA TOWER APARMENT Hừng Đông GIÁP BIỂN, HỒ BƠI 32 km.', 66, 890158014, '(+84)4346267105', 'timtb79lu1@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (59, 'Glese Balcony Seaview Apartment - FLC Sea Tower Quy Nhon', 'Nhìn ra núi, Glese Balcony Seaview Apartment - FLC Sea Tower Quy Nhon nằm ở Quy Nhơn và có nhà hàng, bếp chung, quầy bar, khu vườn, sân hiên cũng như sân chơi trẻ em. Chỗ nghỉ có điều hòa và bồn tắm spa.  Nhìn ra thành phố hoặc biển, mỗi căn chỗ nghỉ có bếp, TV màn hình phẳng truyền hình vệ tinh, đầu đĩa Blu-ray, bàn làm việc, máy giặt, cùng phòng tắm riêng gồm vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Tủ lạnh, máy rửa bát và lò nướng, cũng như ấm đun nước đều được cung cấp.  Khách cũng có thể thư giãn trong khu vực phòng chờ chung.  Căn hộ cách Bãi biển Quy Nhơn 4 phút đi bộ và Bãi tắm Hoàng Hậu 1.9 km. Chỗ nghỉ cách Sân bay Phù Cát 32 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 40, 775237000, '(+84)3688311003', 'viif1sjae4@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (60, 'Muong Thanh Quy Nhon Hotel', 'Nằm cách Bãi biển Quy Nhơn xinh đẹp chỉ 30 m, Muong Thanh Quy Nhon Hotel có hồ bơi ngoài trời, sân tennis và quầy lễ tân 24 giờ. Truy cập Wi-Fi miễn phí có sẵn trong toàn bộ khách sạn và khách được đỗ xe miễn phí trong khuôn viên.  Khách sạn này chỉ cách trung tâm thành phố Quy Nhơn 2 km và cách Chợ Đầm nhộn nhịp 3 km. Sân bay Nội địa Phù Cát cách đó khoảng 35 km. Dịch vụ đưa đón và vận chuyển sân bay cũng có thể được sắp xếp kèm phụ phí.  Với tầm nhìn ra quang cảnh thành phố, các phòng máy lạnh rộng rãi tại đây được trang bị két an toàn, truyền hình cáp màn hình phẳng, minibar và khu vực tiếp khách. Phòng tắm riêng có máy sấy tóc, bồn tắm, vòi sen và đồ vệ sinh cá nhân miễn phí.  Muong Thanh Quy Nhon Hotel cung cấp các dịch vụ giữ hành lý, thu đổi ngoại tệ và giặt là. Quý khách cũng có thể hát karaoke, yêu cầu dịch vụ mát-xa và tận dụng tiện nghi xông hơi khô. Các tiện nghi tổ chức hội họp/yến tiệc cũng có tại đây.  Nhà hàng trong nhà phục vụ các món ăn quốc tế và Việt Nam ngon tuyệt. Các bữa ăn cũng có thể được phục vụ trong sự riêng tư với dịch vụ ăn uống tại phòng.', 54, 394067338, '(+84)2097327016', 'gzsf1n0y2v@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (61, 'FLC Quy Nhơn Sea View Apartment - CHANH Căn Hộ Hướng Biển', 'Nằm cách Bãi biển Quy Nhơn 2 phút đi bộ và Bãi tắm Hoàng Hậu 1.9 km, FLC Quy Nhơn Sea View Apartment - CHANH Căn Hộ Hướng Biển ở Quy Nhơn cung cấp chỗ nghỉ có điều hòa, Wi-Fi miễn phí và nhìn ra biển.  Căn hộ có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng truyền hình cáp, bếp đầy đủ tiện nghi gồm tủ lạnh và bếp, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Mỗi căn đều được thiết kế có ban công nhìn ra núi.  Sân bay gần nhất là Sân bay Phù Cát, cách FLC Quy Nhơn Sea View Apartment - CHANH Căn Hộ Hướng Biển 32 km.', 1, 639919081, '(+84)8268813496', '8d2rqa3aoz@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (62, 'Quy Nhon Chillin'' Apartment - FLC Sea Tower Quy Nhơn Căn Hộ Hướng Biển', 'Tọa lạc ở Quy Nhơn, Quy Nhon Chillin'' Apartment - FLC Sea Tower Quy Nhơn Căn Hộ Hướng Biển cung cấp Wi-Fi miễn phí, nơi khách có thể trải nghiệm khu vườn, phòng chờ chung và sân hiên.  Một số căn được trang bị điều hòa, TV màn hình phẳng, máy giặt và ấm đun nước, cũng như bếp.  Khuôn viên của căn hộ có công viên nước và du khách có thể leo núi ở khu vực gần đó.  Quy Nhon Chillin'' Apartment - FLC Sea Tower Quy Nhơn Căn Hộ Hướng Biển cách Bãi biển Quy Nhơn 3 phút đi bộ và Bãi tắm Hoàng Hậu 1.9 km. Sân bay gần nhất là Sân bay Phù Cát, cách chỗ nghỉ 32 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 1, 989880554, '(+84)0271938455', '72h5cq2mfo@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (63, 'Hoang Ngoc Hotel', 'Nằm cách Trung tâm thương mại Vincom Thủ Đức 4.4 km và Công viên văn hóa Suối Tiên 7.3 km, Hoang Ngoc Hotel cung cấp các phòng ở Dĩ An. Ngoài sân hiên, motel 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại motel, tất cả các phòng đều được thiết kế có bàn làm việc. Tất cả các phòng có TV màn hình phẳng, ngoài ra một số phòng tại Hoang Ngoc Hotel có view thành phố. Tại chỗ nghỉ, các phòng đều đi kèm với ga trải giường và khăn tắm.  Hoang Ngoc Hotel cách Trung tâm mua sắm AEON MALL Bình Dương Canary 11 km và Bảo tàng lịch sử Việt Nam 13 km.', 0, 716851766, '(+84)6352540821', '52sxws4ojn@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (64, 'Phi Long 2 Hotel Thu Dau Mot', 'Tọa lạc cách Trung tâm mua sắm AEON MALL Bình Dương Canary 5.9 km và Trung tâm thương mại Vincom Thủ Đức 18 km, Phi Long 2 Hotel Thu Dau Mot cung cấp các phòng ở Thủ Dầu Một. Khách sạn 1 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Khách sạn nằm cách Chợ Tân Định 24 km và Trung Tâm Thương Mại Diamond Plaza 25 km.  Tại khách sạn, mỗi phòng đều có tủ quần áo và TV màn hình phẳng. Tại Phi Long 2 Hotel Thu Dau Mot, phòng nào cũng có ga trải giường và khăn tắm.  Dịch vụ hướng dẫn 24/7 luôn có sẵn tại lễ tân với đội ngũ nhân viên thành thạo tiếng Anh và tiếng Việt.  Chỗ nghỉ cách Công viên văn hóa Suối Tiên 22 km và Bảo tàng lịch sử Việt Nam 23 km.', 50, 325704729, '(+84)7037741031', 'vuqkeccjgf@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (65, 'Phạm Vân Sakura Hotel', 'Tọa lạc ở Thuận An, cách Trung tâm mua sắm AEON MALL Bình Dương Canary 6 phút đi bộ, Phạm Vân Sakura Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể thưởng thức đồ uống tại quầy bar.  Các phòng tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình vệ tinh, két an toàn, phòng tắm riêng, vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tại Phạm Vân Sakura Hotel, mỗi phòng đều có ga trải giường và khăn tắm.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng kiểu Á hoặc món chay.  Trung tâm chăm sóc sức khỏe tại Phạm Vân Sakura Hotel có trang bị phòng xông hơi khô và bể sục. Khách có thể chơi sân chơi golf mini tại khách sạn.  Phạm Vân Sakura Hotel cách Trung tâm thương mại Vincom Thủ Đức 13 km và Công viên văn hóa Suối Tiên 18 km.', 0, 993371215, '(+84)8673485804', 'xyqdlhebc3@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (66, 'Hoàng Nam Hotel', 'Nằm cách Trung tâm mua sắm AEON MALL Bình Dương Canary 17 km và Trung tâm thương mại Vincom Thủ Đức 26 km, Hoàng Nam Hotel cung cấp các phòng điều hòa và phòng tắm riêng ở Tân Hội. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Đây là chỗ nghỉ không hút thuốc và tọa lạc cách Công viên văn hóa Suối Tiên 29 km.  Tất cả các căn tại khách sạn đi kèm khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, phòng tắm riêng, đồ vệ sinh cá nhân miễn phí và vòi xịt/chậu rửa vệ sinh. Tại Hoàng Nam Hotel, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ cách Bảo tàng lịch sử Việt Nam 33 km và Trung Tâm Thương Mại Diamond Plaza 34 km.', 0, 633641221, '(+84)5279862020', 'fwdp6qj54s@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (67, 'Hoang Yen Hotel', 'Phòng xông hơi khô, bể sục và các liệu pháp mát-xa được cung cấp tại khách sạn 3 sao Hoang Yen Hotel nằm ở Thị trấn Thuận An này. Cung cấp Wi-Fi miễn phí trong các khu vực chung, nơi nghỉ này còn có trung tâm thể dục và quầy lễ tân 24 giờ. Nhà hàng Hoang Yen Restaurant trong khuôn viên phục vụ các món ăn Việt Nam và quốc tế.  Tất cả các phòng máy lạnh tại đây được trang bị sàn gỗ, TV màn hình phẳng, két an toàn và minibar. Một số phòng nhìn ra các vườn dừa hoặc dòng sông. Phòng tắm riêng đi kèm bồn tắm hoặc bồn tắm spa.  Hoang Yen Hotel cách Trung tâm Thành phố Hồ Chí Minh 10 km. Sân bay Quốc Tế Tân Sơn Nhất cách đó 45 phút lái xe. Chỗ đỗ xe được cung cấp miễn phí.  Bàn bán tour có thể giúp khách đặt vé cũng như đưa đón sân bay kèm phụ phí. Khách sạn cũng cung cấp phòng họp và báo hàng ngày.', 0, 138533563, '(+84)5129602476', '6s7dzlybjm@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (68, 'Long Bao Chau Hotel', 'Nằm ở quận Thủ Dầu Một, Long Bao Chau Hotel là một khách sạn đầy đủ tiện nghi cung cấp truy cập Internet miễn phí trong toàn bộ khuôn viên. Các phòng được bài trí trang nhã tại đây có máy lạnh cùng TV màn hình phẳng.  Chỉ cách Chợ Bình Dương và Núi Bà nổi tiếng 500 m, tòa nhà hiện đại này nằm trong bán kính 3 km từ Công viên Giải trí Đại Nam và 17 km từ Sân bay Quốc tế Tân Sơn Nhất.  Với lối trang trí mang đậm phong cách Việt Nam, tất cả các phòng đều có minibar, khu vực tiếp khách cùng phòng tắm riêng. Những tiện nghi khác bao gồm đồ vệ sinh cá nhân và khăn tắm.  Long Bao Chau Hotel có lễ tân 24 giờ với chỗ để hành lý. Khách sạn còn cung cấp bàn đặt tour và chỗ để xe miễn phí. Khách có thể sử dụng máy vi tính ở sảnh đợi.  Tầng 14 có nhà hàng phục vụ ẩm thực Việt Nam. Quầy bar phục vụ các loại cocktail và rượu vang đa dạng. Dịch vụ ăn uống tại phòng cũng có thể được cung cấp.', 10, 591672099, '(+84)5918292831', 'ebms8mxxds@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (69, 'Citadines Central Binh Duong', 'Tọa lạc ở Thuận An, cách Trung tâm mua sắm AEON MALL Bình Dương Canary 4 km và Trung tâm thương mại Vincom Thủ Đức 15 km, Citadines Central Binh Duong cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa, hồ bơi ngoài trời và trung tâm thể dục.  Với bếp gồm tủ lạnh và lò vi sóng, mỗi căn cũng được thiết kế có két an toàn, TV màn hình phẳng truyền hình vệ tinh, tiện nghi ủi, bàn làm việc và khu vực ghế ngồi với ghế sofa. Lò nướng và ấm đun nước đều được cung cấp.  Khách sạn căn hộ có phục vụ bữa sáng thực đơn buffet hoặc kiểu lục địa.  Khách có thể tìm thấy sân hiên tại Citadines Central Binh Duong, cùng sân chơi trẻ em.  Chỗ nghỉ cách Công viên văn hóa Suối Tiên 19 km và Bảo tàng lịch sử Việt Nam 21 km. Chỗ nghỉ cách Sân bay Quốc tế Tân Sơn Nhất 17 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 503421810, '(+84)8217105119', 'x1z67uv5kh@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (70, 'Becamex Hotel New City', 'Nằm ở trung tâm Thành phố mới của tỉnh Bình Dương, Becamex Hotel New City cung cấp các phòng nghỉ ở Xóm Bưng Ðìa, trong bán kính 31 km từ Thành phố Hồ Chí Minh. Quý khách có thể dùng bữa tại nhà hàng ngay trong khuôn viên hoặc thư giãn tại hồ bơi ngoài trời. Becamex Hotel New City cung cấp Wi-Fi miễn phí toàn khách sạn và chỗ đỗ xe riêng miễn phí tại chỗ.  Khách sạn cung cấp các phòng trang nhã và hiện đại với máy lạnh. Tất cả các phòng đều được trang bị truyền hình vệ tinh và minibar với chai nước uống miễn phí. Một số phòng có tủ lạnh và ban công. Phòng tắm riêng đi kèm góc tắm vòi sen mở, dép và đồ vệ sinh cá nhân miễn phí.  Khách sạn cũng cung cấp các phòng cho mục đích tổ chức lễ cưới, sự kiện và công việc kinh doanh với sức chứa lên đến 1.000 người.  Khách sạn có lễ tân làm việc 24 giờ.  Khách có thể chơi tennis tại khách sạn. Becamex Hotel New City nằm trong khoảng cách đi bộ từ tòa nhà trung tâm hành chính của Bình Dương. Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách đó 27 km.', 0, 971724070, '(+84)4608180469', 'v9nrjjk2np@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (71, 'The Mira Hotel', 'Chiếm vị trí trung tâm ở thành phố Thủ Dầu Một, The Mira Hotel có hồ bơi ngoài trời, quầy lễ tân 24 giờ và trung tâm dịch vụ doanh nhân. Nơi nghỉ này cung cấp bãi đậu xe miễn phí và chỗ ở rộng rãi đi kèm truy cập Wi-Fi miễn phí.  Khách sạn nằm cách Khu Công nghiệp Việt Nam-Singapore 1 & 2, sân gôn Sông Bé và sân gôn Twin Doves 8 km. Công viên Giải trí Đại Nam rộng lớn cách nơi nghỉ này 10 km trong khi khách đi xe 45 phút là tới Sân bay Quốc tế Tân Sơn Nhất.  Các phòng và suite máy lạnh tại đây được trang bị đầy đủ tiện nghi với sàn trải thảm, két an toàn, truyền hình cáp màn hình phẳng và khu vực tiếp khách. Tiện nghi pha trà/cà phê và minibar cũng có trong phòng. Phòng tắm riêng đi kèm với máy sấy tóc, bồn tắm và đồ vệ sinh cá nhân miễn phí.  The Mira Hotel có bàn đặt tour hỗ trợ du khách sắp xếp các hoạt động tham quan cũng như việc đi lại. Chỗ giữ hành lý, dịch vụ giặt là và tiện nghi tổ chức hội họp/yến tiệc được bố trí theo yêu cầu. Dịch vụ đưa đón sân bay cũng được cung cấp kèm phụ phí.  Nhà hàng trong nhà Lantern Restaurant phục vụ các món ăn ngon của Trung Quốc trong khi bar ở hồ bơi cung cấp thực đơn tuyệt hảo gồm các món ăn phương Tây và Châu Á kèm nhiều loại cocktail cũng như rượu vang.', 0, 760882907, '(+84)7583495606', 'b486tlsi50@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (72, 'Hotel Stylish Tân Khai', 'Hotel Stylish Tân Khai cung cấp quầy bar và tọa lạc ở Hớn Quản. Ngoài sân hiên, khách sạn 3 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Khách sạn có hồ bơi ngoài trời, bể sục, hoạt động giải trí vào buổi tối và dịch vụ phòng.  Tất cả các phòng có tủ quần áo và TV màn hình phẳng, ngoài ra một số căn tại khách sạn có ban công. Tại Hotel Stylish Tân Khai, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn à la carte hoặc kiểu Á.  Đội ngũ nhân viên lễ tân giao tiếp thành thạo bằng tiếng Anh và tiếng Việt, ngoài ra khách có thể yêu cầu thông tin về khu vực xung quanh khi có nhu cầu.  Sân bay Quốc tế Tân Sơn Nhất cách 94 km.', 0, 32462741, '(+84)3937943375', '8w3fdqueqf@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (73, 'An Loc Hotel & Spa', 'An Loc Hotel & Spa có trung tâm thể dục, khu vườn, phòng chờ chung và nhà hàng ở Binh Long. Khách sạn 3 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách có thể sử dụng quầy bar.  Các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tất cả các căn có phòng tắm riêng, máy sấy tóc và ga trải giường.  Sân bay Quốc tế Tân Sơn Nhất cách 101 km.', 0, 364416279, '(+84)5350778537', 'hcuzb3cavt@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (74, 'Nhà Nghỉ Bảo Ngọc', 'Nhà Nghỉ Bảo Ngọc tọa lạc ở Dồng Xoài. Ngoài khu vườn, khách sạn 4 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, mỗi phòng đều được thiết kế có tủ quần áo và TV màn hình phẳng. Tại Nhà Nghỉ Bảo Ngọc, phòng nào cũng có ga trải giường và khăn tắm.  Chỗ nghỉ có sân hiên phơi nắng.  Đội ngũ nhân viên của Nhà Nghỉ Bảo Ngọc luôn túc trực tại lễ tân 24/24 để cung cấp hướng dẫn cho du khách.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách khách sạn 96 km.', 0, 333399628, '(+84)6391926871', '7xqrdd84em@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (75, 'Mui Tau Hotel Phan Ri Cua', 'Nằm ở Tuy Phong, cách Triển lãm Tecnopolis Buenos Aires 23 km, Mui Tau Hotel Phan Ri Cua cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Khách sạn nằm cách Đồi cát hồng 46 km và Chợ Mũi Né 49 km.  Các phòng đi kèm tủ lạnh, minibar, ấm đun nước, vòi sen, dép đi trong phòng và bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các căn tại khách sạn có TV màn hình phẳng và điều hòa, trong đó một số phòng có sân trong. Tại Mui Tau Hotel Phan Ri Cua, tất cả các phòng có ga trải giường và khăn tắm.  Sân bay Liên Khương cách 113 km.', 0, 908466985, '(+84)8855394754', 'hqx55ladcn@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (76, 'Nhà Mer – Homestay đảo Phú Quý', 'Nhà Mer – Homestay đảo Phú Quý cung cấp chỗ nghỉ tại Cu Lao Thu. Khách sạn 1 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, các phòng được thiết kế có tủ quần áo và TV màn hình phẳng. Tại Nhà Mer – Homestay đảo Phú Quý, các phòng đều đi kèm với ga trải giường và khăn tắm.', 70, 170523698, '(+84)9216228142', 'cr88kf6zd3@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (77, 'Full Moon Beach Resort', 'Resort này nằm dọc theo Bãi biển Mũi Né và cách trung tâm thành phố Phan Thiết chưa đến 14 km. Nơi nghỉ này có hồ bơi nước biển ngoài trời với khu vườn nhiệt đới tươi tốt bao quanh và Wi-Fi miễn phí trong toàn bộ khuôn viên.  Tất cả phòng máy lạnh rộng rãi tại Full Moon Beach Resort được trang bị khu vực tiếp khách, truyền hình vệ tinh và tiện nghi pha trà/cà phê. Mỗi phòng đều bao gồm 1 đĩa trái cây tươi hàng ngày. Một số phòng có ban công hoặc tầm nhìn ra Biển Đông.  Nhà hàng Full Moon phục vụ các món ăn Việt Nam và Phương Tây trong khi nhà hàng Jibe’s, cũng là một phần của resort, cách đó chưa đến 50 m. Du khách có thể thư giãn với đồ uống tại quầy bar hoặc sử dụng tiện nghi nướng thịt ngoài trời của resort.  Khách sạn cung cấp hàng loạt hoạt động như lướt ván diều, lướt ván buồm, chèo thuyền kayak và lướt ván với mái chèo. Các dịch vụ mát-xa và giặt là cũng có tại đây.  Full Moon Beach Resort cách sân gôn Sea Links City chỉ hơn 3 km.', 0, 492260606, '(+84)5942576311', 'arrl6886gl@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (78, 'Muine Sports Hotel', 'Tọa lạc ở Mũi Né, cách Bãi biển Hàm Tiến chỉ vài bước chân, Muine Sports Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Ngoài sân hiên, chỗ nghỉ còn có nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng, ban công, phòng tắm riêng và vòi sen. Tại Muine Sports Hotel, tất cả các phòng đều có ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Suối Tiên, Rang Church và Chợ Rạng. Sân bay Liên Khương cách 130 km.', 0, 708313350, '(+84)5489517422', 'cbs34irvx4@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (79, 'JAGUAR HOUSE RESORT Muine', 'Tọa lạc ở Mũi Né, cách Bãi biển Hàm Tiến chỉ vài bước chân, JAGUAR HOUSE RESORT Muine cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và sân hiên. Ngoài nhà hàng, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Phòng khách được trang bị TV màn hình phẳng có truyền hình cáp, minibar, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Tại khách sạn, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  JAGUAR HOUSE RESORT Muine cách Suối Tiên 5 km và Sân Golf Sea Link 13 km.', 0, 647710819, '(+84)1838608510', 'e70sc0uvse@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (80, 'A.N Homestay', 'Tọa lạc ở Phan Thiết thuộc Bình Thuận, gần Bãi biển Đồi Dương và Sân Golf Sea Link, A.N Homestay cung cấp chỗ đậu xe riêng miễn phí.  Khách sạn căn hộ có TV màn hình phẳng và phòng tắm riêng với đồ vệ sinh cá nhân miễn phí, máy sấy tóc và vòi xịt/chậu rửa vệ sinh.  Khách cũng có thể thư giãn trong khu vực phòng chờ chung.  A.N Homestay cách Bãi biển Thương Chánh 2.4 km và Ga xe lửa Phan Thiết 2.6 km. Sân bay gần nhất là Sân bay Liên Khương, cách chỗ nghỉ 137 km.', 0, 564149416, '(+84)0382051004', '34wlul6sxw@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (81, 'Thọ Hướng Hotel - Phan Thiết', 'Thọ Hướng Hotel - Phan Thiết có hồ bơi ngoài trời, sân hiên, nhà hàng và quầy bar ở Phan Thiết. Ngoài Wi-Fi miễn phí, khách sạn 4 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp dịch vụ tiền sảnh, phòng giữ hành lý và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Thọ Hướng Hotel - Phan Thiết, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu lục địa mỗi sáng.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Bãi biển Đồi Dương, Bãi biển Thương Chánh và Sân Golf Sea Link. Sân bay Liên Khương cách 137 km.', 25, 917155797, '(+84)1627873021', 'd5yf75k9iu@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (82, 'MyGarden Villa Phan Thiet Beachfront', 'Tọa lạc ở Phan Thiết, MyGarden Villa Phan Thiet Beachfront cung cấp chỗ nghỉ có hồ bơi riêng và nhìn ra biển. Chỗ nghỉ giáp biển này có sân hiên, trò phi tiêu, chỗ đậu xe riêng miễn phí và Wi-Fi miễn phí.  Biệt thự điều hòa này có 7 phòng ngủ riêng biệt, bếp đầy đủ tiện nghi với tủ lạnh, lò nướng, cùng 6 phòng tắm. TV màn hình phẳng được cung cấp.  Khách cũng có thể thư giãn trong khu vườn, bên hồ bơi ngoài trời hoặc ở khu vực phòng chờ chung.  Biệt thự cách Hải đăng Mũi Kê Gà 14 km và Ga xe lửa Phan Thiết 19 km.', 35, 916782747, '(+84)7208985070', 'v9mp2j18fj@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (83, 'Apec Mandala Mũi Né', 'Tọa lạc cách Bãi biển Long Sơn 6 phút đi bộ, Apec Mandala Mũi Né cung cấp chỗ nghỉ 5 sao ở Ấp Long Sơn, đồng thời có khu vườn, sân hiên và nhà hàng. Chỗ nghỉ này có các tiện nghi như dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Đây là chỗ nghỉ không hút thuốc và nằm cách Suối Tiên 13 km.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, lò vi sóng, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Apec Mandala Mũi Né, phòng nào cũng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Sân Golf Sea Link 30 km và Bến xe buýt Bình Thuận 31 km. Sân bay gần nhất là Sân bay Liên Khương, cách Apec Mandala Mũi Né 116 km.', 0, 24530304, '(+84)4525841601', 'a3ynoz7y84@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (84, 'S0410 Apec Mui Ne', 'S0410 Apec Mui Ne có hồ bơi ngoài trời, khu vườn, phòng chờ chung và sân hiên ở Ấp Thiẹn Ái. Khách sạn 5 sao này có dịch vụ phòng. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, câu lạc bộ trẻ em và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, tất cả các phòng đều được thiết kế có điều hòa, bàn làm việc, sân trong với view biển, phòng tắm chung, TV màn hình phẳng, ga trải giường và khăn tắm. Tất cả các căn đều có tủ lạnh.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, thực đơn à la carte hoặc kiểu Mỹ cho bữa sáng. Tại S0410 Apec Mui Ne, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Bỉ và Quảng Đông. Bên cạnh đó, họ có thể yêu cầu món chay và món thuần chay.  Chỗ nghỉ có sân chơi trẻ em.  S0410 Apec Mui Ne cách Bãi biển Đồi Cát Đỏ 19 phút đi bộ và Suối Tiên 23 km.', 0, 344340577, '(+84)1105463915', 'o9vh8wp8mr@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (85, 'Khách sạn Phú An', 'Khách sạn Phú An cung cấp chỗ nghỉ ở Cà Mau. Khách sạn 1 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí.  Tại khách sạn, các phòng được thiết kế có bàn làm việc. Các căn ở Khách sạn Phú An được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Lễ tân tại chỗ nghỉ có thể tư vấn cho khách về khu vực xung quanh.  Sân bay gần nhất là Sân bay Cà Mau, cách Khách sạn Phú An 2 km.', 0, 146441618, '(+84)9617172431', '0upqr3x34z@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (86, 'KHÁCH SẠN TIẾN PHÁT', 'KHÁCH SẠN TIẾN PHÁT cung cấp chỗ nghỉ tại Cà Mau. Ngoài khu vườn, khách sạn 1 sao này có các phòng được trang bị điều hòa và phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, mỗi phòng đều có bàn làm việc và TV. Tại KHÁCH SẠN TIẾN PHÁT, tất cả các phòng có ga trải giường và khăn tắm.  Lễ tân tại chỗ nghỉ có thể tư vấn cho khách về khu vực xung quanh.  Sân bay gần nhất là Sân bay Cà Mau, cách KHÁCH SẠN TIẾN PHÁT chỉ vài bước chân.', 0, 258398434, '(+84)7161400687', 'r1f0grrz5z@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (87, 'Sao Kim', 'Sao Kim có khu vườn, sân hiên, nhà hàng và quầy bar ở Cà Mau. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Một số căn tại chỗ nghỉ có sân trong với view thành phố.  Sân bay Cà Mau cách 3 km.', 0, 484240426, '(+84)5270025931', '449afflcpd@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (88, 'Song Hung Hotel', 'Song Hung Hotel tọa lạc ở Cà Mau. Ngoài phòng chờ chung, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, các phòng được thiết kế có bàn làm việc và TV màn hình phẳng. Tại Song Hung Hotel, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Sân bay Cà Mau cách 3 km.', 0, 607050350, '(+84)7401872445', 'tu2xl5gu64@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (89, 'Ozon Hotel', 'Ozon Hotel có hồ bơi ngoài trời, khu vườn, phòng chờ chung và sân hiên ở Năm Căn. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Một số phòng tại chỗ nghỉ có ban công với view thành phố.  Khách sạn có sân chơi trẻ em. Leo núi là hoạt động được ưa chuộng trong khu vực. Ngoài ra, Ozon Hotel có dịch vụ thuê xe đạp và dịch vụ thuê ô tô.  Sân bay Cà Mau cách 51 km.', 0, 180229237, '(+84)5342860612', 'k7db1hq6f4@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (90, 'NHÀ KHÁCH KEN', 'Tọa lạc ở Cà Mau, NHÀ KHÁCH KEN có xe đạp miễn phí, khu vườn, sân hiên, cùng Wi-Fi miễn phí. Ngoài quầy lễ tân 24 giờ, chỗ nghỉ này còn có sân chơi trẻ em. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Các phòng tại guest house được trang bị khu vực ghế ngồi, TV màn hình phẳng có truyền hình vệ tinh, phòng tắm riêng, dép đi trong phòng và vòi xịt/chậu rửa vệ sinh. Phòng khách tại NHÀ KHÁCH KEN có điều hòa và bàn làm việc.  Sân bay gần nhất là Sân bay Cà Mau, cách chỗ nghỉ 3 km.', 0, 567865756, '(+84)3171913836', 'evuh8oos3x@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (91, 'Phu Cuong Hotel Ca Mau', 'Phu Cuong Hotel Ca Mau có hồ bơi ngoài trời, phòng chờ chung, sân hiên và nhà hàng ở Cà Mau. Ngoài Wi-Fi miễn phí, khách sạn 4 sao này còn cung cấp dịch vụ phòng và dịch vụ tiền sảnh. Du khách có thể thưởng thức đồ uống tại quầy bar.  Khách sạn sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng, sân trong, phòng tắm riêng và vòi xịt/chậu rửa vệ sinh. Tại Phu Cuong Hotel Ca Mau, tất cả các phòng có ga trải giường và khăn tắm.  Chỗ nghỉ có chỗ đậu xe riêng miễn phí, dịch vụ văn phòng và lễ tân 24/24.  Sân bay Cà Mau cách 4 km.', 0, 533803224, '(+84)8688673427', 'u4mb3969gl@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (92, 'Muong Thanh Luxury Ca Mau Hotel', 'Muong Thanh Luxury Ca Mau Hotel cung cấp chỗ ở tại tỉnh Cà Mau và có Wi-Fi miễn phí, nhà hàng cũng như hồ bơi ngoài trời mở cửa quanh năm. Khách sạn cũng có trung tâm spa cùng bồn tắm nước nóng và khách có thể thưởng thức đồ uống tại quầy bar.  Mỗi phòng nghỉ tại khách sạn này đều được trang bị máy lạnh và TV truyền hình cáp màn hình phẳng. Du khách sẽ tìm thấy ấm đun nước trong phòng. Các phòng còn đi kèm phòng tắm riêng. Dép, đồ vệ sinh cá nhân miễn phí và máy sấy tóc cũng được cung cấp để mang lại sự thoải mái cho khách.  Khách có thể tìm thấy cửa hàng cắt tóc ngay trong khuôn viên.  Khách có thể chơi tennis tại khách sạn. Sân bay Rạch Giá cách đó 84 km. Khách sạn cung cấp dịch vụ đón khách miễn phí từ sân bay.', 0, 963807639, '(+84)0196396208', 'evne8ql6zg@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (93, 'Tan Loc Hotel Can Tho City', 'Tan Loc Hotel Can Tho City tọa lạc ở Cần Thơ, cách Vincom Plaza Hùng Vương 8 phút đi bộ và Bến Ninh Kiều 2.7 km. Khách sạn 1 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Các phòng được thiết kế có ban công nhìn ra khu vườn.  Tại khách sạn, phòng nào cũng có điều hòa, bàn làm việc, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Phòng khách đều có tủ lạnh.  Tan Loc Hotel Can Tho City cách Trung tâm thương mại Vincom Xuân Khánh 3.6 km và Can Tho Stadium 7 phút đi bộ. Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách chỗ nghỉ 9 km.', 0, 714085426, '(+84)9812446064', '0eormffo44@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (94, 'Hotel Tây Hồ', 'Hotel Tây Hồ tọa lạc ở Cần Thơ, cách Vincom Plaza Hùng Vương 2.4 km và Can Tho Stadium 3.4 km. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và tổ chức các tour du lịch cho khách.  Phòng khách ở khách sạn được trang bị TV màn hình phẳng. Các phòng được thiết kế có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại Hotel Tây Hồ, phòng nào cũng có ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Bến Ninh Kiều, Trung tâm thương mại Vincom Xuân Khánh và Bảo tàng Cần Thơ. Sân bay Quốc tế Cần Thơ cách 10 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 614628143, '(+84)5529461798', 'gtnm9h5yeq@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (95, 'Khách Sạn Nam Anh', 'Khách Sạn Nam Anh nằm ở Cần Thơ, cách Bảo tàng Cần Thơ 19 phút đi bộ và Can Tho Stadium 2.7 km. Ngoài sân hiên, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, tất cả các phòng đều có tủ quần áo. Mỗi phòng đều được thiết kế có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Khách Sạn Nam Anh có ban công. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần Khách Sạn Nam Anh bao gồm Vincom Plaza Hùng Vương, Trung tâm thương mại Vincom Xuân Khánh và Bến Ninh Kiều. Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách khách sạn 9 km.', 0, 491964503, '(+84)2230100910', 'qycgi2xq3u@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (96, 'Khách sạn AVA Cần Thơ', 'Tọa lạc ở Cần Thơ, cách Trung tâm thương mại Vincom Xuân Khánh 13 phút đi bộ, Khách sạn AVA Cần Thơ cung cấp chỗ nghỉ có Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí. Khách sạn 2 sao này có quầy lễ tân 24 giờ. Đây là chỗ nghỉ không hút thuốc và nằm cách Bến Ninh Kiều 3.1 km.  Khách sạn cách Vincom Plaza Hùng Vương 3.9 km và Bảo tàng Cần Thơ 3.1 km. Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách Khách sạn AVA Cần Thơ 12 km.', 0, 790437152, '(+84)5135797437', 'x4m1gxxscj@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (97, 'LION 6 HOTEL', 'LION 6 HOTEL tọa lạc ở Cần Thơ, cách Trung tâm thương mại Vincom Xuân Khánh 19 phút đi bộ và Bến Ninh Kiều 4.1 km. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tất cả các căn được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Tất cả các phòng có phòng tắm riêng, máy sấy tóc và ga trải giường.  Khách sạn cách Vincom Plaza Hùng Vương 4.2 km và Bảo tàng Cần Thơ 4.1 km.', 0, 728825979, '(+84)9194207243', 'qx9heujmkk@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (98, 'Khách Sạn Hoàng Sơn - Cần Thơ', 'Nằm ở Cần Thơ, cách Vincom Plaza Hùng Vương 15 phút đi bộ và Bến Ninh Kiều 1.9 km, Khách Sạn Hoàng Sơn - Cần Thơ cung cấp chỗ nghỉ có sân hiên và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Đây là chỗ nghỉ không gây dị ứng và tọa lạc cách Trung tâm thương mại Vincom Xuân Khánh 3.5 km.  Các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng được thiết kế có phòng tắm riêng với máy sấy tóc, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra thành phố. Tại khách sạn, tất cả các phòng có ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần Khách Sạn Hoàng Sơn - Cần Thơ bao gồm Can Tho Stadium, Bảo tàng Cần Thơ và Cầu đi bộ Ninh Kiều. Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách chỗ nghỉ 9 km.', 55, 841403953, '(+84)8413046161', 'ngwczsmzb3@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (99, 'West Hotel', 'Nằm ở thành phố Cần Thơ, West Hotel cung cấp chỗ nghỉ thanh lịch và đầy phong cách với truy cập Wi-Fi miễn phí trong các khu vực chung. Khách sạn có lễ tân 24 giờ, hồ bơi trong nhà, trung tâm thể dục và bãi đỗ xe miễn phí trong khuôn viên.  Khách sạn cách Bến Ninh Kiều chỉ 100 m và cách Bảo tàng Cần Thơ 300 m. Chợ Nổi Cái Răng cách nơi đây 6,2 km trong khi Sân bay Rạch Giá cách đó khoảng 72 km.  Với tầm nhìn ra dòng sông/thành phố, các phòng nghỉ máy lạnh tại đây có tủ quần áo, két an toàn, minibar và TV truyền hình vệ tinh/cáp màn hình phẳng. Phòng tắm riêng đi kèm tiện nghi vòi sen, dép, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Đội ngũ nhân viên thân thiện tại West Hotel có thể hỗ trợ khách với các dịch vụ cho thuê xe hơi/xe máy, giữ hành lý, giặt là và sắp xếp tour du lịch. Dịch vụ đưa đón sân bay và các tiện nghi phục vụ doanh nhân cũng được cung cấp với một khoản phụ phí.  Nhà hàng trong khuôn viên phục vụ hàng loạt món ăn ngon Á - Âu. Các bữa ăn với chế độ đặc biệt cũng có thể được chế biến theo yêu cầu, còn đồ uống sau bữa ăn được phục vụ tại quầy bar.', 55, 633964122, '(+84)8885440282', 'oq0tvbqugr@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (100, 'SOJO HOTEL CAN THO', 'Nằm ở Cần Thơ, cách Vincom Plaza Hùng Vương 5 phút đi bộ, SOJO HOTEL CAN THO cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Khách sạn 4 sao này có bếp chung và dịch vụ phòng. Du khách có thể thưởng thức đồ uống tại quầy bar.  Tại khách sạn, các phòng được thiết kế có điều hòa và TV màn hình phẳng.  Chỗ nghỉ có phục vụ bữa sáng mỗi buổi sáng, gồm các lựa chọn thực đơn buffet, thực đơn à la carte và kiểu Á.  Với đội ngũ nhân viên thành thạo tiếng Anh và tiếng Việt, dịch vụ đề xuất 24/7 luôn có sẵn tại lễ tân.  SOJO HOTEL CAN THO cách Bến Ninh Kiều 2.5 km và Trung tâm thương mại Vincom Xuân Khánh 3.5 km.', 40, 843397291, '(+84)8125639366', '9lq84qwurp@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (101, 'TTC Hotel - Can Tho', 'Nằm trên bờ Sông Hậu và cách bờ sông 2 phút đi bộ, TTC Hotel -  Can Tho tọa lạc ở trung tâm thành phố Cần Thơ. Với tầm nhìn ra toàn cảnh thành phố và dòng sông, khách sạn 10 tầng này có hồ bơi ngoài trời, lễ tân 24 giờ và Wi-Fi miễn phí trong toàn bộ khuôn viên.  TTC Hotel -  Can Tho nằm cách Chùa Ông, Chợ Đêm và Sân vận động Cần thơ 500 m. Chỗ nghỉ nằm trong bán kính chỉ 6 km từ chợ nổi Cái Răng và 7 km từ sân bay Cần Thơ. Thành phố Hồ Chí Minh cách đó khoảng 3 giờ lái xe.  Phòng nghỉ lắp máy điều hòa tại đây có sàn lát gạch và được trang bị đầy đủ tiện nghi với tủ để quần áo, bàn làm việc, truyền hình cáp và khu vực ghế ngồi. Trong phòng cũng có minibar và tiện nghi pha trà/cà phê. Phòng tắm riêng được bố trí máy sấy tóc, áo choàng tắm và đồ vệ sinh cá nhân miễn phí.  TTC Hotel -  Can Tho có trung tâm dịch vụ doanh nhân, sòng bạc và hộp đêm. Du khách có thể tận hưởng buổi tiệc nướng/karaoke tại khuôn viên hoặc thư giãn với dịch vụ mát-xa tại spa. Dịch vụ giữ hành lý, dịch vụ giặt là và tiện nghi tổ chức tiệc/hội họp được cung cấp theo yêu cầu.  Nhà hàng TTC trong khuôn viên phục vụ các món ăn Á-Âu ngon từ 06:00 đến 22:00 hàng ngày. Một loạt các loại cocktail, bia và rượu vang được phục vụ tại quán Alfresco Cafe, nơi có tầm nhìn ra toàn cảnh dòng sông.', 0, 338013082, '(+84)7319882955', 'g577vf4nu0@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (102, 'Legacy Mekong', 'Nằm cách Bến Ninh Kiều 1,5 km và trung tâm thành phố 2,5 km, Legacy Mekong cung cấp các phòng lắp máy điều hòa với Wi-Fi miễn phí trong toàn khuôn viên tại thành phố Cần Thơ. Chỗ nghỉ còn có lễ tân làm việc 24 giờ và phòng giữ hành lý cho khách.  Tất cả các phòng nghỉ tại resort này đều được trang bị TV màn hình phẳng, phòng tắm riêng với đồ vệ sinh cá nhân miễn phí và khu vực ghế ngồi. Một số còn đi kèm cả sân trong.  Du khách có thể dùng bữa tại nhà hàng phục vụ nhiều món ăn Việt Nam và món nướng/BBQ trong khuôn viên.  Resort có hồ bơi ngoài trời mở cửa quanh năm và trung tâm thể dục, nơi cung cấp studio tập pilates và yoga, spa cũng như phòng xông hơi khô.  Du khách có thể chơi tennis tại Legacy Mekong. Sân bay Cần Thơ cách đó 12 km.', 0, 965594503, '(+84)9995681661', 'h8y1h7tajx@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (103, 'Ngoc Lan Hotel', 'Ngoc Lan Hotel tọa lạc ở Cao Bằng. Khách sạn 1 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Du khách có thể tận hưởng cảnh núi.  Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các phòng tại khách sạn có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tất cả các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.', 0, 700673435, '(+84)0234099913', 'gotnkn4ytr@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (104, 'Minh Hoang Hotel & Homestay', 'Minh Hoang Hotel & Homestay nằm ở Cao Bằng và có sân hiên. Ngoài phòng chờ chung, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tất cả các phòng đi kèm TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và tủ quần áo.  Khách sạn có sân chơi trẻ em.  Đội ngũ nhân viên lễ tân 24/24 giao tiếp thành thạo bằng tiếng Anh, tiếng Việt và tiếng Hoa.', 0, 18203856, '(+84)0102942483', 'avfe20q3i1@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (105, 'Hotel Los Angeles', 'Hotel Los Angeles cung cấp chỗ nghỉ ở Cao Bằng. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể tận hưởng cảnh thành phố.  Tại khách sạn, phòng nào cũng có bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các phòng tại Hotel Los Angeles có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, các phòng đều đi kèm với ga trải giường và khăn tắm.', 0, 71194472, '(+84)6106049712', '6ubdvhs395@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (106, 'Gold Hotel', 'Gold Hotel tọa lạc ở Cao Bằng và có sân hiên. Ngoài phòng chờ chung, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Các phòng được trang bị TV có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Tại khách sạn, phòng nào cũng có ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng đưa ra hướng dẫn hữu ích về khu vực xung quanh.', 0, 993287931, '(+84)6699976022', 'd59bvso8qm@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (107, 'Gia Quý Hotel', 'Gia Quý Hotel cung cấp chỗ nghỉ ở Cao Bằng. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Ngoài phòng tắm riêng với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại Gia Quý Hotel, các phòng đều có ga trải giường và khăn tắm.', 0, 642625782, '(+84)2802414062', 'mttbyqqu8u@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (108, 'THANH XUÂN HOTEL', 'THANH XUÂN HOTEL cung cấp chỗ nghỉ tại Cao Bằng. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tại khách sạn, các phòng đều đi kèm với ban công với view thành phố. Tại THANH XUÂN HOTEL, tất cả các phòng đều được thiết kế có điều hòa và TV màn hình phẳng.', 0, 540453275, '(+84)5219581782', '158zh1na7i@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (109, 'Muong Thanh Luxury Cao Bang', 'Muong Thanh Luxury Cao Bang tọa lạc ở Cao Bằng và có quầy bar. Ngoài Wi-Fi miễn phí, khách sạn 5 sao này còn cung cấp quầy lễ tân 24 giờ và dịch vụ tiền sảnh. Khách sạn cung cấp hồ bơi trong nhà, trung tâm thể dục, nhân viên phục vụ hoạt động giải trí và dịch vụ phòng.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có tủ quần áo, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Muong Thanh Luxury Cao Bang, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, kiểu Mỹ hoặc kiểu Á cho bữa sáng. Tại chỗ nghỉ, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Anh và Á. Bên cạnh đó, họ có thể yêu cầu món chay.', 50, 925723445, '(+84)4067754191', 'r0p17o60cx@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (110, 'Holiday Inn Hotel', 'Tọa lạc ở Đà Nẵng, cách Bãi biển Thanh Bình chỉ vài bước chân, Holiday Inn Hotel cung cấp chỗ nghỉ có Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí. Khách sạn 1 sao này có quầy lễ tân 24 giờ. Khách sạn có phòng gia đình.  Phòng khách được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng, vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Tại Holiday Inn Hotel, phòng nào cũng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Bãi biển Xuân Thiều 4 phút đi bộ và Trung tâm thương mại Indochina Riverside 5.5 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách Holiday Inn Hotel 6 km.', 70, 857313841, '(+84)2344947226', 'br985kgjns@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (111, 'Gia Han Apartment Da Nang', 'Gia Han Apartment Da Nang tọa lạc ở Đà Nẵng, cách Bãi biển Bắc Mỹ An 1.8 km và Cầu khóa Tình yêu Đà Nẵng 2.1 km. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp phòng chờ chung và dịch vụ phòng. Đây là chỗ nghỉ không hút thuốc và nằm cách Bãi biển Mỹ Khê 6 phút đi bộ.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Với phòng tắm riêng được trang bị vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tất cả các phòng đều có lò nướng.  Gia Han Apartment Da Nang cách Bảo tàng điêu khắc Chăm 2.7 km. Sân bay Quốc tế Đà Nẵng cách 6 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 261866980, '(+84)1414586208', 'r2d8fcd2at@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (112, 'Dreamy Sky - Airport View Boutique Hotel', 'Với sân hiên, Dreamy Sky - Airport View Boutique Hotel cung cấp chỗ nghỉ ở Đà Nẵng, cách Bãi biển Thanh Bình 2.2 km và Bảo tàng điêu khắc Chăm 2.3 km. Ngoài khu vườn, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, phòng chờ chung và dịch vụ thu đổi ngoại tệ cho khách.  Tất cả các căn đi kèm TV màn hình phẳng có truyền hình vệ tinh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Một số phòng có bếp với tủ lạnh, máy rửa bát và lò nướng. Tại khách sạn, tất cả các phòng đều có ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng đưa ra thông tin hữu ích về khu vực xung quanh.  Dreamy Sky - Airport View Boutique Hotel cách Trung tâm thương mại Indochina Riverside 3.4 km và Cầu khóa Tình yêu Đà Nẵng 3.5 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách chỗ nghỉ 1 km.', 72, 80696714, '(+84)4360325283', 'lu25nkc4su@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (113, 'Lotus Rock Hotel Đà Nẵng', 'Nằm ở trung tâm Đà Nẵng, Lotus Rock Hotel Đà Nẵng tọa lạc cách Bãi biển Thanh Bình 2.7 km và Bảo tàng điêu khắc Chăm 16 phút đi bộ. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp máy ATM, dịch vụ văn phòng và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Lotus Rock Hotel Đà Nẵng, các phòng được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ cách Trung tâm thương mại Indochina Riverside 2.3 km và Cầu khóa Tình yêu Đà Nẵng 2.4 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách Lotus Rock Hotel Đà Nẵng 2 km.', 20, 397897847, '(+84)1960580386', '6wperwgbya@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (114, 'Grand Ngoc Bich hotel', 'Tọa lạc ở Đà Nẵng, cách Bãi biển Mỹ Khê 6 phút đi bộ, Grand Ngoc Bich hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Khách sạn 3 sao này cung cấp sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Phòng khách được trang bị điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng, vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Tại Grand Ngoc Bich hotel, phòng nào cũng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Cầu sông Hàn 2.2 km và Cầu khóa Tình yêu Đà Nẵng 2.7 km.', 0, 345683362, '(+84)8679243848', 'f5mjnkqsc7@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (115, 'FSTAY - COZY AND PEACEFUL HOMESTAY DA NANG', 'Nằm ở Đà Nẵng, cách Bãi biển Thanh Bình 14 phút đi bộ, FSTAY - COZY AND PEACEFUL HOMESTAY DA NANG cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Chỗ nghỉ có Wi-Fi miễn phí này nằm cách Trung tâm thương mại Indochina Riverside khoảng 2.6 km và Cầu sông Hàn 2.6 km. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và phòng giữ hành lý cho khách.  Các căn đi kèm điều hòa, tủ lạnh, lò nướng, ấm đun nước, vòi xịt/chậu rửa vệ sinh, máy sấy tóc và bàn làm việc. Ngoài phòng tắm riêng, vòi sen và dép đi trong phòng, các phòng tại guest house đều có view thành phố. Tại FSTAY - COZY AND PEACEFUL HOMESTAY DA NANG, các phòng được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ cách Bảo tàng điêu khắc Chăm 3 km và Cầu khóa Tình yêu Đà Nẵng 4.1 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách FSTAY - COZY AND PEACEFUL HOMESTAY DA NANG 4 km.', 60, 64990310, '(+84)7678168404', '81it8o9o31@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (116, 'NALINI Hotel & Apartment', 'Tọa lạc ở Đà Nẵng, cách Bãi biển Mỹ Khê 3 phút đi bộ và Bãi biển Bắc Mỹ An 500 m, NALINI Hotel & Apartment cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa, sân hiên và nhà hàng.  Tất cả các căn có thiết kế gồm khu vực ghế ngồi, TV màn hình phẳng, cùng phòng tắm riêng có trang bị đồ vệ sinh cá nhân miễn phí, vòi xịt/chậu rửa vệ sinh và vòi sen. Một số căn còn có bếp nhỏ được trang bị lò vi sóng.  Căn hộ có dịch vụ cho thuê xe đạp.  NALINI Hotel & Apartment cách Cầu khóa Tình yêu Đà Nẵng 3.4 km. Sân bay Quốc tế Đà Nẵng cách 7 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 40, 932254184, '(+84)3449377418', 'kc4u7celae@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (117, 'Sala Danang Beach Hotel', 'Tọa lạc ở Đà Nẵng, cách Bãi biển Mỹ Khê 19 phút đi bộ, Sala Danang Beach Hotel cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, hồ bơi ngoài trời và trung tâm thể dục. Chỗ nghỉ này có các tiện nghi như nhà hàng, câu lạc bộ trẻ em và dịch vụ đưa đón miễn phí, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Sân hiên, ngay trong khuôn viên quầy bar và phòng chờ chung có sẵn tại chỗ nghỉ.  Tại khách sạn, mỗi phòng đều được thiết kế có điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tất cả các phòng đều được thiết kế có ấm đun nước, trong đó một số phòng có bếp với tủ lạnh, lò vi sóng và bếp. Tại Sala Danang Beach Hotel, các phòng đều đi kèm với ga trải giường và khăn tắm.  Khách có thể thưởng thức bữa sáng thực đơn buffet, kiểu lục địa hoặc kiểu Á tại chỗ nghỉ.  Thành thạo cả tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn sẵn lòng hỗ trợ khách lên kế hoạch cho kỳ nghỉ.  Chỗ nghỉ cách Bãi biển Bắc Mỹ An 2.1 km và Cầu khóa Tình yêu Đà Nẵng 2 km.', 0, 443483577, '(+84)8855142711', 'pwurxhwqmg@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (118, 'Grand Mercure Danang', 'Đứng sừng sững ở trung tâm thành phố Đà Nẵng, Grand Mercure Danang cung cấp các phòng nghỉ hiện đại với Wi-Fi miễn phí dọc theo bờ sông. Ngoài 3 nhà hàng và quầy bar, khách sạn còn có spa, hồ bơi ngoài trời cũng như tiện nghi tập thể dục.  Truyền hình cáp màn hình phẳng 32 inch, máy pha trà/cà phê và bồn tắm là tiêu chuẩn trong các phòng đi kèm máy điều hòa. Từ cửa sổ cỡ lớn của các phòng nghỉ được chiếu sáng ấm áp, du khách có thể thưởng ngoạn tầm nhìn ngoạn mục ra cảnh đại dương, núi non hoặc sông nước.  Grand Mercure Danang cung cấp chỗ đỗ xe miễn phí. Khách sạn cách sân bay quốc tế Đà Nẵng 10 phút lái xe, trung tâm mua sắm Indochina Mall cách đó 3 km và ga Đà Nẵng cũng như Phố Cổ Hội An 4 km. Xe đưa đón đến trung tâm mua sắm của thành phố và bãi biển Mỹ Khê cũng được cung cấp miễn phí.  Để thư giãn, du khách có thể khám phá thành phố Đà Nẵng bằng xe đạp hoặc chơi tennis. Khách sạn còn có trung tâm dịch vụ doanh nhân và dịch vụ sắp xếp các chuyến tham quan nhằm tạo thêm thuận tiện cho khách.  Nhà hàng La Rive Gauche đầy phong cách tại đây phục vụ ăn uống cả ngày với bữa sáng tự chọn thịnh soạn. Du khách có thể thưởng thức món Dim Sum tại nhà hàng The Golden Dragon trong khi quán Nirvana là nơi lý tưởng để nhâm nhi đồ uống sau bữa ăn. Các nhà hàng The Veranda Grill phục vụ bít tết và hải sản nướng.', 0, 38261753, '(+84)9380526260', '4x5sw38wlz@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (119, 'M Hotel Danang', 'Nằm ở Đà Nẵng, cách Bãi biển Mỹ Khê chỉ vài bước chân, M Hotel Danang cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Ngoài nhà hàng, chỗ nghỉ còn có phòng chờ chung, phòng xông hơi khô và bể sục. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Với phòng tắm riêng được trang bị vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại M Hotel Danang, tất cả các phòng có ga trải giường và khăn tắm.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, kiểu Mỹ hoặc kiểu Á cho bữa sáng.  Khách có thể sử dụng dịch vụ văn phòng hoặc thư giãn tại quầy bar.  Chỗ nghỉ cách Bãi biển Bắc Mỹ An chưa đến 1 km và Cầu khóa Tình yêu Đà Nẵng 3.3 km.', 56, 196516685, '(+84)9059612931', '7hg6cvd429@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (120, 'KHÁCH SẠN HỒNG KÔNG', 'Nằm ở Buôn Ma Thuột, Đắc Lắc, KHÁCH SẠN HỒNG KÔNG tọa lạc cách Trung tâm thương mại Vincom Plaza Buôn Ma Thuột 2.4 km. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp máy ATM, dịch vụ tiền sảnh và phòng giữ hành lý cho khách.  Tại khách sạn, tất cả các phòng đều được thiết kế có bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại KHÁCH SẠN HỒNG KÔNG có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, tất cả các phòng có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Buôn Ma Thuột, cách KHÁCH SẠN HỒNG KÔNG 6 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 296294846, '(+84)0235487242', '80nbwrx3rn@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (121, 'Khách Sạn Thiên Phong', 'Nằm ở Buôn Ma Thuột, cách Trung tâm thương mại Vincom Plaza Buôn Ma Thuột 3.4 km, Khách Sạn Thiên Phong nhìn rathành phố. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tất cả các phòng đi kèm TV màn hình phẳng có truyền hình cáp, ấm đun nước, vòi sen, dép đi trong phòng và bàn làm việc. Tất cả các căn có tủ quần áo.  Lễ tân tại khách sạn có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Sân bay gần nhất là Sân bay Buôn Ma Thuột, cách Khách Sạn Thiên Phong 8 km.', 0, 99867026, '(+84)9244279983', 'vaaygbkv1n@yahoo.com', 1);
