INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (127, 'Elephants Hotel', 'Tọa lạc cách Trung tâm thương mại Vincom Plaza Buôn Ma Thuột 14 phút đi bộ, Elephants Hotel cung cấp chỗ nghỉ 4 sao ở Buôn Ma Thuột, đồng thời có trung tâm thể dục, nhà hàng và quầy bar. Chỗ nghỉ này có các tiện nghi như dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Khách sạn này nhìn ra thành phố và cung cấp sân hiên phơi nắng.  Các phòng được trang bị điều hòa, tủ lạnh, minibar, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Mỗi phòng đều được thiết kế có két an toàn và một số phòng nhìn ra núi. Tại khách sạn, mỗi phòng đều có ga trải giường và khăn tắm.  Sân bay Buôn Ma Thuột cách 8 km.', 0, 454459196, '(+84)4219392826', 'roznur5ls2@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (128, 'Muong Thanh Luxury Buon Ma Thuot Hotel', 'Tọa lạc ở Buôn Ma Thuột, cách Trung tâm thương mại Vincom Plaza Buôn Ma Thuột 2.6 km, Muong Thanh Luxury Buon Ma Thuot Hotel cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Ngoài máy ATM, chỗ nghỉ này còn có nhà hàng và hồ bơi ngoài trời. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Với phòng tắm riêng, ngoài ra một số căn tại khách sạn cũng có view thành phố.  Khách có thể thoải mái chơi bóng bàn và đánh tennis, hoặc tận dụng dịch vụ văn phòng.  Sân bay Buôn Ma Thuột cách 6 km.', 58, 660476836, '(+84)7047816575', '3qmbnamv3e@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (129, 'Nhà Nghỉ THẢO NGUYÊN XANH', 'Tọa lạc ở Buôn Ma Thuột, cách Trung tâm thương mại Vincom Plaza Buôn Ma Thuột 2 km, Nhà Nghỉ THẢO NGUYÊN XANH cung cấp chỗ nghỉ có khu vườn và chỗ đậu xe riêng miễn phí. Khách sạn 5 sao này có quầy lễ tân 24 giờ và phòng giữ hành lý. Một số căn tại chỗ nghỉ có sân hiên với view hồ.  Sân bay gần nhất là Sân bay Buôn Ma Thuột, cách khách sạn 10 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 831967784, '(+84)4982285910', 'rbmjror20v@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (130, 'Sai Gon Dak Nong Hotel', 'Sai Gon Dak Nong Hotel cung cấp chỗ nghỉ tại Gia Nghĩa. Khách sạn 2 sao này có phòng chờ chung và dịch vụ phòng. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn sẵn lòng đưa ra thông tin hữu ích về khu vực xung quanh.  Chỗ nghỉ cách Sân bay Liên Khương 128 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 97523075, '(+84)1594099024', 'bstzx32mn5@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (131, 'Star Hill Dak Nong Retreat', 'Nằm ở Gia Nghĩa, Star Hill Dak Nong Retreat cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa và khu vườn với sân hiên.  Một số chỗ nghỉ có bao gồm ban công nhìn ra núi, bếp nhỏ đầy đủ tiện nghi, cùng phòng tắm chung được trang bị vòi sen.  Khách cũng có thể thư giãn trong khu vực phòng chờ chung.  Sân bay gần nhất là Sân bay Liên Khương, cách nhà nghỉ dưỡng 101 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 726583399, '(+84)3173258403', 'yy5v3q4g6x@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (132, 'KHÁCH SẠN HOÀNG QUANG', 'KHÁCH SẠN HOÀNG QUANG tọa lạc ở Biđong. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, mỗi phòng đều có bàn làm việc, sân hiên với view núi, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Các phòng có tủ quần áo.  Sân bay gần nhất là Sân bay Liên Khương, cách KHÁCH SẠN HOÀNG QUANG 84 km.', 0, 95239240, '(+84)2198871855', 'ysrxb0w43i@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (133, 'Minh Thủy Hotel - 32 Nguyễn Chí Thanh, DB - by BAY LUXURY', 'Minh Thủy Hotel - 32 Nguyễn Chí Thanh, DB - by BAY LUXURY tọa lạc ở Điện Biên Phủ. Căn hộ này cung cấp chỗ nghỉ điều hòa có Wi-Fi miễn phí.  Căn hộ có TV màn hình phẳng.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách căn hộ 1 km.', 0, 493148251, '(+84)1347640081', 'l0egjuqena@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (134, 'An loc hotel', 'An loc hotel cung cấp chỗ nghỉ tại Điện Biên Phủ. Khách sạn 2 sao này có phòng chờ chung và dịch vụ phòng. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tất cả các căn được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tất cả các phòng đều có phòng tắm riêng với máy sấy tóc, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra thành phố. Tại khách sạn, các phòng đều có ga trải giường và khăn tắm.  An loc hotel có sân chơi trẻ em.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn túc trực để hỗ trợ khách.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách chỗ nghỉ 1 km.', 0, 550798647, '(+84)1121873446', 'bcv7sglbob@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (135, 'HoTel Thịnh Vượng', 'HoTel Thịnh Vượng tọa lạc ở Điện Biên Phủ. Ngoài sân hiên, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Mỗi phòng đều có bàn làm việc và TV màn hình phẳng, ngoài ra một số căn tại HoTel Thịnh Vượng có ban công. Tại chỗ nghỉ, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Đội ngũ nhân viên lễ tân giao tiếp thành thạo bằng tiếng Anh và tiếng Việt.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách HoTel Thịnh Vượng 2 km.', 0, 906543640, '(+84)5239891635', 'yg9czwl2ch@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (136, 'Duc Thang Guest House (Nhà Nghỉ Đức Thắng)', 'Nằm ở Điện Biên Phủ, Duc Thang Guest House (Nhà Nghỉ Đức Thắng) có khu vườn và sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí.  Các phòng đều có phòng tắm riêng, trong đó một số phòng có ban công và một số khác cũng nhìn ra thành phố.  Khách có thể thưởng thức bữa sáng thực đơn à la carte, kiểu Á hoặc món chay tại chỗ nghỉ.  Sân bay Điện Biên Phủ cách chỉ vài bước chân.', 40, 373226606, '(+84)3588896905', 'u233q29l8z@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (137, 'Nhà nghỉ Tâm Cường', 'Nhà nghỉ Tâm Cường tọa lạc ở Điện Biên Phủ và có phòng chờ chung và sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại guest house, tất cả các phòng có bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, phòng khách tại Nhà nghỉ Tâm Cường có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Leo núi là hoạt động được ưa chuộng trong khu vực. Ngoài ra, Nhà nghỉ Tâm Cường có dịch vụ thuê ô tô.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách guest house 2 km.', 0, 189723027, '(+84)3366558127', 'qlmsti1bzg@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (138, 'Mường Thanh Grand Dien Bien Phu Hotel', 'Cách Chợ Điện Biên 500 m, Muong Thanh Dien Bien Hotel cung cấp những chỗ ở trang nhã, sang trọng với truy cập Wi-Fi miễn phí trong toàn bộ tòa nhà. Khách sạn có hồ bơi ngoài trời, sân tennis và trung tâm dịch vụ doanh nhân.  Với tầm nhìn ra thành phố, các phòng máy lạnh được trang bị két an toàn, tủ quần áo, khu vực tiếp khách, minibar và truyền hình cáp màn hình phẳng. Phòng tắm riêng bao gồm bồn tắm/vòi sen, máy sấy tóc cùng đồ vệ sinh cá nhân miễn phí.  Tại Muong Thanh Dien Bien Hotel, khách có thể tận hưởng mát-xa thư giãn trong spa. Dịch vụ giữ hành lý, đặt vé và giặt là có thể được sắp xếp tại lễ tân 24 giờ. Tiện nghi tổ chức tiệc/hội họp có sẵn, và dịch vụ đưa đón được cung cấp kèm phụ phí.  Khách có thể thưởng thức các món ăn phương Tây và địa phương ngon miệng tại nhà hàng ngay trong khuôn viên khách sạn. Các bữa ăn cũng có thể được phục vụ trong sự riêng tư tại phòng nghỉ của khách.', 56, 582155903, '(+84)4794851043', 'ffoutfp7d7@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (139, 'Cát Tiên Hotel', 'Tọa lạc ở Cát Tiên, Cát Tiên Hotel cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa và khu vườn với sân hiên.  Tủ lạnh và ấm đun nước đều được cung cấp.  Sân bay Liên Khương cách 144 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 712431219, '(+84)5898602165', '4ociftac9m@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (140, 'Ngoc Son Hotel', 'Nằm ở Biên Hoà, cách Công viên văn hóa Suối Tiên 16 km, Ngoc Son Hotel cung cấp chỗ nghỉ có Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí. Khách sạn 2 sao này có dịch vụ phòng. Một số phòng tại chỗ nghỉ có sân hiên với view thành phố.  Khách sạn cách Trung tâm thương mại Vincom Thủ Đức 17 km và Trung tâm mua sắm AEON MALL Bình Dương Canary 19 km.', 0, 594023361, '(+84)1887700646', 'vo7bkfoqxg@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (141, 'Green Hope Lodge', 'Green Hope Lodge cung cấp chỗ nghỉ mộc mạc, giản dị với phòng tắm riêng và khu vực tiếp khách tiện nghi. Chỗ nghỉ này có nhà hàng và lễ tân 24 giờ trong khuôn viên. Khách có thể truy cập WiFi miễn phí trong toàn bộ lodge.  Tọa lạc bên Sông Đồng Nai, lodge này nằm cách Vườn Quốc gia Nam Cát Tiên khoảng 250 m và Xã Tà Lài 12 km. Chỗ đỗ xe riêng được cung cấp miễn phí ngay trong khuôn viên.  Phòng nghỉ của Lodge Green Hope đơn giản và được trang bị đồ nội thất bằng gỗ chạm khắc, bộ khăn trải giường mới giặt cũng như màn chống muỗi. Tất cả các phòng đều có đồ vệ sinh cá nhân miễn phí.  Du khách có thể thưởng thức các món ăn Việt Nam tại Nhà hàng Green Hope. Cách lodge chỉ 250 m cũng có một khu chợ nhỏ, nơi du khách có thể mua các sản phẩm tươi ngon của địa phương.', 0, 516444770, '(+84)5342010407', '1jz264l0am@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (142, 'Cát Tiên Riverside', 'Cát Tiên Riverside tọa lạc ở Tân Phú, nhìn ra sông và có Wi-Fi miễn phí cùng chỗ đậu xe riêng miễn phí.  Căn hộ có sân hiên nơi khách có thể nhìn ra núi, khu vực ghế ngồi, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi gồm tủ lạnh và lò nướng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, kiểu lục địa hoặc kiểu Anh/ Ai-len cho bữa sáng. Tại Cát Tiên Riverside, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực châu Phi, Mỹ và Argentina. Bên cạnh đó, họ có thể yêu cầu món chay và kosher (cho người đạo Do Thái).  Chỗ nghỉ có sân chơi trẻ em.  Khách nghỉ tại Cát Tiên Riverside có thể đi xe đạp gần đó, hoặc thỏa thích sử dụng khu vườn.  Sân bay Liên Khương cách 145 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 16, 383760446, '(+84)5189861126', 'wl4zolx1jb@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (143, 'Mansion Park Hotel & Apartment', 'Nằm cách Công viên văn hóa Suối Tiên 15 km, Mansion Park Hotel & Apartment cung cấp chỗ nghỉ 3 sao ở Biên Hoà, đồng thời có phòng chờ chung, nhà hàng và quầy bar. Chỗ nghỉ này tọa lạc cách Trung tâm thương mại Vincom Thủ Đức 17 km, Trung tâm mua sắm AEON MALL Bình Dương Canary 19 km và Bảo tàng lịch sử Việt Nam 28 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Tại khách sạn, tất cả các phòng có bàn làm việc. Tất cả các căn đều có điều hòa, két an toàn và TV màn hình phẳng để du khách có thể sử dụng.  Mansion Park Hotel & Apartment cách Trung Tâm Thương Mại Diamond Plaza 29 km và Bưu điện Trung tâm 29 km.', 0, 863626514, '(+84)0679540498', 'mcrz8y86nn@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (144, 'Aurora Hotel Plaza', 'Tọa lạc ở Biên Hoà, cách Công viên văn hóa Suối Tiên 18 km, Aurora Hotel Plaza cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Ngoài Wi-Fi miễn phí, khách sạn 4 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Khách sạn có sân hiên và nhìn ra thành phố, ngoài ra du khách có thể thưởng thức bữa ăn tại nhà hàng hoặc đồ uống tại quầy bar.  Tại khách sạn, tất cả các phòng đều được thiết kế có điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tại Aurora Hotel Plaza, mỗi phòng đều có ga trải giường và khăn tắm.  Tại chỗ nghỉ, khách có thể sử dụng phòng xông hơi khô.  Aurora Hotel Plaza cách Trung tâm thương mại Vincom Thủ Đức 19 km và Trung tâm mua sắm AEON MALL Bình Dương Canary 20 km.', 33, 768005784, '(+84)4923294989', 'asa1z7cfgm@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (145, 'The River Home', 'Với hồ bơi ngoài trời, khu vườn, cùng sân hiên, The River Home cung cấp chỗ nghỉ ở Nhơn Trạch có Wi-Fi miễn phí và nhìn ra sông. Chỗ đậu xe riêng có thể được sắp xếp với một khoản phụ phí.  Nhà nghỉ dưỡng có 3 phòng ngủ, 4 phòng tắm, ga trải giường, khăn tắm, TV, khu vực ăn uống, bếp đầy đủ tiện nghi, cùng ban công nhìn ra hồ bơi. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Khách tại nhà nghỉ dưỡng có thể thưởng thức bữa sáng kiểu Á.  The River Home có dịch vụ cho thuê ô tô, đồng thời du khách có thể câu cá gần đó.  Sân bay Quốc tế Tân Sơn Nhất cách 20 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 77562233, '(+84)4923802595', 'hk1m1mgpm6@gmail.com', 4);
