INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (147, 'Huynh Duc Hotel', 'Huynh Duc Hotel có Wi-Fi miễn phí, sân hiên tắm nắng và các chỗ ở tại thành phố Cao Lãnh, trong bán kính khoảng 150 km về phía Tây của Thành phố Hồ Chí Minh. Chỗ đỗ xe riêng được cung cấp miễn phí trong khuôn viên.  Mỗi phòng tại khách sạn đều có máy lạnh và TV màn hình phẳng. Một số phòng có khu vực tiếp khách để quý khách thư giãn sau một ngày bận rộn. Mỗi phòng còn đi kèm phòng tắm riêng.  Khách sạn có lễ tân 24 giờ.  Khách sạn cung cấp dịch vụ cho thuê xe đạp. Sân bay gần nhất là Sân bay Rạch Giá, cách đó 79 km. Khách sạn cách Sân bay Cần Thơ 90 km và Sân bay Quốc tế Tân Sơn Nhất 150 km. Thành phố Vĩnh Long cách đó 43 km.', 0, 263763240, '(+84)8460314645', '76ue5hrvj1@outlook.com', 1);
