INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (175, 'Hai Mươi Hotel & Apartment', 'Nằm cách Bảo tàng dân tộc học Việt Nam 1.7 km, Hai Mươi Hotel & Apartment cung cấp chỗ nghỉ 2 sao ở Hà Nội và có quầy bar. Chỗ nghỉ cách Trung tâm thương mại Vincom Nguyễn Chí Thanh khoảng 3.5 km, Sân vận động Quốc gia Mỹ Đình 4.1 km và Bảo tàng mỹ thuật Việt Nam 5.9 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ tiền sảnh và Wi-Fi miễn phí.  Khách sạn cách Chùa Một Cột 5.9 km và Văn Miếu - Quốc Tử Giám 5.9 km.', 0, 82835982, '(+84)1717518936', 'wbi2smb3of@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (176, 'Sao Hotel Nguyen Ngoc Vu', 'Nằm tại vị trí thuận tiện ở Cau Giay District, Hà Nội, Sao Hotel Nguyen Ngoc Vu nằm cách Trung tâm thương mại Vincom Nguyễn Chí Thanh 2.1 km, Bảo tàng dân tộc học Việt Nam 4.4 km và Bảo tàng mỹ thuật Việt Nam 5 km. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Chỗ đậu xe riêng có thể được sắp xếp với một khoản phụ phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tại Sao Hotel Nguyen Ngoc Vu, các phòng được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ cách Văn Miếu - Quốc Tử Giám 5 km và Chùa Một Cột 5.4 km.', 40, 38175418, '(+84)5292158463', 'fo89chhcy3@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (177, '9 LIGHT APARTMENT', 'Tọa lạc cách Bảo tàng dân tộc học Việt Nam 4.5 km ở Hà Nội, 9 LIGHT APARTMENT cung cấp chỗ nghỉ có điều hòa và Wi-Fi miễn phí.  Mỗi căn đều có ban công nhìn ra thành phố, TV màn hình phẳng, bếp tiện nghi, cùng phòng tắm riêng có vòi sen, máy sấy tóc và dép đi trong phòng. Tủ lạnh và bếp, cũng như ấm đun nước đều được cung cấp.  Căn hộ có cả dịch vụ cho thuê xe đạp và dịch vụ cho thuê ô tô.  9 LIGHT APARTMENT cách Lăng Chủ tịch Hồ Chí Minh 6 km. Sân bay Quốc tế Nội Bài cách 18 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 27, 397312769, '(+84)9676500634', 'wljez9041w@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (178, 'Keypad Stay -Self check-in', 'Nằm ở Hà Nội, cách Nhà hát múa rối Thăng Long 2 phút đi bộ và trung tâm 500 m, Keypad Stay -Self check-in cung cấp chỗ nghỉ có điều hòa, Wi-Fi miễn phí và phòng chờ chung.  Homestay có khu vực ghế ngồi với TV màn hình phẳng, cũng như phòng tắm riêng với đồ vệ sinh cá nhân miễn phí, máy sấy tóc và vòi sen. Tủ lạnh và ấm đun nước đều được cung cấp.  Tại Keypad Stay -Self check-in, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Việt.  Chỗ nghỉ có dịch vụ cho thuê xe đạp.  Các điểm tham quan nổi tiếng gần Keypad Stay -Self check-in bao gồm Hồ Hoàn Kiếm, Ô Quan Chưởng và Nhà thờ Thánh Joseph. Sân bay Quốc tế Nội Bài cách 24 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 26, 212341948, '(+84)4297208822', 'muf37frysk@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (179, 'Scent Premium Hotel', 'Scent Premium Hotel tọa lạc ở trung tâm Khu Phố Cổ, chỉ cách Hồ Hoàn Kiếm 2 phút đi bộ. Khách sạn cung cấp Wi-Fi miễn phí.  Tất cả phòng nghỉ tại đây đều có cửa sổ nhìn ra cảnh thành phố hoặc hồ nước. Mỗi phòng nghỉ tại đây đều được trang bị máy điều hòa, TV màn hình phẳng và két an toàn. Bàn làm việc và khu vực ghế ngồi nhỏ cũng có trong phòng. Phòng tắm riêng đi kèm bồn tắm/vòi sen.  Scent Premium Hotel nằm trong bán kính 3 phút lái xe từ Chợ Đồng Xuân và chợ đêm cuối tuần. Ga Hà Nội nằm cách chỗ nghỉ 10 phút lái xe trong khi sân bay quốc tế Nội Bài cách đó 35 phút lái xe.  Du khách có thể đi tham quan quanh thành phố Hà Nội một cách dễ dàng với dịch vụ đặt vé và đặt tour. Ngoài ra, du khách có thể thuê xe đạp và xe hơi tại Scent Premium Hotel. Các liệu pháp mát-xa nhẹ nhàng được cung cấp sau một ngày hoạt động. Chỗ nghỉ cũng có dịch vụ giặt là và phòng giữ hành lý.  Nhà hàng Ceilo phục vụ các món ăn Việt Nam và Châu Âu suốt cả ngày. Quầy bar trên sân thượng có tường kính cho tầm nhìn ra toàn cảnh Hồ Hoàn Kiếm.', 81, 892751083, '(+84)3903710793', '5e2wql15no@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (180, 'Khách Sạn Lam Anh 7', 'Nằm ở Hà Nội, cách Tràng Tiền Plaza 8.4 km và Nhà hát Lớn Hà Nội 9.2 km, Khách Sạn Lam Anh 7 cung cấp chỗ nghỉ có quầy bar và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 4 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Đây là chỗ nghỉ không hút thuốc và tọa lạc cách Nhà hát múa rối Thăng Long 9.2 km.  Tại khách sạn, các phòng được thiết kế có bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại Khách Sạn Lam Anh 7 có TV màn hình phẳng và điều hòa, trong đó một số phòng có sân hiên. Tại chỗ nghỉ, tất cả các phòng đều có ga trải giường và khăn tắm.  Khách Sạn Lam Anh 7 cách Nhà thờ Thánh Joseph 9.3 km và Bảo tàng mỹ thuật Việt Nam 10 km.', 56, 475869983, '(+84)1113683206', 'i307qd2atu@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (181, 'Elegant Mansion 88', 'Nằm ở Hà Nội, cách Hồ Tây 2.9 km, Elegant Mansion 88 cung cấp chỗ nghỉ có hồ bơi ngoài trời theo mùa, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Khách có thể sử dụng quầy bar.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, ban công với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Phòng nào cũng có két an toàn và một số phòng nhìn ra hồ. Tất cả các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Khách có thể thưởng thức bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu lục địa tại chỗ nghỉ.  Elegant Mansion 88 cung cấp chỗ nghỉ 5 sao với phòng xông hơi khô và sân hiên.  Chỗ nghỉ cách Đền Quán Thánh 4.1 km và Ô Quan Chưởng 4.7 km.', 0, 416345382, '(+84)6397139283', '50b9hgnlfu@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (182, 'La Siesta Classic Hang Thung', 'Nằm tại vị trí thuận tiện ở trung tâm Hà Nội, La Siesta Classic Hang Thung cung cấp các phòng có điều hòa, hồ bơi ngoài trời, Wi-Fi miễn phí và trung tâm thể dục. Ngoài dịch vụ phòng, chỗ nghỉ này còn có nhà hàng và sân hiên để phục vụ du khách. Du khách có thể thưởng thức đồ uống tại quầy bar.  Các căn đi kèm TV màn hình phẳng có truyền hình cáp, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tất cả các phòng có két an toàn.  Chỗ nghỉ có phục vụ bữa sáng mỗi sáng, gồm các lựa chọn thực đơn buffet, thực đơn à la carte và kiểu Á.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng hỗ trợ khách vào bất kỳ thời điểm nào trong ngày.  Các điểm tham quan nổi tiếng gần La Siesta Classic Hang Thung bao gồm Nhà hát múa rối Thăng Long, Ô Quan Chưởng và Hồ Hoàn Kiếm. Sân bay Quốc tế Nội Bài cách 24 km.', 0, 384320967, '(+84)3117598421', '2vcet2rqc8@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (183, 'Memory Hotel', 'Memory Hotel nằm cách Hồ Hoàn Kiếm và Lăng Chủ tịch Hồ Chí Minh 700 m. Nơi đây có trung tâm dịch vụ doanh nhân và cung cấp truy cập Wi-Fi miễn phí trong toàn bộ khuôn viên.  Khách sạn cách ga Hà Nội 150 m và cách Văn Miếu 400 m. Sân bay Quốc tế Nội Bài cách đó 40 phút lái xe.  Được trang bị máy lạnh và quạt, các phòng nghỉ còn có khu vực tiếp khách và phòng tắm riêng. Trong phòng có TV truyền hình cáp, minibar và tủ quần áo. Ngoài ra còn có điện thoại.  Memory Hotel có quầy lễ tân 24 giờ. Quý khách có thể được hỗ trợ với các dịch vụ giặt là, đặt vé và chỗ để hành lý. Bàn đặt tour có thể sắp xếp các chuyến du lịch cho quý khách.', 15, 756506477, '(+84)4379985892', '1hv98nk3wh@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (184, 'Little Hanoi Hotel', 'Nằm đối diện Hồ Hoàn Kiếm trong Khu Phố Cổ, Little Diamond Hotel 2 cung cấp các phòng nghỉ lắp máy điều hòa với Wi-Fi miễn phí và nhà hàng.  Khách sạn cách các điểm tham quan địa phương bao gồm Nhà hát Múa rối Nước và chợ đêm cuối tuần chưa đầy 10 phút đi bộ. Ga Hà Nội cách đó 2 km trong khi du khách đi 35 km là tới Sân bay quốc tế Nội Bài.  Được trang bị sàn gỗ và hệ thống sưởi, mỗi phòng tại đây đều đi kèm truyền hình cáp cùng tủ lạnh mini. Phòng tắm riêng có bồn tắm, tiện nghi vòi sen nước nóng và đồ vệ sinh cá nhân.  Phòng giữ hành lý, dịch vụ đưa đón sân bay và dịch vụ giặt là cũng được cung cấp cho khách. Khách cũng có thể thuê xe máy và xe đạp tại đây. Đội ngũ nhân viên của khách sạn cũng có thể hỗ trợ khách thông tin du lịch và dịch vụ đặt chỗ.  Bữa sáng được phục vụ ngay trong phòng nghỉ của khách theo yêu cầu hoặc tại nhà hàng trong nhà của khách sạn (mở cửa từ 07:00-11:00).', 20, 894072568, '(+84)6260574227', 'mjjevsiluj@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (185, 'MayHouse Travel', 'Nằm tại vị trí thuận tiện ở Hà Nội, MayHouse Travel cung cấp các phòng có điều hòa, xe đạp miễn phí và Wi-Fi miễn phí. Chỗ nghỉ nằm gần một số điểm tham quan nổi tiếng, cách Nhà hát múa rối Thăng Long khoảng 4 phút đi bộ, Ga Hà Nội khoảng 1.7 km, Ô Quan Chưởng khoảng chưa đến 1 km. Đây là chỗ nghỉ không hút thuốc và tọa lạc cách Hồ Hoàn Kiếm 4 phút đi bộ.  Ngoài phòng tắm riêng, vòi sen và đồ vệ sinh cá nhân miễn phí, các phòng tại guest house đều có view thành phố. Tất cả các căn ở MayHouse Travel được trang bị TV màn hình phẳng và máy sấy tóc.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê ô tô.  Các điểm tham quan nổi tiếng gần MayHouse Travel bao gồm Tràng Tiền Plaza, Nhà thờ Thánh Joseph và Nhà hát Lớn Hà Nội. Chỗ nghỉ cách Sân bay Quốc tế Nội Bài 26 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 50, 288616164, '(+84)9186183730', 'f7vyvsv9po@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (186, 'Hanoi La Cascada House & Travel', 'Với khu vườn, phòng chờ chung và sân hiên, Hanoi La Cascada House & Travel nằm ở trung tâm Hà Nội, cách Ô Quan Chưởng 5 phút đi bộ. Khách sạn 3 sao này có dịch vụ tiền sảnh và bàn bán tour. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tất cả các phòng có tủ quần áo.  Các điểm tham quan nổi tiếng gần Hanoi La Cascada House & Travel bao gồm Hồ Hoàn Kiếm, Nhà thờ Thánh Joseph và Đền Quán Thánh. Sân bay Quốc tế Nội Bài cách 23 km.', 0, 648531388, '(+84)7114044560', '07jsq4usov@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (187, 'Sumitomo10 Apartment - Lane 12 Dao Tan street', 'Cách Bảo tàng dân tộc học Việt Nam 1.8 km, Sumitomo10 Apartment - Lane 12 Dao Tan street có khu vườn, phòng chờ chung, điều hòa, ban công và Wi-Fi miễn phí.  Căn hộ có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng truyền hình cáp, bếp đầy đủ tiện nghi gồm tủ lạnh và lò vi sóng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Bếp và ấm đun nước đều được cung cấp.  Sumitomo10 Apartment - Lane 12 Dao Tan street cách Trung tâm thương mại Vincom Nguyễn Chí Thanh 1.9 km và Chùa Một Cột 3.1 km.', 0, 78093377, '(+84)4474939709', 'nd55m20t9m@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (188, 'Hanoi Garden Hotel & Spa', 'Với khu vườn và sân hiên, Hanoi Garden Hotel & Spa nằm tại vị trí thuận tiện ở trung tâm Hà Nội, cách Ô Quan Chưởng 5 phút đi bộ. Khách sạn 4 sao này có dịch vụ tiền sảnh và bàn bán tour. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Phòng khách có tủ quần áo.  Hanoi Garden Hotel & Spa có phục vụ bữa sáng thực đơn buffet hằng ngày.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Nhà hát múa rối Thăng Long, Hồ Hoàn Kiếm và Nhà thờ Thánh Joseph. Sân bay Quốc tế Nội Bài cách 24 km.', 48, 465470203, '(+84)8810819041', 'pp77c4tn3a@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (189, 'Peridot Grand Luxury Boutique Hotel', 'Tọa lạc tại thành phố Hà Nội, "Peridot Grand Hotel & Spa" có 2 nhà hàng trong khuôn viên, 3 quán bar, hồ bơi ngoài trời, trung tâm thể dục và quán bar. Khách sạn 5 sao này cũng có sảnh khách chung và dịch vụ concierge. Chỗ nghỉ cung cấp dịch vụ lễ tân 24 giờ, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Tất cả phòng nghỉ tại khách sạn đều được trang bị máy điều hòa, truyền hình cáp màn hình phẳng, ấm đun nước, chậu rửa vệ sinh (bidet), máy sấy tóc và bàn làm việc. Các phòng còn có WiFi miễn phí cũng như phòng tắm riêng đi kèm vòi sen và đồ vệ sinh cá nhân miễn phí. Tại "Peridot Grand Hotel & Spa", các phòng còn được trang bị khu vực ghế ngồi.  Khách nghỉ ở đây có thể thưởng thức bữa sáng kiểu lục địa hoặc tự chọn.  Peridot Grand Hotel & Spa còn có sân hiên tắm nắng. Khách nghỉ tại khách sạn có thể tham gia các hoạt động trong và xung quanh thành phố Hà Nội, như đi xe đạp.  Du khách có thể thuê xe hơi hoặc xe máy để khám phá khu vực, sử dụng trung tâm dịch vụ doanh nhân hoặc đọc báo trong khuôn viên.  Các điểm tham quan nổi tiếng gần "Peridot Grand Hotel & Spa" bao gồm Chợ Đồng Xuân, Nhà hát múa rối nước Thăng Long và Nhà Thờ Lớn. Sân bay gần nhất là sân bay quốc tế Nội Bài, cách chỗ nghỉ 29 km, và chỗ nghỉ cung cấp dịch vụ đưa đón sân bay với một khoản phụ phí.', 0, 31371270, '(+84)1422267841', '92kzocsdtc@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (190, 'Thanh Binh Hotel', 'Thanh Binh Hotel tọa lạc ở Hà Tĩnh. Mỗi phòng tại khách sạn 2 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng xe đạp miễn phí và sân hiên. Khách sạn còn cung cấp Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Các phòng được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các căn có phòng tắm riêng, dép đi trong phòng và ga trải giường.  Lễ tân tại khách sạn có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Sân bay gần nhất là Sân bay quốc tế Vinh, cách Thanh Binh Hotel 56 km.', 0, 885808082, '(+84)4410727959', 'kxcpbiw7jy@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (191, 'Bình Minh Hotel', 'Bình Minh Hotel nằm ở Hà Tĩnh và có quầy bar. Ngoài nhà hàng, khách sạn 3 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, tất cả các phòng có ban công với view thành phố. Các căn đều có tủ lạnh.  Khách có thể thưởng thức bữa sáng thực đơn à la carte, kiểu lục địa hoặc kiểu Á tại chỗ nghỉ.  Sân bay quốc tế Vinh cách 54 km.', 0, 887909317, '(+84)5172788731', '0utcb5qquk@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (192, 'Homestay Thiên Cầm', 'Homestay Thiên Cầm nằm ở Cẩm Xuyên và có khu vườn. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Sân bay quốc tế Vinh cách 81 km.', 0, 834196976, '(+84)1182167242', 'i8w3z9ybe7@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (193, 'Songlam Waterfront Hotel', 'Songlam Waterfront Hotel có hồ bơi ngoài trời, trung tâm thể dục, khu vườn và sân hiên ở Hà Tĩnh. Mỗi phòng tại khách sạn 4 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng bể sục. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tại Songlam Waterfront Hotel, các phòng đều đi kèm với ga trải giường và khăn tắm.  Tại chỗ nghỉ, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực pizza, hải sản và Bít-tết. Bên cạnh đó, họ có thể yêu cầu món chay, không chứa sữa và đồ ăn Halal.  Sân bay quốc tế Vinh cách 11 km.', 0, 542296661, '(+84)1997542931', 'smcm8kggw0@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (194, 'Hoa Tien Paradise Villa', 'Với khu vườn, nhà hàng, cùng quầy bar, Hoa Tien Paradise Villa cung cấp chỗ nghỉ ở Hà Tĩnh có Wi-Fi miễn phí và nhìn ra khu vườn. Nhà nghỉ dưỡng cung cấp chỗ đậu xe riêng miễn phí và dịch vụ phòng.  Có sân hiên nhìn ra biển, nhà nghỉ dưỡng có 2 phòng ngủ, phòng khách, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi, 3 phòng tắm với vòi xịt/chậu rửa vệ sinh và vòi sen.  Khách có thể sử dụng BBQ tại nhà nghỉ dưỡng.  Sân bay quốc tế Vinh cách 24 km.', 0, 191731319, '(+84)1344940711', 'nj5zfqyay9@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (195, 'Meliá Vinpearl Cua Sot Beach Resort', 'Tọa lạc tại tỉnh Hà Tĩnh, Meliá Vinpearl Cua Sot Beach Resort có tầm nhìn ra bãi biển Xuân Hải. Du khách có thể dùng bữa tại nhà hàng trong khuôn viên hoặc ngâm mình dưới hồ bơi ngoài trời. Chỗ nghỉ này cung cấp WiFi miễn phí.  Tất cả các căn tại biệt thự đều có máy điều hòa, cửa sổ lớn và ban công riêng nhìn ra biển. Phòng tắm riêng đi kèm tiện nghi vòi sen và đồ vệ sinh cá nhân miễn phí.  Nằm trên khu đất rộng 160 m², nhà hàng Sand Dream Restaurant phục vụ một loạt món ăn hải sản, Việt Nam, Châu Á và Châu Âu.  Sân bay gần nhất là sân bay Vinh, cách chỗ nghỉ 35 km.', 0, 299835266, '(+84)6242596038', '2t88sbfrph@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (196, 'Meliá Vinpearl Ha Tinh', 'Meliá Vinpearl Ha Tinh cung cấp chỗ nghỉ tại thành phố Hà Tĩnh. Khách sạn 5 sao này có WiFi miễn phí, 2 quầy bar và 2 nhà hàng trong khuôn viên, trung tâm spa cũng như phòng tập thể dục. Quầy lễ tân tại đây hoạt động suốt 24 giờ/ngày.  Tất cả phòng nghỉ tại khách sạn đều được trang bị TV. Phòng tắm riêng đi kèm vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Các phòng tại Meliá Vinpearl Hotel Ha Tinh có máy điều hòa và tủ để quần áo.  Chỗ nghỉ phục vụ bữa sáng buffet và bữa sáng kiểu Mỹ hằng ngày.  Sân bay gần nhất là sân bay Vinh, cách chỗ nghỉ 50 km.', 0, 515336282, '(+84)5651640620', 'q143878txi@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (197, 'Star Hotel Hai Duong', 'Tọa lạc ở Hải Dương, cách Nhà hát lớn Hải Phòng 45 km, Star Hotel Hai Duong cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Ngoài nhà hàng, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Tất cả các căn được trang bị TV màn hình phẳng có truyền hình cáp, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Tại khách sạn, tất cả các phòng đều có ga trải giường và khăn tắm.  Star Hotel Hai Duong có sân hiên phơi nắng. Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê ô tô.  Với đội ngũ nhân viên thành thạo tiếng Anh, tiếng Indonesia, tiếng Malaysia và tiếng Việt, dịch vụ thông tin luôn có sẵn tại lễ tân.  Star Hotel Hai Duong cách Trung tâm thương mại Vincom Ngô Quyền 46 km và Hai Phong Railway Station 46 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách khách sạn 51 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 278336517, '(+84)9246272092', 'tt0srdb4nx@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (198, 'Khách sạn New Phương Đông', 'Tọa lạc ở Hải Dương, cách Nhà hát lớn Hải Phòng 49 km, Khách sạn New Phương Đông cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể thưởng thức đồ uống tại quầy bar.  Tại khách sạn, mỗi phòng đều có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và ban công với view vườn. Các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Khách sạn New Phương Đông cách Trung tâm thương mại Vincom Ngô Quyền 49 km. Sân bay Quốc tế Cát Bi cách 67 km.', 0, 10218006, '(+84)7439110399', '3ycvej4ius@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (199, 'Khách Sạn Sông Lô', 'Nằm cách Nhà hát lớn Hải Phòng 45 km và Trung tâm thương mại Vincom Ngô Quyền 46 km, Khách Sạn Sông Lô cung cấp các phòng ở Hải Dương. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Tại khách sạn, mỗi phòng đều có ban công. Tại Khách Sạn Sông Lô, tất cả các phòng đều có điều hòa và TV màn hình phẳng.  Chỗ nghỉ cách Hai Phong Railway Station 46 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Khách Sạn Sông Lô 51 km.', 0, 538475780, '(+84)6472097556', 'geeacle5kd@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (200, 'Lotus Hotel Hai Duong', 'Tọa lạc ở Hải Dương, cách Nhà hát lớn Hải Phòng 48 km, Lotus Hotel Hai Duong cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí và sân hiên. Khách sạn 2 sao này có phòng giữ hành lý. Khách sạn cũng cung cấp Wi-Fi miễn phí và dịch vụ đưa đón sân bay mất phí.  Tất cả các căn tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Một số phòng có bếp với bếp. Tại Lotus Hotel Hai Duong, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ cách Trung tâm thương mại Vincom Ngô Quyền 48 km. Sân bay Quốc tế Cát Bi cách 67 km.', 0, 991190726, '(+84)6003358119', 'y0erfzwdc4@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (201, 'YO Hotel', 'Tọa lạc ở Hải Dương, cách Nhà hát lớn Hải Phòng 44 km, YO Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, nhà hàng và quầy bar. Khách sạn nằm cách Trung tâm thương mại Vincom Ngô Quyền khoảng 45 km và Hai Phong Railway Station 45 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Các phòng được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tất cả các phòng có phòng tắm riêng, máy sấy tóc và ga trải giường.  Khách sạn có phục vụ bữa sáng thực đơn à la carte hằng ngày.  Sân bay Quốc tế Cát Bi cách 50 km.', 0, 58374856, '(+84)4243298206', 'knneui2j05@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (202, 'Asean Hotel', 'Nằm ở Hải Dương, cách Nhà hát lớn Hải Phòng 43 km, Asean Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí và sân hiên. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp quầy lễ tân 24 giờ. Khách sạn có phòng gia đình.  Các căn đi kèm điều hòa, tủ lạnh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng được trang bị vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Tại Asean Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Trung tâm thương mại Vincom Ngô Quyền 44 km và Hai Phong Railway Station 44 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Asean Hotel 50 km.', 66, 413952523, '(+84)3066682676', 'kjqe34525i@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (203, 'Nam Cuong Hai Duong Hotel', 'Nam Cuong Hai Duong Hotel có hồ bơi ngoài trời, nhà hàng mở cửa 24 giờ và các phòng nghỉ máy lạnh với truy cập Internet miễn phí cả ngày. Quầy bar ở tầng 25 có tầm nhìn toàn cảnh thành phố.  Các phòng tại Nam Cuong Hai được trang bị TV và minibar. Phòng tắm riêng có vòi sen và đồ vệ sinh cá nhân.  Du khách có thể thư giãn trong bồn tạo sóng hoặc chăm sóc bản thân với dịch vụ mát-xa hoặc chăm sóc sắc đẹp. Tại đây có một số hoạt động giải trí năng động như các lớp tập thể dục, sân tennis và bida.  Quý khách có thể thưởng thức ẩm thực Việt Nam, châu Á và châu Âu cả ngày lẫn đêm tại Nhà hàng Garden View. Khách sạn có một số quầy bar cho khách thư giãn với đồ uống.  Nam Cuong Hai Duong Hotel cách thành phố Hà Nội 1,5 giờ lái xe. Sân bay Quốc tế Nội Bài cách đó 2 giờ lái xe.', 44, 319046426, '(+84)4093740303', '4g41ouxv23@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (204, 'Hai Duong Garden', 'Nằm ởHải Dương, cách Nhà hát lớn Hải Phòng 47 km và Trung tâm thương mại Vincom Ngô Quyền 48 km, Hai Duong Garden cung cấp chỗ nghỉ có Wi-Fi miễn phí, khu vườn với sân hiên, phòng tập thể dục và bể sục. Chỗ nghỉ có điều hòa và bể sục.  Căn hộ có ban công, khu vực ghế ngồi, TV màn hình phẳng truyền hình cáp, bếp đầy đủ tiện nghi gồm tủ lạnh và lò vi sóng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí.  Khách cũng có thể thư giãn trong khu vực phòng chờ chung.  Hai Duong Garden cách Hai Phong Railway Station 48 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách chỗ nghỉ 68 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 804301441, '(+84)9797190432', 'rfrdyfjzgg@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (205, 'Dieu Thuyen Motel', 'Với quầy bar, Dieu Thuyen Motel tọa lạc ở Thành phố Hải Phòng, Hải Phòng, cách Nhà hát lớn Hải Phòng 4.2 km và Trung tâm thương mại Vincom Ngô Quyền 6.5 km. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và tổ chức các tour du lịch cho khách.  Các phòng ở khách sạn được trang bị TV màn hình phẳng.  Dieu Thuyen Motel cách Cảng Tuần Châu 43 km và Cáp treo Nữ Hoàng 47 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách chỗ nghỉ 5 km.', 0, 47924253, '(+84)3537679703', 'q8jvtz2mbp@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (206, 'Phuong Anh 3 Hotel', 'Tọa lạc ở Thành phố Hải Phòng, cách Trung tâm thương mại Vincom Ngô Quyền 3.4 km, Phuong Anh 3 Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí và sân hiên. Khách sạn 1 sao này có dịch vụ tiền sảnh và phòng giữ hành lý. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Phuong Anh 3 Hotel, phòng nào cũng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Nhà hát lớn Hải Phòng 4.4 km và Cảng Tuần Châu 40 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Phuong Anh 3 Hotel 5 km.', 0, 453657899, '(+84)5835358466', 'nqjeqbtbug@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (207, 'Punt Hotel', 'Nằm ở Thành phố Hải Phòng, cách Trung tâm thương mại Vincom Ngô Quyền 2 km, Punt Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Khách sạn 2 sao này có dịch vụ phòng và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Với phòng tắm riêng được trang bị vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại Punt Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Chỗ nghỉ cách Nhà hát lớn Hải Phòng 3 km và Cảng Tuần Châu 41 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Punt Hotel 6 km.', 0, 376157481, '(+84)0894935907', '3ula3u2mbx@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (208, 'Cozi Hotel', 'Với Wi-Fi miễn phí, Cozi Hotel cung cấp chỗ nghỉ ở Thành phố Hải Phòng, cách Trung tâm thương mại Vincom Ngô Quyền 8 phút đi bộ và Nhà hát lớn Hải Phòng 1.8 km. Ngoài phòng giữ hành lý, chỗ nghỉ này còn có sân hiên phơi nắng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, máy sấy tóc và tủ quần áo. Các phòng đều có phòng tắm riêng với dép đi trong phòng, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra thành phố. Tại khách sạn, phòng nào cũng có ga trải giường và khăn tắm.  Dịch vụ trợ giúp 24/7 luôn có sẵn tại lễ tân với đội ngũ nhân viên thành thạo tiếng Anh, tiếng Pháp, tiếng Nhật và tiếng Việt.  Cozi Hotel cách Cảng Tuần Châu 42 km và Cáp treo Nữ Hoàng 46 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách chỗ nghỉ 7 km.', 0, 138674373, '(+84)6185207419', 'dpt1r2h9zc@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (209, 'Tan An Palace', 'Với kiến trúc theo trường phái tân cổ điển, Tan An Palace cung cấp chỗ nghỉ ở thành phố Hải Phòng. Khách sạn có lễ tân 24 giờ, trung tâm dịch vụ doanh nhân và chỗ đỗ xe miễn phí trong khuôn viên. Wi-Fi lẫn chỗ đậu xe riêng được cung cấp miễn phí trong khuôn viên.  Các phòng máy lạnh tại đây được cách âm và được thiết kế với cửa sổ cỡ lớn cùng khu vực tiếp khách đi kèm TV thông minh 43 inch. Tiện nghi khác bao gồm tủ quần áo, két an toàn và tủ lạnh. Phòng tắm riêng được trang bị sẵn bồn tắm, vòi sen, máy sấy tóc, dép và đồ vệ sinh cá nhân miễn phí.  Các nhân viên thân thiện tại Tan An Palace sẵn sàng hỗ trợ quý khách bố trí chỗ để hành lý, dịch vụ giặt ủi và đặt tour. Dịch vụ ăn uống tại phòng cũng được cung cấp cho quý khách.  Tan An Palace cách Nhà hát lớn Hải Phòng 3,3 kkm và trung tâm thương mại Vincom Plaza Ngô Quyền 3,6 km. Sân bay gần nhất là sân bay quốc tế Cát Bi, cách đó 8 km.', 70, 32039065, '(+84)6043062120', 'gcr90vqwz3@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (210, 'The Flamboyant #StayWork Vinhomes Imperia', 'Tọa lạc ở Thành phố Hải Phòng, cách Nhà hát lớn Hải Phòng 2.9 km và Trung tâm thương mại Vincom Ngô Quyền 3.5 km, The Flamboyant #StayWork Vinhomes Imperia nhìn ra thành phố và cung cấp Wi-Fi miễn phí.  Được thiết kế với ban công, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi sen và đồ vệ sinh cá nhân miễn phí. Tủ lạnh, lò vi sóng và bếp cũng như ấm đun nước đều được trang bị trong bếp.  Khách sạn căn hộ có dịch vụ cho thuê xe đạp.  The Flamboyant #StayWork Vinhomes Imperia cách Cảng Tuần Châu 45 km và Cáp treo Nữ Hoàng 49 km.', 20, 3155369, '(+84)7529067046', '7040py3ero@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (211, 'Homestay Honey Appartment Hải Phòng - Hoàng Huy Grand Tower', 'Với xe đạp miễn phí, phòng chờ chung, cùng quầy bar, Homestay Honey Appartment Hải Phòng - Hoàng Huy Grand Tower cung cấp chỗ nghỉ ở Thành phố Hải Phòng có Wi-Fi miễn phí và nhìn ra thành phố. Chỗ nghỉ nằm cách Nhà hát lớn Hải Phòng 3.4 km và cung cấp bếp chung.  Căn hộ điều hòa này có 2 phòng ngủ, phòng khách, bếp đầy đủ tiện nghi với tủ lạnh và ấm đun nước, 2 phòng tắm với vòi sen và đồ vệ sinh cá nhân miễn phí. TV màn hình phẳng có truyền hình cáp được cung cấp.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng đưa ra thông tin hữu ích về khu vực xung quanh.  Căn hộ có dịch vụ cho thuê ô tô.  Homestay Honey Appartment Hải Phòng - Hoàng Huy Grand Tower cách Trung tâm thương mại Vincom Ngô Quyền 4.1 km và Cảng Tuần Châu 46 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách chỗ nghỉ 11 km.', 0, 65501841, '(+84)8938761607', 'mznbepka2v@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (212, 'Flamingos Cat Ba Resort luxury', 'Nhìn ra thành phố, Flamingos Cat Ba Resort luxury ở Thành phố Hải Phòng cung cấp chỗ nghỉ có trung tâm thể dục, khu vực bãi biển riêng, phòng chờ chung, sân hiên và nhà hàng. Chỗ nghỉ có phòng xông hơi khô.  Chỗ nghỉ có điều hòa, bếp đầy đủ tiện nghi với khu vực ăn uống, TV màn hình phẳng, cũng như phòng tắm riêng với vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tủ lạnh và minibar, cũng như ấm đun nước đều được cung cấp.  Tại căn hộ, khách có thể sử dụng hồ bơi trong nhà.  Khách có thể sử dụng dịch vụ trông trẻ tại Flamingos Cat Ba Resort luxury.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Bãi biển Cat Co 1, Bãi biển Cát Cò 2 và Bãi biển Cat Co 3. Chỗ nghỉ cách Sân bay Quốc tế Cát Bi 54 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 687161497, '(+84)4860307680', 'm59ed79bbn@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (213, 'Mercure Hai Phong', 'Nằm tại thành phố Hải Phòng, Mercure Hai Phong là khách sạn 5 sao có nhà hàng, hồ bơi ngoài trời, trung tâm thể dục, quán bar, Wi-Fi miễn phí, CLB trẻ em và dịch vụ tiền sảnh. Khách sạn còn cung cấp lễ tân 24 giờ, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Mỗi phòng tại khách sạn được trang bị bàn làm việc, TV màn hình phẳng, phòng tắm riêng, máy điều hòa và tủ quần áo.  Mercure Hai Phong phục vụ bữa sáng kiểu lục địa và tự chọn hàng ngày. Nhà hàng phục vụ các món ăn phương Tây, Hàn Quốc và châu Á ngon miệng theo kiểu BBQ và tự chọn. Du khách có thể thưởng thức nhiều loại đồ uống tại quầy bar.  Mercure Hai Phong có sân hiên và tầm nhìn ra quang cảnh thành phố. Khách sạn cũng bố trí spa, trung tâm thể dục và hồ bơi trên tầng mái. Khách doanh nhân có thể sử dụng 6 phòng họp thuận tiện tại đây.  Mercure Hai Phong cách Nhà hát Lớn Hải Phòng 1,8 km, trung tâm thương mại Vincom Plaza Ngô Quyền 2,3 km và sân bay gần nhất là sân bay quốc tế Cát Bi 7 km. Khách sạn cung cấp dịch vụ đưa/đón sân bay kèm phụ phí.', 0, 230917878, '(+84)3687575262', 'u8fqhp5e5b@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (214, 'Pearl River Hotel', 'Pearl River Hai Phong Hotel nằm tại vị trí thuận lợi ở thành phố Hải Phòng và có hồ bơi ngoài trời, WiFi miễn phí tại các khu vực chung, nhà hàng trong khuôn viên và lễ tân 24 giờ.  Khách sạn nằm trong bán kính 20 phút lái xe từ Chùa Hàng, Nhà hát Lớn Hải Phòng và trung tâm thương mại Vincom Plaza Hải Phòng. Du khách lái xe 30 phút là đến Bãi biển Đồ Sơn và 15 phút là đến sân bay quốc tế Cát Bi.  Tất cả các phòng rộng rãi tại khách sạn đều có đồ nội thất ấm cúng, máy điều hòa, hệ thống sưởi, truyền hình vệ tinh, tủ lạnh mini, két an toàn và tiện nghi ủi. Phòng tắm riêng đi kèm vòi sen, máy sấy tóc và đồ vệ sinh cá nhân. Dịch vụ phòng 24 giờ cũng được cung cấp tại đây.  Pearl River Hai Phong Hotel có đầy đủ tiện nghi, đảm bảo cho khách luôn cảm thấy hứng thú trong thời gian lưu trú. Quý khách có thể rèn luyện sức khỏe tại trung tâm thể dục đầy đủ tiện nghi hoặc thư giãn với liệu pháp chăm sóc toàn thân tại spa của khách sạn. Các tiện nghi khác bao gồm sòng bạc, trung tâm dịch vụ doanh nhân và phòng hội nghị.  Quý khách có thể thưởng thức ẩm thực Á và quốc tế tại nhà hàng Jade hay thư giãn với những món ăn nhẹ cùng đồ uống tại các quầy bar trong khách sạn.', 0, 257941159, '(+84)9350973422', 'od5tsog4yg@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (215, 'Thien Phuc Hotel', 'Nằm cách Bãi biển Nha Trang 4 phút đi bộ và Trung tâm thương mại Nha Trang Center 600 m, Thien Phuc Hotel cung cấp các phòng điều hòa và phòng tắm riêng ở Nha Trang. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, các phòng được thiết kế có bàn làm việc, TV, phòng tắm riêng, ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần Thien Phuc Hotel bao gồm Nhà thờ Chánh tòa Kitô Vua (Nhà thờ Núi), Tháp Trầm Hương và Ga Nha Trang. Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách chỗ nghỉ 36 km.', 40, 334148237, '(+84)9818451753', 'cjxw4zujbe@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (216, 'Hien Luong Hotel', 'Cách bãi biển công cộng Nha Trang trong vòng 100 m, Hien Luong Hotel cung cấp chỗ ở cơ bản và truy cập Wi-Fi miễn phí trong toàn bộ khuôn viên. Khách sạn có lễ tân 24 giờ và chỗ đỗ xe miễn phí trong khuôn viên.  Được trang bị nội thất giản dị, các phòng máy lạnh ở đây có sàn lát gạch, bàn làm việc, tủ quần áo và khu vực tiếp khách. Ngoài ra còn đi kèm tủ lạnh và TV. Phòng tắm riêng được trang bị dép và tiện nghi vòi sen.  Nhân viên thân thiện tại Hien Lương Hotel có thể hỗ trợ khách với dịch vụ đặt vé và sắp xếp việc đi tham quan. Dịch vụ giặt là và ủi cũng được cung cấp theo yêu cầu với một khoản phụ phí.  Từ khách sạn du khách chỉ cần đi 150 m là đến Chợ Đêm Nha Trang và 300 m là tới Quảng trường 2/4. Đảo Hòn Tre nổi tiếng nằm trong bán kính 10,7 km từ nơi nghỉ này trong khi Sân bay Nha Trang cách đó khoảng 27 km.', 0, 787825525, '(+84)5992949827', '3ra5c6x9t6@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (217, 'New Day Hotel', 'New Day Hotel nằm ở Nha Trang, cách Tháp Trầm Hương 12 phút đi bộ và Ga Nha Trang 2.3 km. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Khách sạn nằm cách Bảo tàng Khánh Hòa 18 phút đi bộ và Chợ Đầm 2.4 km.  Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và máy sấy tóc, các căn tại khách sạn có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tất cả các căn đều có tủ quần áo và ấm đun nước để khách sử dụng.  Các điểm tham quan nổi tiếng gần New Day Hotel bao gồm Bãi biển Nha Trang, Trung tâm thương mại Nha Trang Center và Nhà thờ Chánh tòa Kitô Vua (Nhà thờ Núi). Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách chỗ nghỉ 35 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 32202708, '(+84)5117293441', 'ahct64sh87@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (218, 'Super OYO 598 Peony Hotel', 'Với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ, Super OYO 598 Peony Hotel nằm ở Cam Ranh, cách 100 Egg Mud Bath 45 km. Khách sạn 2 sao này có các phòng được trang bị điều hòa. Chỗ nghỉ này cung cấp bàn bán tour, cùng dịch vụ thu đổi ngoại tệ cho khách.  Phòng khách tại khách sạn đi kèm khu vực ghế ngồi và TV. Các căn đều có tủ lạnh.  Sân bay gần nhất là Sân bay Liên Khương, cách Super OYO 598 Peony Hotel 126 km.', 51, 57790805, '(+84)9075034005', '4i5xv71w5i@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (219, 'Apartment Plaża', 'Cách Bãi biển Hòn Chồng 2 phút đi bộ, Apartment Plaża có quầy bar, điều hòa, ban công và Wi-Fi miễn phí.  Căn hộ có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và minibar, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Bếp và ấm đun nước đều được cung cấp.  Các điểm tham quan nổi tiếng gần Apartment Plaża bao gồm Bãi biển Ba Làng, Hòn Chồng và Tháp Bà Ponagar. Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách chỗ nghỉ 39 km.', 0, 52983341, '(+84)4810244134', 'p3tm2ixuew@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (220, 'Saphia Hotel Nha Trang', 'Nằm ở Nha Trang, cách Bãi biển Nha Trang 5 phút đi bộ, Saphia Hotel Nha Trang cung cấp chỗ nghỉ có hồ bơi ngoài trời và chỗ đậu xe riêng. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Chỗ nghỉ này cung cấp dịch vụ văn phòng, dịch vụ tiền sảnh và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tất cả các căn có tủ quần áo.  Saphia Hotel Nha Trang có sân hiên phơi nắng.  Chỗ nghỉ cách Tháp Trầm Hương 17 phút đi bộ và Trung tâm thương mại Nha Trang Center 3.2 km.', 74, 682356638, '(+84)3747178676', 'g61g8nzflp@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (221, 'Trần Long Cù Hin Hotel', 'Nhìn ra núi, Trần Long Cù Hin Hotel ở Cam Lâm cung cấp chỗ nghỉ có khu vườn, sân hiên và quầy bar. Khách sạn căn hộ có WiFi và chỗ đậu xe riêng miễn phí.  Được thiết kế với sân trong, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Ngoài ra một số căn còn có bếp được trang bị tủ lạnh, lò nướng và minibar.  Trần Long Cù Hin Hotel có sân chơi trẻ em.  Chỗ nghỉ có cả dịch vụ cho thuê xe đạp và dịch vụ cho thuê ô tô.  Trần Long Cù Hin Hotel cách Bãi Dài 2.4 km và 100 Egg Mud Bath 17 km. Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách khách sạn căn hộ 12 km.', 0, 870477684, '(+84)4332607876', 'yfv0902kz7@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (222, 'Ale Nha Trang Hotel', 'Ale Nha Trang Hotel có hồ bơi ngoài trời, khu vườn, phòng chờ chung và sân hiên ở Nha Trang. Chỗ nghỉ này có các tiện nghi như nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Các phòng được thiết kế có phòng tắm riêng, trong đó một số phòng có ban công và một số khác cũng nhìn ra thành phố.  Khách sạn có phục vụ bữa sáng thực đơn buffet hoặc thực đơn à la carte.  Ale Nha Trang Hotel còn có dịch vụ cho thuê xe đạp và dịch vụ văn phòng.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Bãi biển Nha Trang, Tháp Trầm Hương và Trung tâm thương mại Nha Trang Center. Sân bay quốc tế Cam Ranh cách 34 km.', 0, 27523315, '(+84)9856041145', 'qg7u9rxwwo@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (223, 'Panorama Ocean Nha Trang', 'Nằm giáp biển, Panorama Ocean Nha Trang cung cấp chỗ nghỉ 5 sao ở Nha Trang, đồng thời có trung tâm thể dục, khu vườn và khu vực bãi biển riêng. Ngoài nhà hàng, chỗ nghỉ còn có quầy bar và hồ bơi trong nhà. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, phòng chờ chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, mỗi phòng đều được thiết kế có bàn làm việc. Với phòng tắm riêng được trang bị vòi sen và đồ vệ sinh cá nhân miễn phí, các căn tại Panorama Ocean Nha Trang có TV màn hình phẳng và điều hòa, trong đó một số phòng có sân hiên. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  Panorama Ocean Nha Trang có phục vụ bữa sáng thực đơn buffet mỗi buổi sáng.  Các điểm tham quan nổi tiếng gần khách sạn bao gồm Bãi biển Nha Trang, Tháp Trầm Hương và Trung tâm thương mại Nha Trang Center. Sân bay quốc tế Cam Ranh cách 35 km.', 55, 136593327, '(+84)9631310069', 'ubhlybxus1@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (224, 'Virgo Hotel Nha Trang', 'Với quầy bar, Virgo Hotel Nha Trang tọa lạc ở Nha Trang, Khánh Hòa, cách Bãi biển Nha Trang 12 phút đi bộ và Tháp Trầm Hương 1.3 km. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí. Một số căn tại chỗ nghỉ có ban công với view thành phố.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV và phòng tắm riêng với vòi sen.  Khách tại Virgo Hotel Nha Trang có thể thưởng thức bữa sáng thực đơn buffet.  Chỗ nghỉ cung cấp chỗ nghỉ 5 sao với hồ bơi trong nhà.  Các điểm tham quan nổi tiếng gần Virgo Hotel Nha Trang bao gồm Trung tâm thương mại Nha Trang Center, Nhà thờ Chánh tòa Kitô Vua (Nhà thờ Núi) và Ga Nha Trang. Sân bay quốc tế Cam Ranh cách 34 km.', 0, 729141534, '(+84)5823969179', '3yo9tnrq7e@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (225, 'Nhà Nghỉ SAO MAI', 'Tọa lạc ở Hà Tiên, cách Kep Jetty 30 km, Nhà Nghỉ SAO MAI cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Khách sạn 1 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Đây là chỗ nghỉ không gây dị ứng và nằm cách Wat Samathi Pagoda 38 km.  Tại khách sạn, tất cả các phòng đều được thiết kế có bàn làm việc, ga trải giường và sân trong với view thành phố. Tất cả các căn đều có tủ quần áo và ấm đun nước để khách sử dụng.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên luôn túc trực 24/7 tại lễ tân.  Nhà Nghỉ SAO MAI cách Phnom Chisor 46 km và Kampot Train Station 49 km. Sân bay gần nhất là Sân bay Quốc tế Phú Quốc, cách chỗ nghỉ 73 km.', 0, 747568741, '(+84)0468318226', 'sjcf6icacp@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (226, 'Ninila Fruit Farm Bungalow', 'Nhà khách Ninila Fruit Farm Bungalow ở ấp Ông Lang này cung cấp các dịch vụ hỗ trợ 24 giờ và đưa đón sân bay có thu phí. Tại đây có Wi-Fi miễn phí.  Nhà khách nằm trong bán kính 4,9 km từ Nhà máy Nước Mắm, 5,3 km từ Trung tâm Lặn Coco và 5,5 km từ Đền Dinh Cậu. Sân bay Quốc tế Phú Quốc cách đó 12 km.  Các phòng nghỉ ở đây có sân hiên, minibar và bàn trang điểm. Ấm đun nước điện cũng được cung cấp. Phòng tắm riêng được trang bị vòi sen, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Bàn đặt tour và chỗ để hành lý nằm trong số các tiện nghi có tại Ninila. Chỗ đỗ xe được cung cấp miễn phí cho khách.', 0, 24681432, '(+84)2749488755', '5yd1zapvyv@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (227, 'Quoc Vinh Hotel', 'Tọa lạc ở Rạch Giá, cách Bến Tàu Rạch Giá - Phú Quốc 5.5 km, Quoc Vinh Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí và sân hiên. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Đây là chỗ nghỉ không hút thuốc và nằm cách Chùa Tam Bảo 5.1 km.  Sân bay gần nhất là Sân bay Rạch Giá, cách khách sạn 4 km.', 0, 654629115, '(+84)8794967657', '51nvn7oe1g@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (228, 'Nipola Hotel', 'Nipola Hotel cung cấp chỗ nghỉ tiêu chuẩn gắn điều hòa tại thị trấn Dương Đông ở Phú Quốc. Khách có thể sử dụng WiFi miễn phí trong toàn bộ chỗ nghỉ và đỗ xe miễn phí tại địa điểm gần đó.  Các phòng rộng rãi được trang bị TV màn hình phẳng với các kênh truyền hình cáp và tủ lạnh mini. Một số phòng có cửa sổ nhìn ra cảnh biển/sông. Phòng tắm riêng đi kèm tiện nghi vòi sen, dép cùng đồ vệ sinh cá nhân miễn phí.  Nhân viên tại quầy lễ tân 24 giờ/ngày có thể giúp khách giữ hành lý và đặt vé. Chỗ nghỉ còn có bàn đặt tour.  Nipola Hotel cách chùa Sùng Hưng 300 m và cách Dinh Cậu 700 m. Công viên giải trí Vinpearl Land Phú Quốc và vườn thú Vinpearl Night Safari đều nằm trong bán kính 18 km từ chỗ nghỉ. Sân bay gần nhất là sân bay quốc tế Phú Quốc, cách đó 6 km.', 10, 363085774, '(+84)7193237060', 'g5fkjhxebx@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (229, 'BB Hotel&Resort', 'Nằm ở Phú Quốc, cách Bãi Trường 4 phút đi bộ, BB Hotel&Resort cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Mỗi phòng tại khách sạn 3 sao này đều nhìn ra núi, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Tại khách sạn, tất cả các phòng có điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tại BB Hotel&Resort, các phòng đều đi kèm với ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu Á mỗi sáng.  Chỗ nghỉ cách Bãi Dinh Cậu 2.8 km và Chùa Sùng Hưng 3 km.', 72, 727346064, '(+84)5207185714', '06nlrgfmi7@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (230, 'Hai Hien Guesthouse', 'Tọa lạc gần các nhà hàng, quán bar karaoke và tiệm mát xa, Hai Hien Guesthouse cũng nằm trong bán kính 5 phút đi bộ từ Bãi biển Dinh Cậu và chỉ 100 m từ Chợ Dương Đông. Truy cập Wi-Fi miễn phí được cung cấp trong toàn bộ khuôn viên.  Được làm mát bằng máy lạnh và quạt máy, các phòng nghỉ tại đây có truyền hình cáp, minibar cũng như khu vực tiếp khách. Phòng tắm riêng đi kèm với tiện nghi vòi sen và dép.  Quý khách có thể sắp xếp việc đi tham quan tại bàn đặt tour. Nhân viên lễ tân 24 giờ có thể hỗ trợ khách với các dịch vụ giặt là/ủi.  Nhà khách cách Bảo tàng Cội Nguồn 1 km và cách đó 8 km là Suối Tranh cũng như Sân bay Quốc tế Phú Quốc. Bãi Sao và Nhà tù Phú Quốc nằm trong bán kính khoảng 12 km từ nơi nghỉ này trong khi cách đó 13 km là làng chài Hàm Ninh.', 0, 621948768, '(+84)3285606839', 'cniler928d@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (231, 'La Phan Phu Quoc, Hillside Apartment', 'Với Chùa Sùng Hưng nằm cách đó 24 km, La Phan Phu Quoc, Hillside Apartment cung cấp chỗ nghỉ, nhà hàng, hồ bơi ngoài trời, khu vườn và phòng chờ chung. WiFi miễn phí có sẵn ở toàn bộ chỗ nghỉ.  Chỗ nghỉ có điều hòa, bếp đầy đủ tiện nghi, TV màn hình phẳng, cũng như phòng tắm riêng với vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Một số căn có sân hiên và/hoặc ban công nhìn ra thành phố.  Căn hộ có phục vụ bữa sáng thực đơn buffet và kiểu Á hằng ngày.  Khách có thể sử dụng câu lạc bộ trẻ em tại La Phan Phu Quoc, Hillside Apartment.  Chỗ nghỉ cách Corona Casino 46 km. Sân bay Quốc tế Phú Quốc cách 18 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 20, 974968042, '(+84)2513490125', 'p7lw2367y6@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (232, 'Sea Sense Resort', 'Nổi bật với hồ bơi ngoài trời quay mặt ra biển, Sea Sense Resort cung cấp các suite và biệt thự có ban công nhìn thẳng ra biển và WiFi miễn phí. Nơi đây có nhà hàng riêng, bàn đặt tour và dịch vụ đặt vé.  Sea Sense Resort tọa lạc tại ấp Ông Lang, cách thị trấn Dương Đông 7,5 km. Hồ Dương Đông nằm trong bán kính 11 km từ resort trong khi sân bay Phú Quốc cách đó 17,2 km.  Tất cả các suite và biệt thự tại đây đều được trang bị máy điều hòa, TV truyền hình cáp màn hình phẳng, ấm đun nước điện và minibar. Các căn có khu vực ghế ngồi và phòng tắm riêng với vòi sen nước nóng cùng máy sấy tóc.  Sea Sense Resort cung cấp dịch vụ lễ tân (mở cửa từ 06:00- 22:00) và dịch vụ dọn phòng hằng ngày. Bàn đặt tour cũng nằm trong số các tiện nghi có tại đây. Dịch vụ đưa đón sân bay, giặt là và ủi cũng có thể được thu xếp với một khoản phụ phí.', 30, 447967781, '(+84)0144439669', 'vjdry0fbch@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (233, 'The Shells Resort & Spa Phu Quoc', 'Nằm dọc theo bờ biển của thị trấn Dương Đông, "The Shells Resort & Spa Phu Quoc" có hồ bơi ngoài trời, trung tâm thể dục và khu vực bãi biển riêng. Resort này cung cấp dịch vụ lễ tân 24 giờ, chỗ đỗ xe riêng miễn phí và WiFi miễn phí trong toàn bộ khuôn viên.  Chợ Dương Đông nằm trong bán kính 4 km từ chỗ nghỉ này.  Phòng nghỉ lắp máy điều hòa tại đây có ban công riêng, sàn lát gạch, tủ để quần áo, khu vực ghế ngồi, két an toàn và truyền hình cáp màn hình phẳng. Ấm đun nước điện và minibar cũng được trang bị trong phòng. Tất cả các phòng đều nhìn ra biển và được bố trí phòng tắm riêng với bồn tắm, tiện nghi vòi sen cùng đồ vệ sinh cá nhân miễn phí.  Khách lưu trú tại "The Shells Resort & Spa Phu Quoc" có thể sử dụng phòng xông hơi khô hoặc tận hưởng dịch vụ mát-xa thư giãn tại spa. Dịch vụ giặt là và sắp xếp tour du lịch có thể được cung cấp theo yêu cầu. Chỗ nghỉ cũng có tiện nghi tổ chức hội họp và sự kiện.  Tại nhà hàng, du khách sẽ được phục vụ một loạt món ăn ngon của Việt Nam. Các bữa ăn cũng có thể được phục vụ trong sự riêng tư ngay tại phòng nghỉ của khách.', 45, 692668283, '(+84)0721842769', 'gyneruwexc@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (234, 'Premier Village Phu Quoc Resort Managed by Accor', 'Nằm hướng ra biển trên đảo Phú Quốc,Premier Village Phu Quoc Resort Managed by Accor có hồ bơi ngoài trời và Wi-Fi miễn phí. Resort 5 sao này nằm cách Chùa Sùng Hưng 25 km và công viên giải trí Vinpearl Land Phú Quốc 42 km.  Phòng nghỉ tại resort có khu vực ghế ngồi, truyền hình vệ tinh màn hình phẳng, bếp, khu vực phòng ăn và phòng tắm riêng với đồ vệ sinh cá nhân miễn phí cùng bồn tắm. Premier Village Phu Quoc Resort Managed by Accor cung cấp một số phòng có sân hiên. Các phòng còn được trang bị máy pha cà phê và bàn làm việc.  Chỗ nghỉ phục vụ bữa sáng tự chọn hoặc kiểu lục địa. Premier Village Phu Quoc Resort Managed by Accor có nhà hàng chuyên về ẩm thực Việt Nam, bánh pizza và các món nướng/BBQ. Du khách cũng có thể yêu cầu thực đơn chay và thực đơn không chứa sữa.  Chỗ nghỉ có bể sục, phòng xông hơi khô và trung tâm thể dục.  Nhân viên lễ tân có thể giao tiếp bằng tiếng Anh và tiếng Pháp sẵn sàng hỗ trợ du khách suốt 24 giờ.  Nhà tù Phú Quốc nằm trong bán kính 15 km từ resort trong khi Trại nuôi Ngọc trai Phú Quốc cách đó 19 km. Sân bay Quốc tế Phú Quốc cách chỗ nghỉ 20 km.', 0, 310343148, '(+84)6289795684', 'juz8jby5if@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (235, 'khách sạn sơn hạ', 'Khách sạn sơn hạ ở Kon Tum, nằm cách Bishop''s House of Kontum 29 km và với sân hiên. Ngoài khu vườn, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tất cả các phòng đi kèm TV màn hình phẳng có truyền hình cáp, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Khách sạn cung cấp một số phòng nhìn ra thành phố và phòng nào cũng có ban công. Tại khách sạn sơn hạ, các phòng đều có ga trải giường và khăn tắm.  Lễ tân tại chỗ nghỉ có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Sân bay gần nhất là Sân bay Pleiku, cách khách sạn sơn hạ 71 km.', 0, 963085876, '(+84)6989782326', '0ceuez8d6q@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (236, 'Khách sạn Hội An - Kon Tum', 'Nằm ở Kon Tum, cách Bishop''s House of Kontum 6.3 km, Khách sạn Hội An - Kon Tum cung cấp chỗ nghỉ có phòng chờ chung và chỗ đậu xe riêng miễn phí. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Mỗi phòng đều có ban công.  Các căn ở khách sạn được trang bị TV màn hình phẳng có truyền hình vệ tinh. Tại Khách sạn Hội An - Kon Tum, tất cả các phòng có ga trải giường và khăn tắm.  Chỗ nghỉ có sân hiên phơi nắng.  Sân bay gần nhất là Sân bay Pleiku, cách Khách sạn Hội An - Kon Tum 48 km.', 0, 682124700, '(+84)5486299040', 'uzatki1v95@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (237, 'Window 2 Hotel', 'Nằm ở thành phố Kon Tum, Window 2 Hotel có khu vườn và sân hiên. Khách sạn 2 sao này cung cấp Wi-Fi miễn phí và quầy lễ tân 24 giờ.', 70, 397430370, '(+84)1747822364', 'dxefxmgdbk@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (238, 'Hào Hoa Hotel Kon Tum', 'Nằm ở Kon Tum, cách Bishop''s House of Kontum 17 phút đi bộ, Hào Hoa Hotel Kon Tum cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí và sân hiên. Khách sạn 2 sao này có bếp chung và dịch vụ phòng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ và dịch vụ tiền sảnh cho khách.  Tại khách sạn, phòng nào cũng có sân trong. Các phòng đều có điều hòa, bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Hào Hoa Hotel Kon Tum có ban công. Tất cả các phòng đều có tủ lạnh.  Chỗ nghỉ cách Pleiku Stadium 47 km. Sân bay gần nhất là Sân bay Pleiku, cách Hào Hoa Hotel Kon Tum 43 km.', 0, 740433452, '(+84)9710376484', '855arb9w2x@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (239, 'Hoàng Ánh - Kon Xom Luh', 'Cách Bishop''s House of Kontum 16 km, Hoàng Ánh - Kon Xom Luh có ban công, khu vườn và quầy bar. Chỗ nghỉ có bể sục và bồn tắm spa.  Chalet có sân hiên nơi khách có thể nhìn ra núi, khu vực ghế ngồi, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi gồm lò nướng và lò vi sóng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Minibar, bếp và máy nướng bánh mì, cũng như máy pha cà phê và ấm đun nước đều được cung cấp.  Sân bay gần nhất là Sân bay Pleiku, cách Hoàng Ánh - Kon Xom Luh 63 km.', 0, 382200964, '(+84)7425593431', 'eu5velqzdp@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (240, 'Khách sạn Xà Nu', 'Tọa lạc cách Bishop''s House of Kontum 17 phút đi bộ và Pleiku Stadium 47 km, Khách sạn Xà Nu cung cấp các phòng ở Kon Tum. Khách sạn 3 sao này có bếp chung và dịch vụ phòng. Ở đây có nhà hàng phục vụ món ăn Việt và chỗ đậu xe riêng miễn phí.  Khách sạn có sân hiên phơi nắng.  Lễ tân tại Khách sạn Xà Nu có thể tư vấn cho khách về khu vực xung quanh.  Chỗ nghỉ cách Sân bay Pleiku 43 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 823702130, '(+84)5442257619', 'z66aq8nuo7@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (241, 'Bach Duong Hotel', 'Bach Duong Hotel có khu vườn, phòng chờ chung, sân hiên và nhà hàng ở Kon Tum. Khách sạn 5 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp dịch vụ giặt khô và phòng giữ hành lý cho khách.  Tại khách sạn, tất cả các phòng đều có bàn làm việc. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại Bach Duong Hotel có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Phòng khách đều có minibar.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê ô tô.  Sân bay Pleiku cách 98 km.', 0, 338277849, '(+84)5295406747', 'ihvpb8ilvr@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (242, 'Minh Sơn HOTEL', 'Minh Sơn HOTEL tọa lạc ở Ta Lan Than. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp khu vườn và sân hiên. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách khách sạn 200 km.', 0, 736078811, '(+84)0374076901', 'svof8m40ec@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (243, 'Muong Thanh Lai Chau Hotel', 'Nằm nép mình tại xã Pan Linh, Muong Thanh Lai Chau Hotel cung cấp chỗ nghỉ yên tĩnh và trang nhã với truy cập WiFi miễn phí trong toàn bộ khuôn viên. Khách sạn có hồ bơi ngoài trời, tiện nghi phòng xông hơi khô và các khu vườn xanh tốt.  Các phòng và suite máy lạnh tại đây được trang bị sàn trải thảm, tủ quần áo, khu vực tiếp khách, két an toàn trong phòng và truyền hình cáp màn hình phẳng. Phòng tắm riêng đi kèm bồn tắm, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Tại Muong Thanh Lai Chau Hotel, khách có thể yêu cầu dịch vụ mát-xa hoặc hát karaoke. Dịch vụ để hành lý, đưa/đón sân bay và tiện nghi tổ chức hội họp/tiệc cũng có tại khách sạn. Dịch vụ đặt vé và thu đổi ngoại tệ có thể được cung cấp tại lễ tân 24 giờ.  Khách sạn có nhà hàng phục vụ tuyển chọn các món ăn hấp dẫn của địa phương và Châu Á. Bữa sáng miễn phí với thực đơn lập sẵn cũng được cung cấp cho khách.', 40, 27772238, '(+84)3470516304', 'xc6qh1m4al@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (244, 'A Dế Homestay Sơn Tra', 'A Dế Homestay Sơn Tra là chỗ nghỉ nằm ở Phong Thổ và có ban công. Căn hộ có khu vườn và chỗ đậu xe riêng miễn phí.  Căn hộ này có 1 phòng ngủ và sân hiên. Căn hộ cũng đi kèm 1 phòng tắm.  Căn hộ có phục vụ bữa sáng kiểu lục địa hoặc kiểu Á.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách A Dế Homestay Sơn Tra 204 km.', 0, 258295038, '(+84)7249534831', 'i0pszmjwec@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (245, 'Ánh Hồng Hotel', 'Ánh Hồng Hotel nằm ở Lai Châu. Ngoài sân hiên, khách sạn 5 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Các căn đi kèm TV màn hình phẳng có truyền hình vệ tinh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tại khách sạn, tất cả các phòng có ga trải giường và khăn tắm.  Ánh Hồng Hotel có phục vụ bữa sáng thực đơn buffet và kiểu Á mỗi sáng.  Sân bay Điện Biên Phủ cách 198 km.', 69, 413796072, '(+84)9665665714', 'lz2si842ju@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (246, 'Hoang Nham Luxury Hotel', 'Hoang Nham Luxury Hotel có trung tâm thể dục, khu vườn, sân hiên và nhà hàng ở Ta Lan Than. Khách sạn 5 sao này có máy ATM và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Các phòng có tủ quần áo.  Hoang Nham Luxury Hotel có sân chơi trẻ em.  Sân bay gần nhất là Sân bay Điện Biên Phủ, cách chỗ nghỉ 200 km.', 0, 962055706, '(+84)3369033676', '78ogjghspp@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (247, 'Free Style Hotel Dalat', 'Nằm ở Đà Lạt, cách Quảng trường Lâm Viên 13 phút đi bộ, Free Style Hotel Dalat cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí và phòng chờ chung. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp dịch vụ tiền sảnh, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, tất cả các phòng đều có tủ quần áo, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có bếp với bếp. Tất cả các căn đều có tủ lạnh.  Các điểm tham quan nổi tiếng gần Free Style Hotel Dalat bao gồm Công viên Yersin, Hồ Xuân Hương và Khách sạn Hằng Nga. Sân bay gần nhất là Sân bay Liên Khương, cách chỗ nghỉ 27 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 20, 869989752, '(+84)5421622506', 'tnd601tic6@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (248, 'Lacami Dalat Hotel', 'Nằm cách Công viên Yersin 13 phút đi bộ, Lacami Dalat Hotel cung cấp chỗ nghỉ 1 sao ở Đà Lạt, đồng thời có khu vườn, phòng chờ chung và sân hiên. Chỗ nghỉ cách Hồ Xuân Hương khoảng 15 phút đi bộ, Quảng trường Lâm Viên 1.5 km và Vườn hoa Đà Lạt 2.7 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn cách Sân golf Dalat Palace Golf Club 3.4 km và Hồ Tuyền Lâm 6.3 km.', 0, 765681263, '(+84)4137376362', 'erw3dp4qy2@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (249, 'Centro Hotel Da Lat', 'Nằm ở Đà Lạt, cách Quảng trường Lâm Viên 16 phút đi bộ và Hồ Xuân Hương 1.6 km, Centro Hotel Da Lat cung cấp chỗ nghỉ có sân hiên và Wi-Fi miễn phí cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp dịch vụ đưa đón sân bay và dịch vụ cho thuê ô tô.  Tất cả các phòng đi kèm TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại Centro Hotel Da Lat, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ cách Công viên Yersin 1.7 km và Vườn hoa Đà Lạt 2.1 km. Sân bay gần nhất là Sân bay Liên Khương, cách Centro Hotel Da Lat 28 km.', 0, 294687671, '(+84)5045288212', 'iet59taz4h@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (250, 'Khách sạn Trọng Thiêm 2', 'Khách sạn Trọng Thiêm 2 tọa lạc ở Bảo Lộc. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Nhân viên tại chỗ có thể sắp xếp dịch vụ đưa đón.  Tại khách sạn, phòng nào cũng có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm. Khách sạn Trọng Thiêm 2 cung cấp một số căn nhìn ra thành phố và tất cả các phòng đều có ấm đun nước. Phòng khách tại chỗ nghỉ có điều hòa và tủ quần áo.  Sân bay gần nhất là Sân bay Liên Khương, cách Khách sạn Trọng Thiêm 2 88 km.', 0, 340603832, '(+84)9229423362', 'duajijadvz@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (251, 'Kim Little House Hotel', 'Tọa lạc ở Đà Lạt, cách Quảng trường Lâm Viên 3.2 km, Kim Little House Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp dịch vụ tiền sảnh, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, các phòng được thiết kế có tủ quần áo. Ngoài phòng tắm riêng, vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các phòng tại Kim Little House Hotel đều có view thành phố. Tại chỗ nghỉ, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, Kim Little House Hotel có dịch vụ thuê ô tô.  Khách sạn cách Hồ Xuân Hương 3.3 km và Công viên Yersin 3.5 km.', 78, 957590477, '(+84)9248006068', 'kqputntab7@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (252, 'The Gate Boutique Hotel Đà Lạt', 'The Gate Boutique Hotel Đà Lạt là chỗ nghỉ 3 sao tọa lạc ở Ấp Xuân An, cách Hồ Xuân Hương 1.8 km và Công viên Yersin 19 phút đi bộ. Chỗ nghỉ cách Quảng trường Lâm Viên khoảng 1.8 km, Vườn hoa Đà Lạt 3.8 km và Sân golf Dalat Palace Golf Club 4.9 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, mỗi phòng đều có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có sân hiên và một số khác thì nhìn ra núi. Các phòng có tủ quần áo.  Khách có thể thưởng thức bữa sáng thực đơn à la carte, kiểu lục địa hoặc kiểu Á tại chỗ nghỉ.  The Gate Boutique Hotel Đà Lạt cách Thiền Viện Trúc Lâm 5.4 km và Hồ Tuyền Lâm 5.6 km.', 48, 165668605, '(+84)5377320688', '6wenjdepxl@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (253, 'Jolie House', 'Tọa lạc ở Đà Lạt thuộc vùng Lâm Đồng và cách Sân golf Dalat Palace Golf Club 17 phút đi bộ, Jolie House cung cấp chỗ nghỉ có Wi-Fi miễn phí, tiện nghi BBQ, sân hiên cùng chỗ đậu xe riêng miễn phí.  Với bếp gồm tủ lạnh và lò nướng, mỗi căn cũng được thiết kế có két an toàn, TV màn hình phẳng truyền hình cáp, tiện nghi ủi, bàn làm việc và khu vực ghế ngồi với giường sofa. Nơi đây còn có phòng tắm riêng với vòi xịt/chậu rửa vệ sinh ở tất cả các căn, cùng đồ vệ sinh cá nhân miễn phí, máy sấy tóc và dép đi trong phòng.  Biệt thự có cả dịch vụ cho thuê xe đạp và dịch vụ cho thuê ô tô, đồng thời du khách có thể câu cá gần đó.  Jolie House cách Vườn hoa Đà Lạt 2 km và Hồ Xuân Hương 3.8 km. Sân bay gần nhất là Sân bay Liên Khương, cách chỗ nghỉ 30 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 20, 513481651, '(+84)8896507033', 'gjid6x558t@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (254, 'Da Tuong Luxury Villa Hotel', 'Tọa lạc ở Đà Lạt, cách Quảng trường Lâm Viên 3 km, Da Tuong Luxury Villa Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và quầy bar. Khách sạn 4 sao này cung cấp bếp chung, dịch vụ phòng và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, mỗi phòng đều có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có ban công. Các phòng đều có tủ lạnh.  Da Tuong Luxury Villa Hotel cách Hồ Xuân Hương 3.2 km và Công viên Yersin 3.3 km.', 52, 618610689, '(+84)2634090097', '7rk5frzvk6@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (255, 'Golden Imperial Hotel Da Lat', 'Tọa lạc ở Đà Lạt, cách Hồ Xuân Hương 3 phút đi bộ và Quảng trường Lâm Viên 400 m, Golden Imperial Hotel Da Lat cung cấp chỗ nghỉ có nhà hàng và Wi-Fi miễn phí cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 5 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Khách sạn nằm cách Sân golf Dalat Palace Golf Club 2.9 km và Hồ Tuyền Lâm 5.3 km.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Các phòng có tủ quần áo.  Khách tại Golden Imperial Hotel Da Lat có thể thưởng thức bữa sáng thực đơn buffet hoặc thực đơn à la carte.  Chỗ nghỉ cách Công viên Yersin 2 phút đi bộ và Vườn hoa Đà Lạt 2.2 km.', 56, 571490900, '(+84)2854690790', '9j4xhn2ikn@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (256, 'MerPerle Dalat Hotel', 'Tọa lạc ở Đà Lạt, cách Hồ Xuân Hương 1.8 km, MerPerle Dalat Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Khách sạn 5 sao này có dịch vụ phòng và dịch vụ văn phòng. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, câu lạc bộ trẻ em và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Các phòng tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, két an toàn, phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Các phòng đều có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại MerPerle Dalat Hotel, mỗi phòng đều có ga trải giường và khăn tắm.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng thực đơn buffet.  MerPerle Dalat Hotel có hồ bơi trong nhà.  Khách sạn cách Công viên Yersin 19 phút đi bộ và Quảng trường Lâm Viên 2 km.', 0, 770855226, '(+84)0358765893', '08pnc92z6j@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (257, 'Khách sạn TRIỆU KÝ VOÒNG', 'Nằm ở Lạng Sơn, Khách sạn TRIỆU KÝ VOÒNG cung cấp chỗ nghỉ 2 sao có khu vườn, phòng chờ chung và quầy bar. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view thành phố. Tất cả các phòng ở Khách sạn TRIỆU KÝ VOÒNG được trang bị đồ vệ sinh cá nhân miễn phí và ổ cắm iPod.  Sân bay gần nhất là Sân bay quốc tế Vân Đồn, cách chỗ nghỉ 124 km.', 0, 122694127, '(+84)6387998046', 'w4487yhybo@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (258, 'LONG VŨ HOTEL', 'LONG VŨ HOTEL tọa lạc ở Lạng Sơn. Ngoài nhà hàng, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Các phòng được trang bị tủ lạnh, minibar, ấm đun nước, vòi sen, máy sấy tóc và bàn làm việc. Tại khách sạn, mỗi phòng đều có ga trải giường và khăn tắm.  Sân bay quốc tế Vân Đồn cách 124 km.', 0, 164528156, '(+84)3921073703', 'a8yk9li8n4@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (259, 'An Khang Hotel', 'An Khang Hotel tọa lạc ở Lạng Sơn. Khách sạn 3 sao này có quầy lễ tân 24 giờ. Khách sạn cung cấp cả Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tại khách sạn, phòng nào cũng có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các phòng tại An Khang Hotel có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay quốc tế Vân Đồn, cách An Khang Hotel 124 km.', 70, 52161202, '(+84)2999093562', 'hm3mh4i9m3@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (260, 'Happy Home', 'Nằm ở Lạng Sơn, Happy Home cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa và khu vườn với sân hiên.  Căn hộ có ban công nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi gồm tủ lạnh và lò vi sóng, cùng phòng tắm riêng được trang bị vòi sen và đồ vệ sinh cá nhân miễn phí. Bếp và ấm đun nước đều được cung cấp.  Sân bay gần nhất là Sân bay quốc tế Vân Đồn, cách Happy Home 123 km.', 10, 8453422, '(+84)8506199775', 'g0vvnox72p@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (261, 'SOJO Hotel Lang Son', 'SOJO Hotel Lang Son có trung tâm thể dục, phòng chờ chung, nhà hàng và quầy bar ở Lạng Sơn. Ngoài Wi-Fi miễn phí, khách sạn 4 sao này còn cung cấp bếp chung và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp hoạt động giải trí vào buổi tối và dịch vụ tiền sảnh.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Các phòng đều có minibar.  Khách tại SOJO Hotel Lang Son có thể thưởng thức bữa sáng thực đơn à la carte.  Khách có thể chơi bi-a và trò phi tiêu tại chỗ nghỉ.  Sân bay quốc tế Vân Đồn cách 123 km.', 40, 703675755, '(+84)7717878762', 'f20oazegjv@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (262, 'Muong Thanh Luxury Lang Son Hotel', 'Muong Thanh cung cấp các phòng nghỉ máy lạnh hiện đại ở trong trung tâm Thành phố Lạng Sơn. Cách Chợ Đêm 10 phút lái xe, du khách có thể thư giãn bên hồ bơi ngoài trời của khách sạn hoặc thưởng thức dịch vụ mát-xa thư giãn. Wi-Fi được cung cấp miễn phí tại đây.  Các phòng sáng sủa với sàn trải thảm hoặc bằng gỗ của khách sạn được trang bị truyền hình cáp màn hình phẳng, minibar và phòng tắm riêng với bồn tắm.  Muong Thanh Luxury Lang Son Hotel có phòng tập thể dục và sân tennis. Tại đây cũng có hồ bơi spa, phòng xông hơi và phòng tắm hơi. Ngoài ra còn có các dịch vụ khác cho khách như bàn bán tour, cho thuê xe đạp và dịch vụ phòng.  Nhà hàng của khách sạn phục vụ thực đơn đa dạng gồm các món ăn địa phương và quốc tế cho tất cả các bữa ăn.  Từ Muong Than Lang Son chỉ cần lái xe 10 phút là tới chợ Đông Kinh và Kỳ Lừa. Bến xe buýt cách đó 100 m.', 41, 775343664, '(+84)0701240301', 'dxmkuxp3ui@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (263, 'Four Points by Sheraton Lang Son', 'Four Points by Sheraton Lang Son tọa lạc ở Lạng Sơn và có quầy bar. Ngoài nhà hàng, khách sạn 5 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, các phòng đều có ban công. Tất cả các phòng đều được thiết kế có TV màn hình phẳng, ngoài ra một số căn tại Four Points by Sheraton Lang Son có view thành phố.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet và kiểu Á mỗi sáng.  Sân bay quốc tế Vân Đồn cách 124 km.', 0, 837402622, '(+84)9474351901', 'a4k9rzv0rp@outlook.com', 5);
