INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (265, 'Hà Lù Homestay', 'Tọa lạc ở Lào Cai, cách Trạm cáp treo Fansipan 7.1 km, Hà Lù Homestay nhìn ranúi. Ngoài nhà hàng, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê xe đạp cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, các phòng đều có bàn làm việc và TV màn hình phẳng. Tại Hà Lù Homestay, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Đội ngũ nhân viên lễ tân giao tiếp thành thạo bằng tiếng Anh và tiếng Việt, ngoài ra khách có thể yêu cầu thông tin về khu vực xung quanh khi có nhu cầu.  Chỗ nghỉ cách Hồ Sa Pa 9.3 km và Thung lũng Mường Hoa 2.2 km.', 70, 922122992, '(+84)4629195476', 'dns909295t@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (266, 'Sen Trang Hotel', 'Nằm ở Lào Cai, cách Trạm cáp treo Fansipan 39 km, Sen Trang Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Ngoài quầy bar, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Các căn tại khách sạn đi kèm khu vực ghế ngồi. Tại Sen Trang Hotel, các phòng được thiết kế có ga trải giường và khăn tắm.  Leo núi là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê ô tô.  Thành thạo tiếng Anh, tiếng Việt và tiếng Hoa, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng hỗ trợ khách.  Sen Trang Hotel cách Hồ Sa Pa 34 km và Sa Pa Bus Station 34 km.', 0, 102150203, '(+84)1762468868', '58tjc6xbwa@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (267, 'Mai Anh Hotel', 'Tọa lạc ở Lào Cai, cách Trạm cáp treo Fansipan 39 km, Mai Anh Hotel nhìn rathành phố. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Các phòng được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, máy sấy tóc và bàn làm việc. Tất cả các căn có phòng tắm riêng, dép đi trong phòng và ga trải giường.  Khách sạn cách Hồ Sa Pa 34 km và Sa Pa Bus Station 34 km. Sân bay gần nhất là Sân bay Wenshan Puzhehei, cách Mai Anh Hotel 187 km.', 0, 795801288, '(+84)4010131223', 'hd615net0o@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (268, 'Red River View Hotel', 'Nằm ở Lào Cai, cách Trạm cáp treo Fansipan 38 km, Red River View Hotel cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí, nhà hàng và quầy bar. Khách sạn 3 sao này có máy ATM và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng được trang bị vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Tại Red River View Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng thực đơn à la carte.  Red River View Hotel cách Hồ Sa Pa 33 km và Sa Pa Bus Station 33 km.', 70, 750895748, '(+84)4828246674', '02ggswmcny@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (269, 'Hotel Samu', 'Hotel Samu có trung tâm thể dục, khu vườn, sân hiên và nhà hàng ở Lào Cai. Ngoài quầy bar, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại Hotel Samu, tất cả các phòng có ga trải giường và khăn tắm.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng thực đơn buffet.  Lễ tân tại Hotel Samu có thể tư vấn cho khách về khu vực xung quanh.', 0, 737766796, '(+84)6053522583', 'fume98vzji@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (270, 'Duc Huy Grand Hotel', 'Nằm tại thành phố Lào Cai, cách trung tâm thương mại Đức Huy Plaza 100 m, Duc Huy Grand Hotel là khách sạn 4 sao có trung tâm thể dục, vườn, phòng nghỉ gắn máy điều hòa đi kèm phòng tắm riêng cùng nhà hàng phục vụ ẩm thực Mỹ, Trung Quốc và Á trong khuôn viên.  Tất cả phòng nghỉ tại đây đều được bố trí truyền hình vệ tinh màn hình phẳng, tủ lạnh, ấm đun nước, bồn tắm, máy sấy tóc, bàn, ban công và tủ quần áo. Một số còn có tầm nhìn ra cảnh núi non.  Khách sạn cung cấp bữa sáng tự chọn hàng ngày.  Duc Huy Grand Hotel cũng có sân hiên.  Nhân viên lễ tân 24 giờ có thể tư vấn cho khách về khu vực.', 0, 483277985, '(+84)8460383147', '62ejp8o07g@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (271, 'SOJO Hotel Lao Cai', 'Nằm ở Lào Cai, cách Trạm cáp treo Fansipan 39 km, SOJO Hotel Lao Cai cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Ngoài quầy bar, khách sạn 4 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, quầy lễ tân 24 giờ và phòng giữ hành lý cho khách.  Tại khách sạn, các phòng đều đi kèm với bàn làm việc. Tất cả các phòng ở SOJO Hotel Lao Cai được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Khách có thể thưởng thức bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu Á tại chỗ nghỉ.  Chỗ nghỉ cách Hồ Sa Pa 34 km và Sa Pa Bus Station 34 km.', 40, 643333463, '(+84)6575549503', 'vbggq4607v@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (272, 'Aristo International Hotel', 'Với Wi-Fi miễn phí và trung tâm spa, Aristo International Hotel cung cấp những chỗ ở tại phường Kim Tân, cách thị trấn Sa Pa 21 km. Khách sạn có sân hiên và hồ bơi ngoài trời mở cửa quanh năm, và du khách nghỉ tại đây có thể thưởng thức bữa ăn ở nhà hàng hoặc đồ uống trong quán bar. Tại đây cung cấp chỗ đỗ xe riêng miễn phí ngay trong khuôn viên.  Mỗi phòng tại khách sạn này đều được trang bị máy lạnh và truyền hình vệ tinh màn hình phẳng. Một số phòng nhất định có khu vực tiếp khách để tạo thuận tiện cho khách. Các phòng cũng bao gồm phòng tắm riêng đi kèm vòi sen. Để tạo thuận tiện cho khách, áo choàng tắm, dép và đồ vệ sinh cá nhân miễn phí sẽ được cung cấp.  Du khách sẽ tìm thấy dịch vụ đưa đón miễn phí, lễ tân 24 giờ, tiệm làm tóc và cửa hàng quà tặng tại nơi nghỉ.  Du khách có thể chơi tennis tại khách sạn.', 0, 899710115, '(+84)9821062530', 'uf2oyzy0je@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (273, 'KDL Làng Nổi Tân Lập - Tan Lap Floating Village', 'KDL Làng Nổi Tân Lập - Tan Lap Floating Village tọa lạc ở Khu du lịch Sinh thái KDL Làng Nổi Tân Lập - Tan Lap Floating Village ở huyện Mộc Hóa. Chỗ nghỉ cung cấp các phòng với cửa sổ lớn và ban công riêng nhìn ra quang cảnh các cây tràm cũng như Wi-Fi miễn phí. Du khách được miễn phí vào khu du lịch sinh thái.  Các phòng nghỉ tại khách sạn này được trang bị TV màn hình phẳng, ấm đun nước và tủ lạnh.  Bữa sáng gọi món được phục vụ hàng ngày tại chỗ nghỉ này.  Sân bay gần nhất là sân bay quốc tế Tân Sơn Nhất, cách chỗ nghỉ 73 km.', 0, 345118374, '(+84)5766242510', 'qj7ffbaloc@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (274, 'PHU THANG GRAND HOTEL', 'Nằm cách Công viên văn hóa Đầm Sen 20 km, PHU THANG GRAND HOTEL cung cấp chỗ nghỉ 3 sao ở Ðức Hòa, đồng thời có phòng chờ chung, sân hiên và nhà hàng. Chỗ nghỉ cách Chùa Giác Lâm khoảng 22 km, Bảo tàng chứng tích chiến tranh 26 km và Chợ Bến Thành 27 km. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các phòng đều có điều hòa, bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại khách sạn có ban công. Tất cả các căn đều có tủ quần áo và ấm đun nước để khách sử dụng.  PHU THANG GRAND HOTEL cách Công viên Tao Đàn 27 km và Dinh Thống Nhất 27 km.', 60, 848816146, '(+84)8441005603', 'llkr3w2en5@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (275, 'Chấn Hotel - Đảo Phú Quý', 'Chấn Hotel - Đảo Phú Quý cung cấp khu vườn và nằm ở Phú Quý. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Mỗi phòng đều có ban công.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Tất cả các phòng đều có tủ lạnh.', 60, 821308948, '(+84)1656560042', 'y9vklmyg35@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (276, 'Nhà Nghỉ Trà My', 'Nằm ở Như Thức, cách Chùa Bái Đính 49 km, Nhà Nghỉ Trà My cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Khách sạn 2 sao này cung cấp bếp chung, dịch vụ phòng và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, dịch vụ tiền sảnh và phòng giữ hành lý cho khách.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, TV, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view sông. Tất cả các phòng có két an toàn.  Khách tại Nhà Nghỉ Trà My sẽ có thể tận hưởng các hoạt động ở trong Như Thức và khu vực xung quanh, như leo núi và đi xe đạp.  Chỗ nghỉ cách Ninh Binh Stadium 29 km và Khu du lịch sinh thái Vườn Chim Thung Nham 44 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Nhà Nghỉ Trà My 90 km.', 0, 452270450, '(+84)8633765386', 'qxwyhjmhuh@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (277, 'Golden Thai binh Hotel', 'Nằm ở Thái Bình, cách Ninh Binh Stadium 48 km, Golden Thai binh Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và sân hiên. Mỗi phòng tại khách sạn 3 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view sông. Tại Golden Thai binh Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê xe đạp và dịch vụ thuê ô tô.  Golden Thai binh Hotel cách Ninh Binh Train Station 49 km. Sân bay Quốc tế Cát Bi cách 70 km.', 0, 463015418, '(+84)9107136363', 'snont6be4j@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (278, 'Ruby Hotel', 'Tọa lạc ở Nam Ðịnh, cách Chùa Bái Đính 50 km, Ruby Hotel nhìn rathành phố. Ngoài sân hiên, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tất cả các căn được trang bị tủ lạnh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng đều có tủ quần áo và TV màn hình phẳng, ngoài ra một số căn tại khách sạn có ban công. Tại Ruby Hotel, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ cách Ninh Binh Stadium 30 km và Khu du lịch sinh thái Vườn Chim Thung Nham 45 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Ruby Hotel 87 km.', 0, 976283557, '(+84)0883591071', 'iyy8goc019@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (279, 'Nam Cuong Nam Dinh Hotel', 'Nam Cuong Nam Dinh Hotel có hồ bơi ngoài trời, trung tâm thể dục, khu vườn và phòng chờ chung ở Nam Ðịnh. Mỗi phòng tại khách sạn 4 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng, sân hiên, phòng tắm riêng và vòi sen. Một số phòng có bếp với lò vi sóng. Các căn có tủ quần áo.  Nam Cuong Nam Dinh Hotel có tắm suối nước nóng.  Bên cạnh bar thức ăn nhẹ ngay trong khuôn viên, khách còn có thể sử dụng khu vực văn phòng/hội họp.  Chỗ nghỉ cách Ninh Binh Stadium 31 km và Khu du lịch sinh thái Vườn Chim Thung Nham 45 km.', 0, 972716556, '(+84)4799144607', 'dwmhdzpj6j@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (280, 'SOJO Hotel Nam Dinh', 'Tọa lạc ở Nam Ðịnh, cách Chùa Bái Đính 50 km, SOJO Hotel Nam Dinh cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí, nhà hàng và quầy bar. Khách sạn 4 sao này có dịch vụ phòng và máy ATM. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tất cả các căn ở SOJO Hotel Nam Dinh được trang bị đồ vệ sinh cá nhân miễn phí và iPad.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu lục địa mỗi sáng.  Chỗ nghỉ cách Ninh Binh Stadium 30 km và Khu du lịch sinh thái Vườn Chim Thung Nham 45 km.', 0, 626858766, '(+84)9122580477', 'f6gq3od0er@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (281, 'Hoang Nam Hotel', 'Với nhà hàng, Hoang Nam Hotel tọa lạc ở Cửa Lò, Nghệ An, cách Bãi biển Cửa Lò 5 phút đi bộ. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp dịch vụ phòng. Khách sạn có phòng gia đình.  Sân bay quốc tế Vinh cách 10 km.', 0, 416294343, '(+84)5434064247', 'efc1ri0p38@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (282, 'Hùng Đức Hotel Cửa Lò', 'Nằm ở Cửa Lò, cách Bãi biển Cửa Lò 4 phút đi bộ, Hùng Đức Hotel Cửa Lò cung cấp chỗ nghỉ có phòng chờ chung, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Mỗi phòng đều được thiết kế có sân trong nhìn ra khu vườn.  Tại khách sạn, các phòng đều đi kèm với điều hòa, tủ quần áo, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và ban công với view thành phố. Tất cả các phòng đều có tủ lạnh.  Sân bay quốc tế Vinh cách 11 km.', 25, 139126111, '(+84)4859067971', '907kc96j5k@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (283, 'Khách Sạn Huệ Vinh', 'Tọa lạc ở Thương Xà (2), cách Bãi biển Cửa Lò 5 phút đi bộ, Khách Sạn Huệ Vinh cung cấp chỗ nghỉ có nhà hàng và chỗ đậu xe riêng miễn phí. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp quầy lễ tân 24 giờ. Tất cả các phòng đều có ban công.  Tại khách sạn, tất cả các phòng đều được thiết kế có điều hòa, tủ quần áo, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view biển.  Sân bay gần nhất là Sân bay quốc tế Vinh, cách Khách Sạn Huệ Vinh 10 km.', 0, 456697937, '(+84)7710711905', 'kq7l6ikwd6@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (284, 'Muong Thanh Cua Dong Hotel', 'Muong Thanh Grand Cua Dong Hotel cung cấp các phòng nghỉ hiện đại tại thành phố Vinh thuộc Tỉnh Nghệ An. Khách sạn có quầy lễ tân 24 giờ, nhà hàng tại chỗ và quán bar phục vụ đồ uống cho du khách.  Mỗi phòng tại đây được trang bị hệ thống cách âm, TV màn hình phẳng, ghế sofa và bàn làm việc. Một số phòng có khu vực tiếp khách để tạo sự thuận tiện cho khách. Du khách còn có thể ngắm nhìn quang cảnh núi, hồ hoặc sông từ phòng nghỉ. Phòng tắm riêng trong mỗi phòng có bồn tắm/vòi sen, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Du khách có thể đổ mồ hôi trong phòng xông hơi khô hay thư giãn với dịch vụ mát-xa chuyên nghiệp ở trung tâm spa. Dịch vụ đưa đón sân bay có thể được bố trí theo yêu cầu với một khoản phụ phí.  Sân bay gần nhất là Sân bay Vinh, cách Muong Thanh Grand Cua Dong Hotel 6 km.', 0, 785446383, '(+84)1178637370', 'vhajwlgxyv@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (285, 'Muong Thanh Vinh Hotel', 'Muong Thanh Vinh Hotel cung cấp chỗ nghỉ tại Vinh. Ngoài nhà hàng, khách sạn 3 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, mỗi phòng đều được thiết kế có tủ quần áo. Tất cả các phòng đều được thiết kế có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Muong Thanh Vinh Hotel có sân hiên. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  Muong Thanh Vinh Hotel có phục vụ bữa sáng thực đơn buffet hoặc kiểu Á.  Khách tại khách sạn sẽ có thể tận hưởng các hoạt động ở trong Vinh và khu vực xung quanh, như leo núi.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn sẵn lòng đưa ra đề xuất hữu ích về khu vực xung quanh.  Sân bay quốc tế Vinh cách 6 km.', 33, 395669368, '(+84)3051577721', '5n1knpwxqz@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (286, 'Muong Thanh Grand Phuong Dong', 'Muong Thanh Grand Phuong Dong có hồ bơi ngoài trời theo mùa, trung tâm thể dục, nhà hàng và quầy bar ở Vinh. Khách sạn 4 sao này có bàn bán tour và phòng giữ hành lý. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng, ban công và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Muong Thanh Grand Phuong Dong, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet mỗi sáng.  Sân bay quốc tế Vinh cách 8 km.', 35, 870008610, '(+84)7890035848', 'uxmnw37e60@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (287, 'Muong Thanh Grand Cua Lo Hotel', 'Tọa lạc dọc theo bờ biển, Muong Thanh Cua Lo Hotel cung cấp chỗ nghỉ hiện đại và trang nhã với Wi-Fi miễn phí trong toàn bộ khuôn viên. Khách sạn có hồ bơi ngoài trời trên tầng mái, trung tâm thể dục, sân tennis và phòng xông hơi khô. Chỗ đỗ xe được cung cấp miễn phí ngay trong khuôn viên.  Với tầm nhìn ra biển, các phòng và suite máy lạnh tại đây có tủ quần áo, két an toàn cá nhân, truyền hình cáp màn hình phẳng và khu vực tiếp khách. Minibar và ấm đun nước điện cũng được cung cấp. Phòng tắm riêng đi kèm bồn tắm, máy sấy tóc, tiện nghi vòi sen và đồ vệ sinh cá nhân miễn phí.  Khách nghỉ tại Muong Thanh Cua Lo Hotel có thể tận hưởng liệu pháp mát-xa nhẹ nhàng tại spa hoặc hát karaoke ngay trong khuôn viên. Nhân viên quầy lễ tân 24 giờ có thể trợ giúp quý khách với dịch vụ giặt thường/giặt hấp, đặt vé và bố trí đưa đón sân bay.  Nhà hàng trong nhà phục vụ tuyển chọn các món ăn ngon kiểu Lục địa và địa phương. Đồ uống sau bữa ăn có tại quầy bar.  Sân bay của thành phố Vinh cách đó khoảng 10 km.', 70, 520725435, '(+84)8898972621', 'qqbplmw3rt@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (288, 'Melia Vinpearl Cua Hoi Beach Resort', 'Nằm dọc theo Bãi biển Cửa Hội, Melia Vinpearl Cua Hoi Beach Resort cung cấp các phòng và biệt thự hiện đại, cách trung tâm du lịch Cửa Lò 5 km. Resort có 3 nhà hàng, quầy bar bên hồ bơi và hồ bơi ngoài trời. Du khách có thể sử dụng Wi-Fi miễn phí tại các khu vực chung và chỗ đỗ xe riêng trong khuôn viên.  Tất cả các phòng lắp máy điều hòa tại đây được trang bị bàn làm việc, TV và ấm đun nước. Một số phòng có tầm nhìn ra đại dương và/hoặc ban công riêng. Phòng tắm riêng đi kèm vòi sen và đồ vệ sinh cá nhân miễn phí.  Nhà hàng Padma phục vụ bữa sáng buffet hàng ngày với các món ăn quốc tế để thoả mãn vị giác của khách.  Melia Vinpearl Cua Hoi Beach Resort cách thành phố Hà Tĩnh 50 km. Sân bay gần nhất là sân bay Vinh, cách chỗ nghỉ 10 km.', 0, 447443317, '(+84)7246298400', 'npwedr0oap@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (289, 'Muong Thanh Luxury Dien Lam', 'Muong Thanh Luxury Dien Lam có hồ bơi ngoài trời, trung tâm thể dục, khu vườn và phòng chờ chung ở Diễn Châu. Mỗi phòng tại khách sạn 5 sao này đều nhìn ra núi, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tại Muong Thanh Luxury Dien Lam, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet hoặc kiểu Á.  Muong Thanh Luxury Dien Lam có sân chơi trẻ em. Khách tại khách sạn sẽ có thể tận hưởng các hoạt động ở trong Diễn Châu và khu vực xung quanh, như leo núi, câu cá và đi xe đạp.  Sân bay quốc tế Vinh cách 59 km.', 0, 383663528, '(+84)1532377296', 'i9vc9tn94o@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (290, 'Tam Coc Tuong Vy Homestay', 'Tọa lạc ở Ninh Bình, cách Chùa Bái Đính 25 km, Tam Coc Tuong Vy Homestay cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Ngoài quầy bar, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, mỗi phòng đều có ban công. Các phòng đều có bàn làm việc và ấm đun nước để khách sử dụng.  Tam Coc Tuong Vy Homestay cách Nhà thờ đá Phát Diệm 33 km. Sân bay Thọ Xuân cách 93 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 395341897, '(+84)9945316187', '2x11c62vxb@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (291, 'Tam Coc Thai Duong Homestay', 'Tọa lạc ở Ninh Bình, cách Chùa Bái Đính 25 km, Tam Coc Thai Duong Homestay cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Khách sạn 1 sao này có các phòng được trang bị điều hòa. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, phòng nào cũng có bàn làm việc, ga trải giường và ban công với view vườn. Ngoài phòng tắm riêng, vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các phòng tại Tam Coc Thai Duong Homestay đều có view thành phố. Phòng khách đều có tủ quần áo và ấm đun nước để khách sử dụng.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê xe đạp.  Tam Coc Thai Duong Homestay cách Nhà thờ đá Phát Diệm 32 km và Khu du lịch sinh thái Vườn Chim Thung Nham 6.6 km.', 0, 727195513, '(+84)2544405616', 'n2efuszctd@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (292, 'HoangLong Riverside Homestay', 'Nằm ở Ninh Bình, cách Chùa Bái Đính 12 km, HoangLong Riverside Homestay cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và sân hiên. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể thưởng thức đồ uống tại quầy bar.  Tại khách sạn, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Bỉ và Việt. Bên cạnh đó, họ có thể yêu cầu món chay, kosher (cho người đạo Do Thái) và món thuần chay.  Khách tại HoangLong Riverside Homestay sẽ có thể tận hưởng các hoạt động ở trong Ninh Bình và khu vực xung quanh, như câu cá và đi xe đạp.  Chỗ nghỉ cách Nhà thờ đá Phát Diệm 37 km. Sân bay Thọ Xuân cách 85 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 345310429, '(+84)5573734054', 'z2xa1nvfl4@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (293, 'Tamcoc Lights Hotel', 'Nằm ở Ninh Bình, cách Chùa Bái Đính 23 km, Tamcoc Lights Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Khách sạn 2 sao này có dịch vụ phòng và máy ATM. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, các phòng được thiết kế có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view thành phố. Các phòng đều đi kèm với máy pha cà phê, trong đó một số phòng có ban công. Các căn đều có tủ lạnh.  Leo núi và đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, khách sạn này có dịch vụ thuê xe đạp và dịch vụ thuê ô tô.  Tamcoc Lights Hotel cách Nhà thờ đá Phát Diệm 31 km và Ninh Binh Stadium 6.8 km.', 0, 967128702, '(+84)5341989851', 'j5zv4fryuf@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (294, 'Hang Mua Sunset Bungalow - Trang An', 'Tọa lạc ở Ninh Bình, cách Chùa Bái Đính 25 km, Hang Mua Sunset Bungalow - Trang An cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và nhà hàng. Khách sạn 3 sao này có các phòng được trang bị điều hòa. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, mỗi phòng đều có sân hiên với view núi. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra hồ. Tại Hang Mua Sunset Bungalow - Trang An, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng thực đơn à la carte hoặc kiểu Á.  Khách sạn này có dịch vụ thuê xe đạp và dịch vụ thuê ô tô. Ngoài ra, đi xe đạp là hoạt động được ưa chuộng trong khu vực.  Hang Mua Sunset Bungalow - Trang An cách Nhà thờ đá Phát Diệm 33 km và Ninh Binh Stadium 9.1 km.', 18, 742458894, '(+84)0965846858', '3cnh7ojahu@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (295, 'Trang An Family Homestay', 'Nhìn ra thành phố, Trang An Family Homestay tọa lạc ở Ninh Bình và có nhà hàng, bếp chung, quầy bar, khu vườn, hồ bơi ngoài trời mở quanh năm cũng như sân hiên. WiFi miễn phí có sẵn.  Nơi đây còn có phòng tắm riêng với vòi xịt/chậu rửa vệ sinh ở tất cả các căn, cùng đồ vệ sinh cá nhân miễn phí, máy sấy tóc và dép đi trong phòng.  Chỗ nghỉ có phục vụ bữa sáng kiểu lục địa, kiểu Mỹ hoặc kiểu Á hằng ngày.  Sau một ngày leo núi, câu cá hoặc đi xe đạp, khách có thể thư giãn trong khu vực phòng chờ chung.  Lodge cách Chùa Bái Đính 17 km. Sân bay Thọ Xuân cách 98 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 41, 185153859, '(+84)0187779957', 'uyb7q1vepa@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (296, 'Scenic Mountain Ecolodge Ninh Binh', 'Với Chùa Bái Đính nằm cách đó 18 km, Scenic Mountain Ecolodge Ninh Binh cung cấp chỗ nghỉ, nhà hàng, xe đạp miễn phí, hồ bơi ngoài trời và khu vườn. WiFi và chỗ đậu xe riêng đều có sẵn tại homestay miễn phí.  Được thiết kế với sân hiên, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi sen và đồ vệ sinh cá nhân miễn phí. Tủ lạnh và ấm đun nước đều được cung cấp.  Scenic Mountain Ecolodge Ninh Binh có phục vụ bữa sáng thực đơn à la carte và kiểu lục địa mỗi sáng.  Chỗ nghỉ có dịch vụ cho thuê ô tô.  Scenic Mountain Ecolodge Ninh Binh cách Nhà thờ đá Phát Diệm 32 km. Sân bay Thọ Xuân cách 80 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 49, 371123844, '(+84)7011820070', 'x38draobkj@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (297, 'The Reed Hotel', 'Tọa lạc tại thành phố Ninh Bình, cách Khu Du lịch Sinh thái Tràng An 7 km, The Reed Hotel cung cấp các phòng máy lạnh với Wi-Fi miễn phí trong toàn khuôn viên. Trong nơi nghỉ có quầy bar. Chỗ đỗ xe riêng miễn phí được bố trí ngay trong khuôn viên.  Các phòng tại đây được trang bị TV màn hình phẳng. Một số các phòng có khu vực tiếp khách để du khách thư giãn sau một ngày bận rộn. Một số phòng còn cho tầm nhìn ra quang cảnh dòng sông hoặc thành phố. Các phòng đi kèm phòng tắm riêng. Áo choàng tắm, dép và đồ vệ sinh cá nhân miễn phí cũng được cung cấp để tạo sự thoải mái cho khách.  Nơi nghỉ có lễ tân làm việc 24 giờ.  Khách sạn cung cấp dịch vụ cho thuê xe đạp. The Reed Hotel cách Đền Thái Vi cũng như Cố Đô Hoa Lư 7 km.', 63, 686486181, '(+84)8938681115', 'fy4hlns3rx@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (298, 'Emeralda Resort Tam Cốc', 'Tọa lạc ở Ninh Bình, cách Chùa Bái Đính 24 km, Emeralda Resort Tam Cốc cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Resort 5 sao này có câu lạc bộ trẻ em và dịch vụ phòng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, dịch vụ văn phòng và tổ chức các tour du lịch cho khách.  Phòng khách được trang bị tủ lạnh, minibar, ấm đun nước, bồn tắm, máy sấy tóc và bàn làm việc. Với phòng tắm riêng được trang bị vòi sen và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại resort có TV màn hình phẳng và điều hòa, trong đó một số phòng có sân hiên. Các phòng có tủ quần áo.  Chỗ nghỉ có phục vụ bữa sáng mỗi sáng, gồm các lựa chọn thực đơn buffet, kiểu lục địa và kiểu Á. Tại Emeralda Resort Tam Cốc, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Việt, địa phương và Á. Bên cạnh đó, họ có thể yêu cầu không chứa sữa, món thuần chay và không chứa gluten.  Chỗ nghỉ cách Nhà thờ đá Phát Diệm 32 km. Sân bay Thọ Xuân cách 93 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 147393919, '(+84)4799157566', 'c8fnqkr13r@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (299, 'Ninh Binh Legend Hotel', 'Tọa lạc ở Ninh Bình, cách Chùa Bái Đính 19 km, Ninh Binh Legend Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Ngoài nhà hàng, chỗ nghỉ còn có quầy bar và hồ bơi trong nhà. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Phòng khách tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình vệ tinh, két an toàn, phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Phòng nào cũng có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra hồ bơi. Các phòng đều có tủ lạnh.  Ninh Binh Legend Hotel có phục vụ bữa sáng kiểu Mỹ hoặc kiểu Á.  Chỗ nghỉ có sân hiên phơi nắng. Khách có thể chơi bi-a và bóng bàn tại khách sạn 5 sao này. Ngoài ra, đi xe đạp là hoạt động được ưa chuộng trong khu vực.  Khách có thể sử dụng dịch vụ văn phòng hoặc thư giãn tại bar thức ăn nhẹ.  Ninh Binh Legend Hotel cách Nhà thờ đá Phát Diệm 31 km và Ninh Binh Stadium 3.2 km.', 0, 144319236, '(+84)1770560956', 'gspo5h4ea0@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (300, 'Khách sạn Sớm Phú Quý 2 - Phan Rang', 'Khách sạn Sớm Phú Quý 2 - Phan Rang nằm ở Phan Rang và có sân hiên. Khách sạn 1 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Khách sạn Sớm Phú Quý 2 - Phan Rang, tất cả các phòng đều có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Liên Khương, cách chỗ nghỉ 113 km.', 0, 355541012, '(+84)0703663812', 'r8v5x1z3h1@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (301, 'Khách sạn Cà Ná', 'Nằm giáp biển, Khách sạn Cà Ná cung cấp chỗ nghỉ 1 sao ở Phan Rang, đồng thời có khu vườn, khu vực bãi biển riêng và nhà hàng. Chỗ nghỉ này có các tiện nghi như quầy bar và sân tennis. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và ban công với view biển. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có sân hiên và một số khác thì nhìn ra núi. Tất cả các phòng ở Khách sạn Cà Ná được trang bị đồ vệ sinh cá nhân miễn phí và ổ cắm iPod.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet và kiểu Á mỗi buổi sáng.  Sân bay Liên Khương cách 137 km.', 0, 840969834, '(+84)0371425002', 'ht2ncq2zvu@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (302, 'Phuc Thuan Hotel', 'Nằm ở Phan Rang, cách Bãi biển Ninh Chữ chỉ vài bước chân, Phuc Thuan Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vực bãi biển riêng và sân hiên. Khách sạn 2 sao này có quầy lễ tân 24 giờ. Đây là chỗ nghỉ không gây dị ứng và tọa lạc cách Bãi biển Bình Sơn 1.9 km.  Các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng với bồn tắm và máy sấy tóc, các phòng tại khách sạn cũng có Wi-Fi miễn phí, trong đó một số phòng có view biển. Tại Phuc Thuan Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Sân bay Liên Khương cách 117 km.', 50, 735540060, '(+84)1299721373', '8sa8msj5u5@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (303, 'Sunny Hotel', 'Nằm ở Phan Rang, Sunny Hotel cung cấp chỗ nghỉ 2 sao có sân hiên. Ngoài phòng gia đình, chỗ nghỉ này cũng cung cấp cho khách sân chơi trẻ em. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, các phòng được thiết kế có điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình vệ tinh, két an toàn, phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Các phòng đều đi kèm với ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại Sunny Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Liên Khương, cách chỗ nghỉ 112 km.', 0, 108875344, '(+84)9770817216', 'hw5adjv9so@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (304, 'Casa Maya Hotel', 'Nằm ở Thôn Bảo An, cách Bãi Kinh chỉ vài bước chân, Casa Maya Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và khu vực bãi biển riêng. Chỗ nghỉ này có các tiện nghi như sân hiên, nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng có phòng tắm riêng, máy sấy tóc và ga trải giường.  Khách sạn cách Bãi biển Lighthouse 5 phút đi bộ và Bãi Chuối 2 km.', 9, 574771113, '(+84)2665069614', '76spdpdo2k@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (305, 'KAMI HOTEL', 'KAMI HOTEL cung cấp chỗ nghỉ tại Phan Rang. Khách sạn 3 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách khách sạn 74 km.', 0, 729400065, '(+84)8056523619', 'iw8dx8ltiu@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (306, 'C&M Hotel', 'C&M Hotel nằm ở Phan Rang. Ngoài sân hiên, khách sạn 4 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và phòng giữ hành lý cho khách.  Tại khách sạn, phòng nào cũng có ban công. Tất cả các phòng đều có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại C&M Hotel có sân trong. Tại chỗ nghỉ, tất cả các phòng có ga trải giường và khăn tắm.  Thành thạo tiếng Đan Mạch, tiếng Đức, tiếng Anh và tiếng Pháp, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng hỗ trợ khách lên kế hoạch cho kỳ nghỉ.  Sân bay quốc tế Cam Ranh cách 74 km.', 38, 948602990, '(+84)6166250148', 'yjoyf0xry9@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (307, 'Windy homestayPR', 'Windy homestayPR là chỗ nghỉ tọa lạc ở Kinh Dinh và có ban công. Chỗ nghỉ nhìn ra thành phố, có sân hiên và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Căn hộ điều hòa này có 2 phòng ngủ, phòng khách, bếp đầy đủ tiện nghi với tủ lạnh và ấm đun nước, 1 phòng tắm với vòi sen và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Sân bay gần nhất là Sân bay quốc tế Cam Ranh, cách căn hộ 73 km.', 0, 223264301, '(+84)8205686393', 'xgir9wrbzk@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (308, 'Thái Dương Hotel', 'Thái Dương Hotel tọa lạc ở Việt Trì và có sân hiên. Ngoài khu vườn, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng.  Tại khách sạn, tất cả các phòng đều được thiết kế có bàn làm việc, ga trải giường và ban công với view vườn. Các phòng ở Thái Dương Hotel được trang bị TV màn hình phẳng và máy sấy tóc.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách chỗ nghỉ 52 km.', 0, 539614780, '(+84)2756204860', '1l1o8h8rgf@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (309, 'Quỳnh Hương Hotel Phú Thọ', 'Quỳnh Hương Hotel Phú Thọ tọa lạc ở Phú Thọ. Khách sạn 3 sao này có các phòng được trang bị điều hòa. Khách sạn cung cấp cả Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tại khách sạn, mỗi phòng đều được thiết kế có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm. Phòng khách đều có tủ quần áo và ấm đun nước để khách sử dụng.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên luôn túc trực 24/7 tại lễ tân 24/24.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách Quỳnh Hương Hotel Phú Thọ 66 km.', 70, 770385253, '(+84)2838719441', '3me94a89cz@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (310, 'Khách Sạn X2 Vibe Việt Trì', 'Nằm ở Làng Tiên Cát, cách Phủ Thành Chương 50 km, Khách Sạn X2 Vibe Việt Trì cung cấp chỗ nghỉ có sân hiên, chỗ đậu xe riêng miễn phí, nhà hàng và quầy bar. Khách sạn 3 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp dịch vụ tiền sảnh, phòng giữ hành lý và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tại Khách Sạn X2 Vibe Việt Trì, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng mỗi buổi sáng, gồm các lựa chọn thực đơn buffet, kiểu lục địa và kiểu Mỹ.  Chỗ nghỉ cách Vietnam National University 45 km. Sân bay Quốc tế Nội Bài cách 59 km.', 0, 482925905, '(+84)4272031888', 'kvxtpqfubx@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (311, 'SOJO Hotel Viet Tri', 'Tọa lạc ở Việt Trì, cách Phủ Thành Chương 50 km, SOJO Hotel Viet Tri cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Khách sạn 4 sao này có bếp chung và quầy lễ tân 24 giờ. Chỗ nghỉ này cung cấp máy ATM, dịch vụ tiền sảnh và phòng giữ hành lý cho khách.  Tại khách sạn, phòng nào cũng có điều hòa và TV màn hình phẳng.  Khách có thể thưởng thức bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu lục địa tại chỗ nghỉ.  SOJO Hotel Viet Tri cách Vietnam National University 45 km. Sân bay Quốc tế Nội Bài cách 57 km.', 40, 14847611, '(+84)5860069222', 'nvfypenbdo@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (312, 'Wyndham Thanh Thuy Hot Spring MyHome', 'Với khu vườn, phòng chờ chung, cùng sân hiên, Wyndham Thanh Thuy Hot Spring MyHome cung cấp chỗ nghỉ ở Phú Thọ có Wi-Fi miễn phí và nhìn ra núi. Chỗ nghỉ tọa lạc cách Vietnam National University 45 km và cung cấp bếp chung.  Biệt thự điều hòa này có 3 phòng ngủ, phòng khách, bếp đầy đủ tiện nghi với tủ lạnh và ấm đun nước, 3 phòng tắm với vòi sen và bể sục. Khăn tắm và ga trải giường có sẵn ở biệt thự.  Biệt thự có phục vụ bữa sáng kiểu Á hằng ngày.  Wyndham Thanh Thuy Hot Spring MyHome có dịch vụ cho thuê ô tô.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách chỗ nghỉ 83 km.', 0, 654810765, '(+84)5560259826', '74xsegeo4x@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (313, 'Muong Thanh Luxury Phu Tho', 'Tọa lạc tại thành phố Việt Trì, Muong Thanh Luxury Phu Tho chào đón du khách với hồ bơi ngoài trời và nhà hàng tại chỗ. Khách sạn cung cấp chỗ ở ấm cúng với máy lạnh, Wi-Fi miễn phí trong tất cả các khu vực và chỗ đỗ xe riêng miễn phí ngay trong khuôn viên.  Được trang trí trang nhã với gam màu be và nâu, tất cả các phòng nghỉ tại đây đều có tầm nhìn ra quang cảnh thành phố, sàn trải thảm, khu vực tiếp khách, tủ quần áo và két an toàn. TV truyền hình vệ tinh màn hình phẳng, minibar và ấm đun nước điện cũng được trang bị trong phòng để tạo sự tiện lợi cho du khách. Một số phòng cho tầm nhìn ra quang cảnh hồ bơi/dòng sông. Mỗi phòng đều đi kèm phòng tắm riêng với tiện nghi vòi sen, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Du khách có thể đổ mồ hôi trong phòng xông hơi khô, ngâm mình ở bể sục hay thư giãn với dịch vụ mát-xa tại trung tâm spa. Đội ngũ nhân viên chuyên nghiệp tại quầy lễ tân 24 giờ có thể giao tiếp thành thạo 5 thứ tiếng khác nhau và có thể hỗ trợ du khách với dịch vụ giữ hành lý cũng như thu đổi ngoại tệ. Dịch vụ cho thuê xe hơi và các chuyến đi trong ngày có thể được sắp xếp tại bàn đặt tour.  Du khách có thể chơi tennis tại khách sạn này. Trung tâm thương mại Vincom Plaza Việt Trì cách khách sạn 400 m. Sân bay gần nhất là sân bay quốc tế Nội Bài, nằm trong bán kính 44 km từ Muong Thanh Luxury Phu Tho.  Nhà hàng Âu Lạc phục vụ bữa sáng tự chọn với các món ăn Á-Âu ngon lành cho khách lưu trú.', 40, 919031346, '(+84)9117851105', 'qyyl47nm9f@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (314, 'WYNDHAM LYNN TIMES THANH THỦY - KHU NGHỈ DƯỠNG KHOÁNG NÓNG', 'Tọa lạc ở Phú Thọ, cách Vietnam National University 44 km, WYNDHAM LYNN TIMES THANH THỦY - KHU NGHỈ DƯỠNG KHOÁNG NÓNG cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, sân hiên và nhà hàng. Khách sạn 5 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Tại khách sạn, phòng nào cũng có ban công.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách WYNDHAM LYNN TIMES THANH THỦY - KHU NGHỈ DƯỠNG KHOÁNG NÓNG 84 km.', 0, 878561604, '(+84)0999264707', '2fes1pnzxg@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (315, 'Hotel Thanh Van 2', 'Hotel Thanh Van 2 tọa lạc giáp biển ở Tuy Hoà, cách Bãi biển Tuy Hòa 6 phút đi bộ. Khách sạn 1 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Phòng khách ở khách sạn được trang bị ấm đun nước. Phòng nào cũng có tủ quần áo và TV màn hình phẳng, ngoài ra một số căn tại Hotel Thanh Van 2 có sân hiên. Tại chỗ nghỉ, các phòng được thiết kế có khu vực ghế ngồi.  Đội ngũ nhân viên lễ tân giao tiếp thành thạo bằng tiếng Anh và tiếng Việt.  Sân bay gần nhất là Sân bay Tuy Hòa, cách Hotel Thanh Van 2 6 km.', 0, 114995009, '(+84)1246543875', 'o0lzhyku3h@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (316, 'Santini Hotel', 'Nằm ở Tuy Hoà, cách Bãi biển Tuy Hòa 3 phút đi bộ, Santini Hotel cung cấp chỗ nghỉ có sân hiên và chỗ đậu xe riêng miễn phí. Ngoài phòng chờ chung, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, dịch vụ tiền sảnh và tổ chức các tour du lịch cho khách.  Tại khách sạn, các phòng đều có tủ quần áo. Tất cả các phòng có ấm đun nước, trong đó một số phòng có bếp với tủ lạnh và bếp. Các căn ở Santini Hotel được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Sân bay gần nhất là Sân bay Tuy Hòa, cách chỗ nghỉ 6 km.', 30, 943957041, '(+84)5447248248', 's2u3k3v79z@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (317, 'Nhiet Doi Hotel', 'Nằm cách Bãi biển Tuy Hòa 6 phút đi bộ, Nhiet Doi Hotel cung cấp chỗ nghỉ 2 sao ở Tuy Hoà, đồng thời có phòng chờ chung, sân hiên và nhà hàng. Ngoài dịch vụ phòng, chỗ nghỉ này còn có BBQ. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí.  Tại khách sạn, các phòng đều đi kèm với điều hòa, bàn làm việc, sân trong với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Mỗi phòng đều được thiết kế có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra biển. Tất cả các phòng đều có tủ lạnh.  Sân bay Tuy Hòa cách 6 km.', 0, 348268579, '(+84)2599806151', 'xkb7b7vljd@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (318, 'Hoàng Ngân Hotel Phú Yên', 'Nằm giáp biển ở Liên Trì (3), Hoàng Ngân Hotel Phú Yên có khu vực bãi biển riêng. Khách sạn 2 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, mỗi phòng đều có bàn làm việc. Với phòng tắm riêng được trang bị bồn tắm hoặc vòi sen và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại Hoàng Ngân Hotel Phú Yên có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, tất cả các phòng có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Tuy Hòa, cách Hoàng Ngân Hotel Phú Yên 5 km.', 0, 14567509, '(+84)2289995905', '141wiqfj8z@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (319, 'Khách sạn Apec Mandala Phú Yên', 'Khách sạn Apec Mandala Phú Yên nhìn ra thành phố, có Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí, nằm ở Tuy Hoà, cách Bãi biển Tuy Hòa 19 phút đi bộ.  Được thiết kế với sân hiên, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Tất cả các căn đều được thiết kế có ban công nhìn ra biển.  Khách có thể tìm thấy khu vực bãi biển riêng tại căn hộ, cùng khu vườn.  Sân bay gần nhất là Sân bay Tuy Hòa, cách Khách sạn Apec Mandala Phú Yên 6 km.', 0, 452310972, '(+84)9155530398', 'rghwl06usq@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (320, 'Hoàng Gia Hotel Tuy Hoà', 'Hoàng Gia Hotel Tuy Hoà ở Tuy Hoà cung cấp chỗ nghỉ 3 sao có trung tâm thể dục và sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Sân bay Tuy Hòa cách 5 km.', 0, 801104492, '(+84)5993577728', 'h2r9aw1k1n@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (321, 'Que Toi Village Resort Phu Yen', 'Nằm giáp biển, Que Toi Village Resort Phu Yen cung cấp chỗ nghỉ 4 sao ở Song Cau, đồng thời có xe đạp miễn phí, hồ bơi ngoài trời và khu vườn. Ngoài dịch vụ phòng, chỗ nghỉ này còn có nhà hàng để phục vụ du khách. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi sen, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tại resort, các phòng đều đi kèm với phòng tắm riêng với máy sấy tóc và dép đi trong phòng.  Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, Que Toi Village Resort Phu Yen có dịch vụ thuê ô tô.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên luôn túc trực để hỗ trợ khách tại lễ tân 24/24.  Sân bay Tuy Hòa cách 57 km.', 75, 84125052, '(+84)0033408169', 'nt36qt5p75@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (322, 'Apec Sunsea Condotel Phu Yen', 'Với Bãi biển Tuy Hòa nằm cách đó 19 phút đi bộ, Apec Sunsea Condotel Phu Yen cung cấp chỗ nghỉ, nhà hàng, khu vườn, sân hiên và quầy bar. Wi-Fi miễn phí có sẵn và chỗ đậu xe riêng có sẵn trong khuôn viên.  Một số căn đi kèm điều hòa, TV màn hình phẳng, máy giặt và ấm đun nước, cũng như bếp.  Khách có thể sử dụng sân chơi trẻ em tại căn hộ.  Sân bay Tuy Hòa cách 6 km.', 0, 697209525, '(+84)1400937719', 'zojqg3akz0@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (323, 'Stelia Beach Resort', 'Stelia Beach Resort có nhà hàng, hồ bơi ngoài trời, quán bar và sảnh khách chung ở Tuy Hòa. Với WiFi miễn phí, resort 5 sao này có vườn và khu vực bãi biển riêng. Tại đây cũng có lễ tân 24 giờ, dịch vụ phòng và dịch vụ thu đổi ngoại tệ cho khách.  Phòng nghỉ tại khách sạn được trang bị máy điều hòa, TV truyền hình vệ tinh màn hình phẳng, máy pha cà phê, vòi sen, máy sấy tóc và bàn làm việc. Tất cả các phòng còn đi kèm trang bị phòng tắm chung với bồn tắm và đồ vệ sinh cá nhân miễn phí. Mỗi phòng tại resort cũng có tủ quần áo, TV và phòng tắm riêng.  Bữa sáng tự chọn được phục vụ hàng ngày tại Stelia Beach Resort.  Chỗ nghỉ cũng có sân hiên tắm nắng. Đi xe đạp là hoạt động phổ biến trong khu vực. Du khách cũng có thể thuê xe máy và xe hơi tại resort.  Sân bay gần nhất là sân bay Tuy Hòa, cách resort 10,5 km.', 0, 122623188, '(+84)0629899409', '1m5llaphh4@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (324, 'Apec Mandala Hotel & Apartment Tuy Hòa', 'Nằm giáp biển, Apec Mandala Hotel & Apartment Tuy Hòa cung cấp chỗ nghỉ 5 sao ở Tuy Hoà, đồng thời có trung tâm thể dục, khu vườn và phòng chờ chung. Ngoài dịch vụ phòng, chỗ nghỉ này còn có nhà hàng và sân chơi trẻ em để phục vụ du khách. Một số phòng tại chỗ nghỉ có sân hiên với view thành phố.  Một số phòng có bếp nhỏ với tủ lạnh.  Khách sạn có phục vụ bữa sáng thực đơn buffet mỗi buổi sáng.  Thành thạo tiếng Anh, tiếng Pháp, tiếng Hàn và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn túc trực để hỗ trợ khách.  Apec Mandala Hotel & Apartment Tuy Hòa cách Bãi biển Tuy Hòa 19 phút đi bộ. Sân bay Tuy Hòa cách 6 km.', 0, 174320741, '(+84)4711541193', '9k3kuk0fxy@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (325, 'Nam Long Hotel', 'Nam Long Hotel nằm trong bán kính chỉ 50 m từ Sông Nhật Lệ và 300 m từ Bãi biển Nhật Lệ. Nơi nghỉ có nhà hàng, trung tâm dịch vụ doanh nhân và truy cập Wi-Fi miễn phí.  Nam Long Hotel cách Bãi biển Bảo Ninh 1 km. Khách sạn cách Ga tàu Đồng Hới 3,5 km và Sân bay Đồng Hới 6 km. Làng chiến tranh Vực Quành và Động Phong Nha cách đó lần lượt 13 km và 50 km.  Các phòng ngủ tập thể và phòng riêng gắn máy lạnh tại đây có sàn lát đá cẩm thạch, truyền hình cáp, két an toàn cá nhân và phòng tắm riêng với đồ vệ sinh cá nhân.  Nhà hàng trong nhà phục vụ các món đặc sản của châu Á và phương Tây theo kiểu gọi món. Bữa sáng cũng có thể được cung cấp ngay tại phòng nghỉ của khách.  Nhân viên tại quầy lễ tân 24 giờ có thể hỗ trợ khách với các dịch vụ giặt là, để hành lý, thu đổi ngoại tệ và thuê phương tiện vận chuyển. Quý khách cũng có thể thu xếp việc đi lại tại bàn đặt tour.', 0, 770997895, '(+84)0018216596', 'hybu2n889s@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (326, 'HAI DANG HOTEL', 'Nằm ở Xóm Ðé, cách Bãi biển Nhật Lệ 3 phút đi bộ, HAI DANG HOTEL cung cấp chỗ nghỉ có phòng chờ chung và chỗ đậu xe riêng miễn phí. Ngoài xe đạp miễn phí, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cho khách.  Tại khách sạn, các phòng được thiết kế có tủ quần áo. Các căn ở HAI DANG HOTEL được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Chỗ nghỉ có sân hiên phơi nắng. Đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, HAI DANG HOTEL có dịch vụ thuê ô tô.  Sân bay gần nhất là Sân bay Đồng Hới, cách khách sạn 5 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 819226590, '(+84)5545531770', 'myy7doro2a@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (327, 'Thien Thanh Hotel', 'Thien Thanh Hotel có khu vườn, phòng chờ chung, sân hiên và nhà hàng ở Phong Nha. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Mỗi phòng đều có điều hòa, ngoài ra một số căn tại khách sạn có ban công.  Leo núi và đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, khách sạn 2 sao này có dịch vụ thuê xe đạp.  Sân bay Đồng Hới cách 37 km.', 0, 296082238, '(+84)2614908182', 'f3fu6qjw54@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (328, '68 ĐỒNG HẢI HOTEL', 'Với quầy bar và nhìn ra thành phố, 68 ĐỒNG HẢI HOTEL tọa lạc ở Ðồng Hới, cách Bãi biển Nhật Lệ chưa đến 1 km. Ngoài sân hiên, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Các phòng được trang bị TV màn hình phẳng có truyền hình vệ tinh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tại khách sạn, phòng nào cũng có ga trải giường và khăn tắm.  Sân bay Đồng Hới cách 5 km.', 0, 55575539, '(+84)2202076323', '279yx23t29@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (329, 'Clover Home Quảng Bình', 'Clover Home Quảng Bình tọa lạc giáp biển ở Ðồng Hới, cách Bãi biển Nhật Lệ 2.1 km. Ngoài sân hiên, khách sạn 3 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Mỗi phòng đều có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại khách sạn, phòng nào cũng có ga trải giường và khăn tắm.  Clover Home Quảng Bình có phục vụ bữa sáng thực đơn à la carte và kiểu Á hằng ngày.  Sân bay Đồng Hới cách 6 km.', 0, 316792282, '(+84)3047334803', 'oaaht4wqpa@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (330, 'Phu Cuong Beach Hotel', 'Nằm ở Ðồng Hới, cách Bãi biển Nhật Lệ chỉ vài bước chân, Phu Cuong Beach Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Khách sạn 3 sao này có phòng chờ chung và dịch vụ phòng. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm chung với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại Phu Cuong Beach Hotel, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng kiểu lục địa mỗi buổi sáng. Tại Phu Cuong Beach Hotel, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực châu Phi, Mỹ và Argentina. Bên cạnh đó, họ có thể yêu cầu món chay, đồ ăn Halal và kosher (cho người đạo Do Thái).  Khách sạn có sân hiên. Khách sạn này có dịch vụ thuê xe đạp và dịch vụ thuê ô tô. Ngoài ra, đi xe đạp là hoạt động được ưa chuộng trong khu vực.  Sân bay Đồng Hới cách 1 km.', 0, 497980980, '(+84)9297990164', 'e7kx835jxr@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (331, 'Khách sạn SAM Quảng Bình', 'Khách sạn SAM Quảng Bình có trung tâm thể dục, khu vườn, nhà hàng và quầy bar ở Ðồng Hới. Ngoài Wi-Fi miễn phí, khách sạn 4 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Du khách có thể sử dụng hồ bơi trong nhà, hoặc tận hưởng cảnh thành phố.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Các căn có tủ quần áo.  Sân bay Đồng Hới cách 6 km.', 0, 184088349, '(+84)1793167333', '8nz81zh4j8@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (332, 'Vinh Hoang Hotel', 'Tọa lạc ở Ðồng Hới, cách Bãi biển Nhật Lệ chỉ vài bước chân, Vinh Hoang Hotel cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và phòng chờ chung. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Khách có thể sử dụng quầy bar.  Tại khách sạn, tất cả các phòng đều được thiết kế có điều hòa, bàn làm việc, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Tất cả các phòng đều có ấm đun nước, trong đó một số phòng có bếp với tủ lạnh và bếp. Tất cả các căn có két an toàn.  Vinh Hoang Hotel có phục vụ bữa sáng thực đơn à la carte hoặc kiểu Á.  Sân bay Đồng Hới cách 4 km.', 0, 65906460, '(+84)7227969038', '87pa6drarj@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (333, 'Melia Vinpearl Quang Binh', 'Melia Vinpearl Quang Binh có trung tâm thể dục, phòng chờ chung, nhà hàng và quầy bar ở Ðồng Hới. Khách sạn 5 sao này có máy ATM và dịch vụ tiền sảnh. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Các phòng có tủ quần áo.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, kiểu lục địa hoặc kiểu Á cho bữa sáng.  Chỗ nghỉ có hồ bơi trong nhà, tiệm làm tóc và dịch vụ văn phòng ngay trong khuôn viên.  Melia Vinpearl Quang Binh cách Bãi biển Nhật Lệ 1.9 km. Sân bay Đồng Hới cách 7 km.', 0, 423925265, '(+84)1079941756', 'qq15567vkz@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (334, 'Gold Coast Hotel Resort & Spa', 'Nằm ở Ðồng Hới, cách Bãi biển Nhật Lệ 2 phút đi bộ, Gold Coast Hotel Resort & Spa cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, hồ bơi ngoài trời và trung tâm thể dục. Ngoài khu vườn, chỗ nghỉ còn có khu vực bãi biển riêng và phòng chờ chung. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, câu lạc bộ trẻ em và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Resort sẽ cung cấp cho khách các phòng có điều hòa, bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Một số phòng có bếp với tủ lạnh và lò vi sóng. Tại Gold Coast Hotel Resort & Spa, các phòng được thiết kế có ga trải giường và khăn tắm.  Tại chỗ nghỉ, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Việt và địa phương. Bên cạnh đó, họ có thể yêu cầu món chay và món thuần chay.  Gold Coast Hotel Resort & Spa có sân hiên.  Sân bay Đồng Hới cách 9 km.', 0, 181655466, '(+84)6241428914', 'sjgeqlp1vf@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (335, 'Cocohut Hoi An Homestay', 'Với hồ bơi ngoài trời, khu vườn, cùng phòng chờ chung, Cocohut Hoi An Homestay cung cấp chỗ nghỉ ở Hội An có Wi-Fi miễn phí và nhìn ra hồ bơi. Homestay 1 sao này nhìn ra khu vườn và cách Bãi biển Cửa Đại 19 phút đi bộ.  Homestay điều hòa này có 1 phòng ngủ, phòng khách, bếp đầy đủ tiện nghi với tủ lạnh và ấm đun nước, 1 phòng tắm với vòi sen và đồ vệ sinh cá nhân miễn phí. Khăn tắm và ga trải giường có sẵn ở homestay.  Homestay có cả dịch vụ cho thuê xe đạp và dịch vụ cho thuê ô tô.  Cocohut Hoi An Homestay cách Hội Quán Chi Hội Triều Châu Trung Quốc 6.4 km và Bảo tàng lịch sử Hội An 6.8 km. Chỗ nghỉ cách Sân bay Quốc tế Đà Nẵng 28 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 49, 262250869, '(+84)1400739728', 'jba68mkbnx@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (336, 'Family Hotel', 'Với xe đạp miễn phí, Family Hotel tọa lạc ở trung tâm Hội An và cách Bảo tàng lịch sử Hội An chưa đến 1 km. Ngoài Wi-Fi miễn phí, khách sạn 1 sao này còn cung cấp quầy lễ tân 24 giờ và máy ATM. Chỗ nghỉ này cung cấp dịch vụ tiền sảnh, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn có sân hiên phơi nắng.  Family Hotel cách Chùa Cầu 13 phút đi bộ và Hội Quán Chi Hội Triều Châu Trung Quốc 1.3 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách chỗ nghỉ 29 km.', 0, 390174966, '(+84)0299253655', 'zo9dtp4d6q@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (337, 'Nha Bong Villa', 'Tọa lạc ở Hội An, cách Chùa Cầu 6.6 km, Nha Bong Villa cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí và sân hiên. Mỗi phòng tại khách sạn 2 sao này đều nhìn ra khu vườn, đồng thời khách có thể sử dụng hồ bơi trong nhà. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, máy ATM và Wi-Fi miễn phí.  Tại khách sạn, các phòng đều đi kèm với tủ quần áo. Phòng nào cũng có ấm đun nước, trong đó một số phòng có ban công. Phòng khách tại Nha Bong Villa có điều hòa và bàn làm việc.  Khách tại chỗ nghỉ có thể thưởng thức bữa sáng thực đơn à la carte.  Nha Bong Villa cách Bảo tàng lịch sử Hội An 6.9 km và Hội Quán Chi Hội Triều Châu Trung Quốc 7.4 km.', 70, 248691229, '(+84)4577936840', '1srplsuvle@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (338, 'Hoi An Pho Library Hotel', 'Tọa lạc tại trung tâm thành phố Hội An, cách Khu Phố Cổ giàu giá trị văn hóa chỉ 5 phút đi bộ, Hoi An Pho Library Hotel chào đón du khách bằng đồ uống đồng thời cung cấp hồ bơi trên sân thượng, các phòng hiện đại với những tác phẩm thủ công của địa phương và Wi-Fi miễn phí trong toàn khuôn viên.  Quý khách có thể chiêm ngưỡng những căn nhà, ngôi đền và Chùa Cầu Nhật Bản có từ thế kỷ 19 trong Khu Phố Cổ. Hotel Vinh Hung cách các bãi biển Cửa Đại và An Bàng 10 phút lái xe.  Các phòng nghỉ tại đây có đồ nội thất cổ điển bằng gỗ tối màu được chạm khắc tinh xảo, Wi-Fi miễn phí và truyền hình cáp màn hình phẳng. Một số phòng chọn lọc đi kèm ban công nhìn ra cảnh thành phố hoặc khu vườn.  Khách sạn có hiên tắm nắng và dịch vụ cho thuê xe đạp đáp ứng nhu cầu những khách muốn khám phá thành phố. Chỗ nghỉ này cũng có bàn đặt tour có thể hỗ trợ khách sắp xếp việc đi tham quan và trung tâm dịch vụ doanh nhân. Khách nghỉ tại khách sạn được đọc miễn phí tuyển chọn nhiều cuốn sách, tạp chí và tiểu thuyết bằng những ngôn ngữ khác nhau của thư viện. Những khách quan tâm có thể mang sách có giá trị tương đương để đổi lấy một cuốn sách của thư viện miễn phí.  Quý khách có thể thưởng thức các món ăn Âu Á ngon tuyệt tại nhà hàng của khách sạn, nơi phục vụ bữa sáng tự chọn hàng ngày.', 37, 610932265, '(+84)0877837501', 'moqzenf7g0@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (339, 'Cashew Tree Bungalow', 'Tọa lạc cách Bãi biển An Bàng 3 phút đi bộ, Cashew Tree Bungalow cung cấp chỗ nghỉ có khu vườn, quầy bar và bếp chung. WiFi miễn phí có sẵn.  Được thiết kế với sân hiên, các căn có điều hòa, TV màn hình phẳng, cùng phòng tắm riêng gồm vòi sen và đồ vệ sinh cá nhân miễn phí. Tủ lạnh và minibar, cũng như ấm đun nước đều được cung cấp.  Nhà nghỉ B&B có dịch vụ cho thuê ô tô, đồng thời du khách có thể đi xe đạp gần đó.  Cashew Tree Bungalow cách Bãi biển Hà My 8 phút đi bộ và Bãi biển Cửa Đại 2.5 km. Sân bay gần nhất là Sân bay Quốc tế Đà Nẵng, cách chỗ nghỉ 23 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 642593058, '(+84)7158246803', 'pad8fn15f1@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (340, 'An Vu Villa Hoi An', 'Nằm ở Tân Thành (1), cách Bãi biển An Bàng 6 phút đi bộ, An Vu Villa Hoi An cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Mỗi phòng tại khách sạn 3 sao này đều nhìn ra khu vườn, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, các phòng đều đi kèm với điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view sông. Tất cả các phòng đều được thiết kế có két an toàn và một số phòng nhìn ra hồ. Tất cả các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Khách tại An Vu Villa Hoi An có thể thưởng thức bữa sáng thực đơn buffet.  Leo núi và đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê xe đạp.  An Vu Villa Hoi An cách Bãi biển Cửa Đại 17 phút đi bộ và Bảo tàng lịch sử Hội An 5.3 km.', 40, 370344338, '(+84)6555300758', 't6uy35ipbf@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (341, 'Rockmouse Centre River Villa Hoi An', 'Với Chùa Cầu nằm cách đó 4 phút đi bộ, Rockmouse Centre River Villa Hoi An cung cấp chỗ nghỉ, nhà hàng, hồ bơi ngoài trời, khu vườn và phòng chờ chung. WiFi và chỗ đậu xe riêng đều có sẵn tại nhà nghỉ B&B miễn phí.  Một số căn có sân hiên nhìn ra thành phố, TV màn hình phẳng truyền hình vệ tinh và điều hòa.  Chỗ nghỉ có phục vụ bữa sáng thực đơn à la carte, kiểu lục địa hoặc kiểu Mỹ mỗi sáng.  Rockmouse Centre River Villa Hoi An có dịch vụ cho thuê xe đạp, đồng thời du khách có thể đi xe đạp gần đó.  Chỗ nghỉ cách Bảo tàng lịch sử Hội An chưa đến 1 km và Hội Quán Chi Hội Triều Châu Trung Quốc 11 phút đi bộ. Chỗ nghỉ cách Sân bay Quốc tế Đà Nẵng 30 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 79, 265605751, '(+84)1945735779', 'wli6fxwa2b@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (342, 'Vinh Hung Riverside Resort & Spa', 'Nằm dọc theo bờ Sông Thu Bồn, Vinh Hung Riverside Resort & Spa cung cấp các phòng nghỉ trang nhã với tầm nhìn ra sông hoặc vườn tại thành phố Hội An. Resort có hồ bơi ngoài trời, khu vui chơi cho trẻ em và 4 địa điểm ăn uống ngay trong khuôn viên. Quý khách có thể sử dụng miễn phí WiFi và chỗ đỗ xe riêng tại đây.  Các phòng nghỉ rộng rãi được trang trí theo phong cách Việt Nam và có cửa sổ lớn đón nhiều ánh sáng tự nhiên. Mỗi phòng đều được trang bị đầy đủ tiện nghi, bao gồm truyền hình cáp, tủ lạnh mini và phòng tắm riêng đi kèm vòi sen, máy sấy tóc cùng dép.  Du khách có thể rèn luyện sức khỏe tại phòng tập thể dục, thư giãn với buổi xông hơi khô hoặc tận hưởng liệu pháp mát-xa nhẹ nhàng tại spa. Nhân viên tại quầy lễ tân phục vụ 24 giờ có thể hỗ trợ khách với các dịch vụ thu đổi ngoại tệ, giữ hành lý và đưa đón sân bay theo yêu cầu. Du khách cũng có thể tham gia lớp học nấu ăn tại đây.  Vinh Hung Riverside Resort & Spa cách Phố Cổ Hội An 550 m và Làng mộc Kim Bồng 1,2 km. Sân bay gần nhất là sân bay quốc tế Đà Nẵng, cách chỗ nghỉ 23 km.  Nhà hàng Red Tile phục vụ nhiều món ăn địa phương và quốc tế hảo hạng, trong khi đồ ăn nhẹ được cung cấp tại quán Red Brick Bar.', 0, 352247371, '(+84)2801613065', 'dfdt560jrb@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (343, 'Montgomerie Links Hotel & Villas', 'Montgomerie Links Hotel & Villas features an award-winning Montgomerie Links Golf Course. The accommodation provides free daily scheduled shuttle to Hoi An and Danang. Guests can take part in activities at the property such as Taekwondo class, towel folding art and golf introduction.  At the resort, each room has a wardrobe and a window overlooking the golf course. Guest rooms at Montgomerie Links Hotel & Villas include a flat-screen cable TV. The en suite bathroom comes with shower facilities, slippers and hairdryer.  Birdies Restaurant offers a continental or Asian breakfast. Other dining options are available at Links Coffee and Bistro Restaurant.  Montgomerie Links Hotel & Villas offers a terrace. The property also features a fitness centre, outdoor swimming pool and free on-site parking.  Montgomerie Links Golf Course is 100 metres from the resort, while Marble Mountain is 4 km away. The nearest airport is Da Nang International Airport, 13 km from Montgomerie Links Hotel & Villas.', 0, 585684287, '(+84)3669208620', 'rtf4abahi5@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (344, 'La Siesta Hoi An Resort & Spa', 'Nằm trong 2 cánh ở thành phố Hội An, Hoi An La Siesta Resort & Spa có hồ bơi nước mặn rộng 400 m², hồ bơi vô cực rộng 200 m², hồ bơi trẻ em và hồ bơi nước ngọt rộng 100 m². Cánh Cổ Điển kiểu truyền thống hợp thời có 70 phòng nghỉ trong khi cánh Club có 67 suite cổ điển mang nét đặc trưng của khu phố cổ. Du khách có thể tự thưởng cho mình một buổi mát-xa vô cùng dễ chịu tại spa hoặc thư giãn trong vườn. Chỗ nghỉ cung cấp WiFi miễn phí trong toàn bộ khuôn viên và xe đạp cho khách sử dụng miễn phí.  Tất cả phòng nghỉ gắn máy điều hòa tại đây đều có ban công riêng hoặc cửa sổ mở ra quang cảnh hồ bơi | khu vườn xanh tươi | ruộng lúa. Các phòng được trang bị TV truyền hình cáp màn hình phẳng, máy tính xách tay và phòng tắm riêng với buồng tắm đứng/bồn tắm. Áo choàng tắm, dép đi trong phòng và đồ vệ sinh cá nhân miễn phí được cung cấp để tạo sự thoải mái cho khách.  Nhà hàng Red Bean phục vụ một loạt món ăn Châu Á trong khi nhà hàng Nhà hàng The Temple cung cấp ẩm thực Châu Âu. Dịch vụ phòng được cung cấp theo yêu cầu.  Hội quán Quảng Đông và Chùa Cầu Nhật Bản đều nằm cách Hoi An La Siesta Resort & Spa 1,1 km trong khi Phố Cổ Hội An cách đó 700 m. Sân bay quốc tế Đà Nẵng nằm trong bán kính 30 km từ chỗ nghỉ. Chỗ nghỉ cung cấp dịch vụ đưa đón miễn phí đến Khu Phố Cổ và Bãi biển An Bàng.', 0, 170467940, '(+84)3590960863', '7yaluwd64i@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (345, 'Kocmoc Hotel Hạ Long', 'Tọa lạc ở Hạ Long, cách Bảo tàng Quảng Ninh 8 phút đi bộ và Trung tâm thương mại Vincom Hạ Long 1.8 km, Kocmoc Hotel Hạ Long cung cấp chỗ nghỉ có phòng chờ chung và chỗ đậu xe riêng miễn phícho khách lái xe. Ngoài khu vườn, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Du khách có thể tận hưởng cảnh thành phố.  Tại khách sạn, tất cả các phòng có bàn làm việc và TV màn hình phẳng. Tại Kocmoc Hotel Hạ Long, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Thành thạo tiếng Anh, tiếng Pháp, tiếng Nga và tiếng Việt đội ngũ nhân viên luôn túc trực 24/7 tại lễ tân.  Chỗ nghỉ cách Cáp treo Nữ Hoàng 7 km và Cảng Tuần Châu 19 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách Kocmoc Hotel Hạ Long 48 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 980692068, '(+84)0898140715', 'qrqhtvjtif@hotmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (346, 'Sunlight Hotel Hạ Long', 'Nằm cách Bãi biển Marina Bay 1.9 km và Bãi Cháy 2 km, Sunlight Hotel Hạ Long cung cấp các phòng điều hòa và phòng tắm riêng ở Hạ Long. Khách sạn 1 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Tất cả các phòng ở khách sạn được trang bị TV màn hình phẳng. Tại Sunlight Hotel Hạ Long, các phòng đều có phòng tắm riêng.  Chỗ nghỉ cách Cáp treo Nữ Hoàng 4 km và Cảng Tuần Châu 9.1 km.', 0, 377771587, '(+84)4149201997', '544rkaviny@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (347, 'Fancy Backpackers Hostel', 'Tọa lạc ở Hạ Long, cách Bãi Cháy 17 phút đi bộ, Fancy Backpackers Hostel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, phòng chờ chung và quầy bar. Ngoài phòng gia đình, chỗ nghỉ này cũng cung cấp cho khách sân hiên phơi nắng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, bàn bán tour và dịch vụ thu đổi ngoại tệ cho khách.  Phòng tắm chung được trang bị vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Phòng khách có ga trải giường.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet, thực đơn à la carte hoặc kiểu lục địa hằng ngày. Tại khách sạn, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Anh và Pháp. Bên cạnh đó, họ có thể yêu cầu món chay, không chứa sữa và món thuần chay.  Khách có thể chơi bi-a, trò phi tiêu, cũng như dịch vụ thuê ô tô tại khách sạn 2 sao này.  Fancy Backpackers Hostel cách Cáp treo Nữ Hoàng 3 phút đi bộ và Trung tâm thương mại Vincom Hạ Long 6.9 km. Chỗ nghỉ cách Sân bay Quốc tế Cát Bi 42 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 663698367, '(+84)8961634570', 'tc1lgw5jtq@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (348, 'DH Japan Hotel', 'Nằm tại vị trí thuận tiện ở Bãi Cháy, Hạ Long, DH Japan Hotel nằm cách Bãi Cháy 9 phút đi bộ, Cáp treo Nữ Hoàng 1.5 km và Trung tâm thương mại Vincom Hạ Long 8.1 km. Khách sạn 2 sao này có bàn bán tour và phòng giữ hành lý. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại DH Japan Hotel có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, tất cả các phòng đều có ga trải giường và khăn tắm.  DH Japan Hotel cách Bảo tàng Quảng Ninh 10 km và Cảng Tuần Châu 12 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách khách sạn 41 km.', 5, 654135262, '(+84)0829331005', '9tesmduy2i@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (349, 'BBQ Hostel Ha Long 2', 'BBQ Hostel Ha Long 2 có khu vườn, phòng chờ chung, sân hiên và nhà hàng ở Hạ Long. Hostel 3 sao này có dịch vụ phòng và bàn bán tour. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Ngoài phòng tắm riêng với vòi xịt/chậu rửa vệ sinh và máy sấy tóc, một số căn tại hostel cũng có view biển.  BBQ Hostel Ha Long 2 có phục vụ bữa sáng thực đơn à la carte hoặc kiểu Mỹ.  Chỗ nghỉ cách Bãi Cháy 2.3 km và Cáp treo Nữ Hoàng 19 phút đi bộ.', 0, 479657201, '(+84)1182716197', '4hbp68x0gz@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (350, 'Oriental Sails Cruise', 'Oriental Sails là du thuyền thanh lịch xuôi dòng nước trong xanh của Vịnh Hạ Long. Du khách có thể tận hưởng các hoạt động câu cá, tận hưởng một suất mát xa truyền thống thư giãn hoặc thưởng ngoạn quang cảnh tuyệt đẹp trên boong tàu.  Du thuyền hiện đại này nằm trong bán kính 1,5 giờ đi tàu từ Đảo Rùa và khoảng 4 giờ đi tàu từ Vịnh Lan Hạ và Làng chài Vạn Giá.  Được trang bị thanh lịch với sàn gỗ và máy điều hòa, các phòng nghỉ còn có tủ quần áo và phòng tắm riêng với tiện nghi vòi sen cùng đồ vệ sinh cá nhân miễn phí.  Du khách có thể đi chèo thuyền kayak hoặc sử dụng trung tâm dịch vụ doanh nhân và tiện nghi tổ chức tiệc. Ngoài ra, nơi đây còn có bàn đặt tour va quầỳ lễ tân làm việc 24 giờ. Quý khách cũng có thể tận hưởng các hoạt động khác nhau trên du thuyền, chẳng hạn như lớp học nấu ăn hoặc tập Thái Cực Quyền vào buổi sáng.  Nhà hàng Oriental Sails sẽ phục vụ vô số món ăn Phương Tây và Châu Á. Du khách cũng có thể thưởng thức tuyển chọn các loại rượu và cocktail tại Snack Bar.', 0, 208024273, '(+84)7631956670', 'muexyhczyi@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (351, 'Mường Thanh Holiday Suối Mơ Hạ Long', 'Nằm ở Hạ Long, cách Bãi Cháy 1.7 km, Mường Thanh Holiday Suối Mơ Hạ Long cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Ngoài nhà hàng, chỗ nghỉ còn có quầy bar và bể sục. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, phòng chờ chung và Wi-Fi miễn phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng, sân trong và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Mường Thanh Holiday Suối Mơ Hạ Long, các phòng được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng mỗi buổi sáng, gồm các lựa chọn thực đơn buffet, thực đơn à la carte và kiểu Mỹ.  Chỗ nghỉ có sân hiên phơi nắng.  Khách có thể tùy ý sử dụng dịch vụ văn phòng tại Mường Thanh Holiday Suối Mơ Hạ Long.  Khách sạn cách Cáp treo Nữ Hoàng 7 phút đi bộ và Trung tâm thương mại Vincom Hạ Long 6.9 km.', 46, 900855496, '(+84)4111204196', 'jjxqot152j@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (352, 'Crystal Holiday Halong Hotel', 'Crystal Holiday Halong Hotel có hồ bơi ngoài trời, khu vườn, sân hiên và nhà hàng ở Hạ Long. Ngoài quầy bar, khách sạn 4 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cho khách.  Tất cả các phòng đi kèm tủ lạnh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng được thiết kế có TV màn hình phẳng, ngoài ra một số phòng tại khách sạn có view biển. Tại Crystal Holiday Halong Hotel, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ cách Bãi Cháy 3 phút đi bộ. Sân bay Quốc tế Cát Bi cách 40 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 70, 860670250, '(+84)4909053839', 'gf2tiyjpp9@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (353, 'Sea Stars Hotel Ha Long', 'Tọa lạc ở Hạ Long, cách Bãi Cháy chưa đến 1 km, Sea Stars Hotel Ha Long cung cấp chỗ nghỉ có hồ bơi ngoài trời, chỗ đậu xe riêng miễn phí, trung tâm thể dục và nhà hàng. Khách sạn 5 sao này cung cấp quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí.  Khách sạn cung cấp cho khách các phòng có điều hòa, tủ quần áo, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Sea Stars Hotel Ha Long, phòng nào cũng có ga trải giường và khăn tắm.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, thực đơn à la carte hoặc kiểu Mỹ cho bữa sáng.  Chỗ nghỉ cách Bãi biển Marina Bay 2.3 km và Cáp treo Nữ Hoàng 3.1 km.', 20, 707828915, '(+84)3282983902', 'rkdeo6fmo0@hotmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (354, 'A La Carte Ha Long Bay Residence', 'A La Carte Ha Long Bay Residence tọa lạc giáp biển ở Hạ Long, cách Cáp treo Nữ Hoàng 6.2 km và Cảng Tuần Châu 7.6 km. Khách sạn 5 sao này cung cấp quầy lễ tân 24 giờ và Wi-Fi miễn phí. Đây là chỗ nghỉ không hút thuốc và nằm cách Bãi biển Marina Bay chỉ vài bước chân.  Tại khách sạn, các phòng đều có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, các căn tại A La Carte Ha Long Bay Residence có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  A La Carte Ha Long Bay Residence cách Trung tâm thương mại Vincom Hạ Long 13 km và Bảo tàng Quảng Ninh 14 km. Sân bay gần nhất là Sân bay Quốc tế Cát Bi, cách khách sạn 38 km.', 0, 590405120, '(+84)3308056483', 'ps8a3lep8j@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (355, 'Khách sạn nam đông', 'Khách sạn nam đông nằm ở Quảng Trị và có sân hiên. Ngoài khu vườn, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, các phòng đều có ban công. Tất cả các phòng ở Khách sạn nam đông được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Đội ngũ nhân viên của chỗ nghỉ luôn túc trực tại lễ tân 24/24 để cung cấp đề xuất cho du khách.  Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách Khách sạn nam đông 81 km.', 0, 903597479, '(+84)8261874928', '83cn72b5zd@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (356, 'KHÁCH SẠN PHỤNG HOÀNG', 'KHÁCH SẠN PHỤNG HOÀNG là chỗ nghỉ 2 sao tọa lạc ở Quảng Trị Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Một số căn tại chỗ nghỉ có sân hiên với view thành phố.  Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách khách sạn 82 km.', 0, 658810719, '(+84)9261698043', '8yghkf46j9@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (357, 'PALM GARDEN HOUSE', 'Tọa lạc ở Quảng Trị, PALM GARDEN HOUSE có xe đạp miễn phí, khu vườn, sân hiên, cùng Wi-Fi miễn phí. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Mỗi phòng đều được thiết kế có phòng tắm riêng, ngoài ra một số căn tại guest house có ban công.  Đội ngũ nhân viên lễ tân 24/24 giao tiếp thành thạo bằng tiếng Anh và tiếng Việt.  Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách PALM GARDEN HOUSE 82 km.', 0, 22230046, '(+84)9227774643', '305ydwi48b@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (358, 'Hoa Phuong Guesthouse', 'Tọa lạc ở Ðông Hà, Hoa Phuong Guesthouse có phòng chờ chung và sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Phòng khách tại guest house được trang bị khu vực ghế ngồi, TV màn hình phẳng có truyền hình cáp, bếp, khu vực ăn uống, cùng phòng tắm riêng với đồ vệ sinh cá nhân miễn phí, vòi xịt/chậu rửa vệ sinh và dép đi trong phòng. Tất cả các phòng đều được thiết kế có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại Hoa Phuong Guesthouse, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Leo núi là hoạt động được ưa chuộng trong khu vực. Ngoài ra, chỗ nghỉ có dịch vụ thuê xe đạp và dịch vụ thuê ô tô.  Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách Hoa Phuong Guesthouse 87 km.', 0, 883147371, '(+84)8829808419', 'gie57tnh6t@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (359, 'Muong Thanh Grand Quang Tri Hotel', 'Muong Thanh Quang Tri Hotel nằm ở một vị trí yên tĩnh của tỉnh Quảng Trị. Nơi đây có hồ bơi trong nhà, Wi-Fi miễn phí và trung tâm thể dục hiện đại. Các phòng đều được bài trí trang nhã và gắn máy lạnh.  Các phòng nghỉ ở đây rộng rãi và sáng sủa. Mỗi phòng đều được trang bị tủ lạnh nhỏ, ấm đun nước điện và khu vực tiếp khách thoải mái. Phòng tắm riêng đầy phong cách đi kèm đồ vệ sinh cá nhân miễn phí, máy sấy tóc và bồn tắm.  Muong Thanh Quang Tri Hotel có chỗ để hành lý, tiện nghi đỗ xe miễn phí và sảnh khách chung. Dịch vụ mát-xa truyền thống có thể được bố trí theo yêu cầu. Để tạo thuận tiện cho quý khách, nơi đây còn cung cấp dịch vụ đưa đón và vận chuyển sân bay với một khoản phụ phí.  Quý khách có thể thưởng thức các món ăn châu Á và quốc tế tại nhà hàng trong khuôn viên. Các lựa chọn ăn uống trong phòng và bữa sáng cũng có thể được phục vụ trong phòng theo yêu cầu.  Tòa nhà hiện đại này cách Sân bay Phú Bài khoảng 79 km.', 53, 339600122, '(+84)0428481621', 'n1rue3eqai@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (360, 'Sai Gon Dong Ha Hotel - a member of Saigontourist Group', 'Tọa lạc tại vị trí trung tâm, đối diện Chợ Đông Hà, cách Sông Hiếu chỉ vài bước chân, cách ga tàu Đông Hà chỉ 3 km, cách Bãi biển Cửa Tùng 3 km và cách địa đạo Vịnh Mốc 30 km, Sai Gon Dong Ha Hotel - a member of Saigontourist Group có truy cập WiFi miễn phí, chỗ đỗ xe riêng, sân tennis, trung tâm thể dục và hồ bơi thư giãn.  Các phòng máy lạnh tại đây được trang bị truyền hình cáp màn hình phẳng, tiện nghi pha trà/cà phê, minibar, két an toàn cá nhân, tủ quần áo và phòng tắm riêng với bồn tắm cùng đồ vệ sinh cá nhân.  Nhà hàng nằm ở tầng trệt phục vụ bữa sáng tự chọn. Du khách sẽ được thưởng thức bữa trưa và bữa tối theo kiểu gọi món. Dịch vụ phòng cũng được cung cấp.  Khách sạn có không gian tổ chức tiệc/hội họp và cửa hàng bán đồ lưu niệm. Nhân viên lễ tân 24 giờ có thể giúp khách thu xếp các dịch vụ để hành lý, giặt là và đưa/đón sân bay.', 0, 908467407, '(+84)1441963141', '986vq3q46x@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (361, 'Khách Sạn Mỹ Hằng', 'Khách Sạn Mỹ Hằng cung cấp chỗ nghỉ ở Sóc Trăng. Ngoài phòng chờ chung, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Các phòng đều đi kèm với bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Khách Sạn Mỹ Hằng có sân hiên. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  Khách Sạn Mỹ Hằng có phục vụ bữa sáng thực đơn buffet và thực đơn à la carte mỗi buổi sáng.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân luôn sẵn lòng đưa ra đề xuất hữu ích về khu vực xung quanh.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách khách sạn 72 km.', 0, 613595578, '(+84)5575784469', 'hrq96lk778@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (362, 'XUÂN HUỲNH 3 Hotel', 'XUÂN HUỲNH 3 Hotel tọa lạc ở Sóc Trăng. Mỗi phòng tại khách sạn 2 sao này đều nhìn ra thành phố, đồng thời khách có thể sử dụng phòng chờ chung và sân hiên. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Phòng khách được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Phòng tắm riêng được trang bị vòi sen, máy sấy tóc và dép đi trong phòng. Tại khách sạn, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách XUÂN HUỲNH 3 Hotel 67 km.', 0, 221898088, '(+84)2361586526', 'qhsawmv0oz@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (363, 'Satraco Royal Hotel', 'Satraco Royal Hotel tọa lạc ở Sóc Trăng và có khu vườn. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, mỗi phòng đều được thiết kế có điều hòa, bàn làm việc, sân hiên với view sông, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Phòng khách đều có tủ lạnh.  Tại Satraco Royal Hotel, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Hoa và Việt. Bên cạnh đó, họ có thể yêu cầu món chay và món thuần chay.  Sân bay Quốc tế Cần Thơ cách 72 km.', 0, 329468286, '(+84)2408355319', 'd5iizguwlw@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (364, 'Nét Việt Hotel Vincom Sóc Trăng', 'Nét Việt Hotel Vincom Sóc Trăng tọa lạc ở Sóc Trăng và có quầy bar. Khách sạn 3 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Mỗi phòng đều có điều hòa, két an toàn và TV màn hình phẳng, ngoài ra một số căn tại khách sạn có ban công. Các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Sân bay Quốc tế Cần Thơ cách 70 km.', 10, 553854419, '(+84)8629356206', 'obd5z5m8my@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (365, 'Thuan Phat House Soc Trang', 'Thuan Phat House Soc Trang tọa lạc ở Sóc Trăng. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp quầy lễ tân 24 giờ và phòng giữ hành lý. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Phòng khách được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng, vòi sen và máy sấy tóc, các phòng tại khách sạn đều có view thành phố. Tại Thuan Phat House Soc Trang, mỗi phòng đều được thiết kế có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách chỗ nghỉ 69 km.', 69, 621755355, '(+84)7308915750', 'aq8f8k2cks@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (366, 'Thien An Hotel', 'Tọa lạc ở Sóc Trăng, Thien An Hotel cung cấp chỗ nghỉ có sân hiên hoặc ban công, Wi-Fi miễn phí và TV màn hình phẳng, cũng như hồ bơi ngoài trời và khu vườn.  Nơi đây còn có phòng tắm riêng với vòi sen ở một số căn, cùng đồ vệ sinh cá nhân miễn phí, máy sấy tóc và dép đi trong phòng.  Nhà nghỉ B&B có dịch vụ cho thuê ô tô.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách Thien An Hotel 70 km.', 0, 75225190, '(+84)6317229936', 'fz4p8bydg2@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (367, 'Ngoc Thu Palace', 'Ngoc Thu Palace có hồ bơi ngoài trời theo mùa, khu vườn, sân hiên và quầy bar ở Sóc Trăng. Khách sạn 4 sao này có dịch vụ phòng và quầy lễ tân 24 giờ.  Tại khách sạn, mỗi phòng đều có tủ quần áo. Ngoài phòng tắm riêng với vòi sen và đồ vệ sinh cá nhân miễn phí, các phòng tại Ngoc Thu Palace cũng có Wi-Fi miễn phí, trong đó một số phòng có view thành phố. Tại chỗ nghỉ, phòng nào cũng có điều hòa và TV màn hình phẳng.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn à la carte, kiểu Anh/ Ai-len hoặc kiểu Á cho bữa sáng. Tại Ngoc Thu Palace, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Mỹ, Quảng Đông và Hoa. Bên cạnh đó, họ có thể yêu cầu món chay và món thuần chay.  Sân bay Quốc tế Cần Thơ cách 71 km.', 0, 46086586, '(+84)9879073784', 'p5br1gcyw6@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (368, 'Hoàng Gia Hotel Sơn La', 'Hoàng Gia Hotel Sơn La cung cấp chỗ nghỉ ở Sơn La. Khách sạn 3 sao này có các phòng được trang bị điều hòa, phòng tắm riêng và Wi-Fi miễn phí. Khách sạn có phòng gia đình.  Tại khách sạn, phòng nào cũng có tủ quần áo và TV màn hình phẳng. Tại Hoàng Gia Hotel Sơn La, các phòng đều đi kèm với ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn túc trực để hỗ trợ khách.  Sân bay Điện Biên Phủ cách 156 km.', 70, 48854062, '(+84)5140884242', 'swufn9x1r2@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (369, 'Galaxy Grand Hotel', 'Galaxy Grand Hotel tọa lạc ở Sơn La và có quầy bar. Ngoài nhà hàng, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng.  Khách sạn cung cấp một số căn được trang bị sân hiên và phòng nào cũng có ấm đun nước. Các phòng ở Galaxy Grand Hotel được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Sân bay Điện Biên Phủ cách 156 km.', 25, 479173307, '(+84)7895555427', '99bjoaxlac@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (370, 'Muong Thanh Luxury Son La', 'Muong Thanh Luxury Son La nằm ở Sơn La và có quầy bar. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Chỗ nghỉ này có hồ bơi ngoài trời mở quanh năm, trung tâm thể dục, phòng xông hơi khô và phòng chờ chung.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Một số phòng có bếp với tủ lạnh và bếp. Tại Muong Thanh Luxury Son La, các phòng đều đi kèm với ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng mỗi buổi sáng, gồm các lựa chọn thực đơn buffet, kiểu Mỹ và kiểu Á.  Chỗ nghỉ có bể sục. Khách có thể chơi bi-a, cũng như dịch vụ thuê ô tô tại khách sạn 5 sao này.  Sân bay Điện Biên Phủ cách 155 km.', 51, 207965183, '(+84)4203340235', 'n2r54mdcjs@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (371, 'GIANG HÂN HOTEL', 'GIANG HÂN HOTEL cung cấp chỗ nghỉ tại Tây Ninh. Khách sạn 1 sao này có quầy lễ tân 24 giờ và phòng giữ hành lý. Khách sạn cung cấp cả Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tại khách sạn, các phòng được thiết kế có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các phòng tại GIANG HÂN HOTEL có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, các phòng đều có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách GIANG HÂN HOTEL 89 km.', 10, 68431352, '(+84)1901899469', '2m1hpdp0pe@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (372, 'Hotel MAI TUAN Nguyễn Văn Linh', 'Hotel MAI TUAN Nguyễn Văn Linh cung cấp chỗ nghỉ điều hòa ở Phú Khương. Khách sạn 1 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí.  Tại khách sạn, tất cả các phòng có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách Hotel MAI TUAN Nguyễn Văn Linh 83 km.', 0, 594366290, '(+84)8298107169', 'tbl68kbhm2@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (373, 'NEW CITY HOTEL', 'NEW CITY HOTEL có phòng chờ chung, sân hiên và quầy bar ở Tây Ninh. Ngoài xe đạp miễn phí, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung và dịch vụ phòng cho khách.  Tất cả các phòng đi kèm tủ lạnh, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng đều đi kèm với tủ quần áo và TV màn hình phẳng, ngoài ra một số phòng tại khách sạn có ban công. Tại NEW CITY HOTEL, các phòng đều có ga trải giường và khăn tắm.  Đội ngũ nhân viên của chỗ nghỉ luôn túc trực tại lễ tân 24/24 để cung cấp đề xuất cho du khách.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách NEW CITY HOTEL 89 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 15, 186843673, '(+84)8557998038', 'ljc16axho7@gmail.com', 2);
