INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (390, 'Lai Dinh Hotel', 'Tọa lạc ở Sầm Sơn, cách Bãi biển Sầm Sơn 1 phút đi bộ, Lai Dinh Hotel cung cấp chỗ nghỉ có khu vườn, chỗ đậu xe riêng miễn phí, nhà hàng và quầy bar. Khách sạn 3 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Tất cả các phòng đều được thiết kế có ban công.  Tại khách sạn, mỗi phòng đều có điều hòa, bàn làm việc, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Sân bay gần nhất là Sân bay Thọ Xuân, cách Lai Dinh Hotel 53 km.', 0, 440355323, '(+84)0394571407', 'd7ch67sggu@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (391, 'Pu Luong Natura', 'Pu Luong Natura có hồ bơi ngoài trời, khu vườn, sân hiên và nhà hàng ở Pu Luong. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại resort, các phòng đều có ban công. Tại Pu Luong Natura, các phòng được thiết kế có ga trải giường và khăn tắm.  Leo núi là hoạt động được ưa chuộng trong khu vực. Ngoài ra, resort 4 sao này có dịch vụ thuê xe đạp.  Sân bay Thọ Xuân cách 87 km.', 10, 601045679, '(+84)1348882869', '38r0rpr7gd@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (392, 'Pu Luong Jungle Lodge', 'Pu Luong Jungle Lodge có xe đạp miễn phí, hồ bơi ngoài trời, khu vườn và sân hiên ở Pu Luong. Mỗi phòng tại resort 4 sao này đều nhìn ra khu vườn, đồng thời khách có thể sử dụng nhà hàng và quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, câu lạc bộ trẻ em và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại resort, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn à la carte, kiểu Mỹ hoặc kiểu Á mỗi sáng.  Pu Luong Jungle Lodge có sân chơi trẻ em. Khách tại chỗ nghỉ sẽ có thể tận hưởng các hoạt động ở trong Pu Luong và khu vực xung quanh, như đi xe đạp.  Sân bay Thọ Xuân cách 89 km.', 62, 467701348, '(+84)3183037519', 'kfl898ov9b@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (393, 'Melia Vinpearl Thanh Hoa', 'Melia Vinpearl Thanh Hoa ở Thanh Hóa cung cấp chỗ nghỉ 5 sao có quầy bar. Ngoài nhà hàng, chỗ nghỉ còn có trung tâm thể dục, hồ bơi trong nhà và phòng xông hơi khô. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cho khách.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, tủ lạnh, minibar, két an toàn, TV màn hình phẳng và phòng tắm riêng với vòi sen. Tất cả các phòng có tủ quần áo.  Melia Vinpearl Thanh Hoa có phục vụ bữa sáng thực đơn buffet mỗi buổi sáng.  Sân bay Thọ Xuân cách 36 km.', 0, 367677390, '(+84)7057226057', 'x05lmyia3e@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (394, 'flamingo linh trường - hải tiến khu nghỉ dưỡng 5 sao cạnh chùa bụt', 'Flamingo linh trường - hải tiến khu nghỉ dưỡng 5 sao cạnh chùa bụt có khu vườn, sân hiên, nhà hàng và quầy bar ở Thanh Hóa. Khách sạn 5 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, két an toàn, TV màn hình phẳng, ban công và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại flamingo linh trường - hải tiến khu nghỉ dưỡng 5 sao cạnh chùa bụt, các phòng đều đi kèm với ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Thọ Xuân, cách chỗ nghỉ 37 km.', 0, 730312575, '(+84)5763069392', 'k3mdsqbg6p@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (395, 'Thien Phu Hotel', 'Nằm ở Huế, cách Cầu Tràng Tiền 2.2 km và Chợ Đông Ba 3.5 km, Thien Phu Hotel cung cấp chỗ nghỉ có khu vườn và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 1 sao này có quầy lễ tân 24 giờ và phòng giữ hành lý. Khách sạn có phòng gia đình.  Tại khách sạn, các phòng đều có điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân hiên với view thành phố. Tất cả các phòng đều có tủ lạnh.  Thien Phu Hotel có sân chơi trẻ em.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Nhà thờ Phủ Cam, Chua Tu Dam và Chùa Báo Quốc. Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách Thien Phu Hotel 13 km.', 0, 275712660, '(+84)0671915879', 'vec92mzow8@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (396, 'Anhxuan motelluxury 48 ngô quyền', 'Anhxuan motelluxury 48 ngô quyền nằm ở Huế, cách Tử Cấm Thành 3.3 km và Hồ Tịnh Tâm 3.5 km. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Các căn ở khách sạn được trang bị ấm đun nước. Tất cả các phòng đều có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Anhxuan motelluxury 48 ngô quyền có ban công. Tại chỗ nghỉ, các phòng được thiết kế có ga trải giường và khăn tắm.  Các điểm tham quan nổi tiếng gần Anhxuan motelluxury 48 ngô quyền bao gồm Cầu Tràng Tiền, Chợ Đông Ba và Bảo tàng Museum of Royal Antiquities. Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách khách sạn 13 km.', 0, 264369989, '(+84)0283828353', '5odnzixge2@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (397, 'BK48', 'BK48 nằm ở Huế, cách Tử Cấm Thành 3.1 km và Hồ Tịnh Tâm 3.6 km. Ngoài sân hiên, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, các phòng được thiết kế có tủ quần áo. Các phòng đều có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại BK48 có ban công. Tại chỗ nghỉ, các phòng đều đi kèm với ga trải giường và khăn tắm.  BK48 có phục vụ bữa sáng kiểu lục địa mỗi buổi sáng.  Các điểm tham quan nổi tiếng gần khách sạn bao gồm Cầu Tràng Tiền, Chợ Đông Ba và Bảo tàng Museum of Royal Antiquities. Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách BK48 13 km.', 0, 697829254, '(+84)8351957132', 'odsor04yw1@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (398, 'Charming Riverside Hotel', 'Charming Riverside Hotel tọa lạc tại thành phố Huế, cách Chợ Đông Ba 700 m. Du khách có thể dùng bữa tại nhà hàng trong khuôn viên. Những khách đi xe máy có thể sử dụng chỗ đỗ xe miễn phí trong khuôn viên.  Mỗi phòng tại chỗ nghỉ nhà dân này được trang bị máy điều hòa và TV truyền hình cáp. Một số phòng có khu vực ghế ngồi thuận tiện hoặc tầm nhìn ra quang cảnh dòng sông/thành phố. Tất cả các phòng còn có phòng tắm riêng đi kèm dép và đồ vệ sinh cá nhân miễn phí. Charming Riverside Hotel cung cấp Wi-Fi miễn phí trong toàn khuôn viên.  Khách sạn cung cấp dịch vụ cho thuê xe máy và xe hơi. Đi xe đạp là hoạt động phổ biến trong khu vực này. Charming Riverside Hotel cách Cầu Tràng Tiền 1 km. Sân bay gần nhất là sân bay Phú Bài, cách đó 14 km.', 0, 289721913, '(+84)6523799611', 'terbiti98j@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (399, 'Orchid Hotel', 'Located near Huong River, Orchid Hotel offers rooms with personal computers and free internet. Hue Station is within walking distance of the hotel, which features a restaurant and free parking.  All rooms are air-conditioned and equipped with a hairdryer and fridge. Guests can also enjoy a daily fruit basket or cake and free bottled water.  Luggage storage, laundry, dry cleaning and rental of cars and bikes are available. The hotel’s lobby has free Wi-Fi.  Orchid Hotel is within walking distance of the Perfume River.', 40, 40816892, '(+84)2276275267', 'porbn21ac3@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (400, 'Victory Hotel', 'Khách sạn Victory Hotel Huế tọa lạc trung tâm, cách sông Hương và Nội thành Huế một khoảng cách ngắn. Khách sạn cung cấp các phòng máy lạnh, Wi-Fi miễn phí và bãi đỗ xe riêng miễn phí. Khách sạn có một nhà hàng ngay tại chỗ.  Các phòng tại Victory Hue đặc trưng với một ban công và các cửa sổ lớn cho phép đón nhiều ánh sáng. Các phòng có một tivi vệ tinh, máy pha trà/ cà phê và một minibar. Các phòng đi kèm với một phòng tắm riêng với bồn tắm và vòi hoa sen. Các phòng chọn lọc đặc trưng với tầm nhìn tuyệt vời ra khung cảnh thành phố và vườn.  Khách có thể thư giãn và tận hưởng một bữa ăn tại nhà hàng của khách sạn. Khách sạn cung cấp dịch vụ phòng.  Dịch vụ cho khách tại Khách sạn Victory Hotel Huế bao gồm giặt là và giữ trẻ. Quầy lễ tân 24 giờ và dịch vụ thu đổi ngoại tệ cũng được cung cấp tại khách sạn. Bàn tour có thể tổ chức chuyến du ngoạn đến nhiều điểm tham quan du lịch ở Huế.  Victory Hotel cách ga xe lửa 2 km và cách trạm xe buýt 1 km. Dịch vụ đón khách từ trạm xe buýt hay ga xe lửa cũng có tại khách sạn.', 46, 170105837, '(+84)0974541049', '92sndt5j6x@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (401, 'Tom homestay, căn hộ Nera garden Huế', 'Tom homestay, căn hộ Nera garden Huế là chỗ nghỉ nằm ở Huế, có ban công, hồ bơi riêng và nhìn ra núi. Chỗ nghỉ điều hòa này cách Cầu Tràng Tiền 4.2 km, khách có thể sử dụng WiFi miễn phí và chỗ đậu xe riêng có sẵn trong khuôn viên.  Với sân hiên nhìn ra thành phố, căn hộ có 2 phòng ngủ, phòng khách, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi, 2 phòng tắm với vòi xịt/chậu rửa vệ sinh và vòi sen. Khăn tắm và ga trải giường có sẵn ở căn hộ.  Căn hộ cách Chợ Đông Ba 4.8 km và Bảo tàng Museum of Royal Antiquities 5.6 km.', 40, 57385147, '(+84)1975089877', 'ysvcf8l4at@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (402, 'ÊMM Hotel Hue', 'Tọa lạc tại khu trung tâm thành phố Huế, cách Sông Hương và Cầu Tràng Tiền 5 phút lái xe, khách sạn này cung cấp các phòng nghỉ lắp máy điều hòa, khu vườn, nhà hàng trong khuôn viên. Wi-Fi lẫn chỗ đỗ xe riêng đều được cung cấp miễn phí ngay trong khuôn viên.  Các phòng nghỉ tại ÊMM Hotel Hue có sàn lát gạch/đá cẩm thạch, ban công riêng, truyền hình vệ tinh màn hình phẳng, tủ lạnh mini và ấm đun nước điện. Phòng tắm riêng trong mỗi phòng được trang bị vòi sen, máy sấy tóc, đồ vệ sinh cá nhân miễn phí, dép và áo choàng tắm để tạo sự thoải mái cho du khách.  Đội ngũ nhân viên tại quầy lễ tân làm việc 24/24 có thể hỗ trợ du khách với các dịch vụ phòng giữ hành lý, cho thuê xe hơi và dịch vụ đưa đón sân bay có thể được thu xếp kèm phụ phí.  Nhà hàng Spiceviet phục vụ các món ăn Huế chính thống được chế biến bằng những nguyên liệu địa phương. Yen Restaurant là nhà hàng phục vụ ăn uống suốt cả ngày với một loạt các món ăn Việt Nam và quốc tế.  Chợ Đông Ba và Tử Cấm Thành đều cách ÊMM Hotel Hue 2 km trong khi ga tàu Huế cách đó 1,45 km. Sân bay gần nhất là sân bay quốc tế Phú Bài, cách nơi nghỉ 15 km.', 40, 623023029, '(+84)1691894856', '9bd8nu7mfc@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (403, 'Cheriladyhomestayhue', 'Cheriladyhomestayhue nằm ở Huế, cách Bảo tàng Museum of Royal Antiquities 2.5 km và Tử Cấm Thành 3.6 km. Khách sạn 5 sao này có dịch vụ phòng và quầy lễ tân 24 giờ. Các phòng đều có ban công.  Tại khách sạn, mỗi phòng đều có sân hiên. Tại Cheriladyhomestayhue, tất cả các phòng đều có điều hòa và TV màn hình phẳng.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Cầu Tràng Tiền, Chợ Đông Ba và Cung An Định. Sân bay gần nhất là Sân bay quốc tế Phú Bài, cách Cheriladyhomestayhue 13 km.', 0, 400325931, '(+84)6994213877', 'k74qt7xjkk@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (404, 'May homestay', 'Nằm cách Cầu Tràng Tiền 15 phút đi bộ, May homestay cung cấp chỗ nghỉ 5 sao ở Huế, đồng thời có khu vườn, nhà hàng và quầy bar. Chỗ nghỉ này có các tiện nghi như dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí ở toàn bộ chỗ nghỉ. Đây là chỗ nghỉ không hút thuốc và tọa lạc cách Chợ Đông Ba 1.9 km.  Tại khách sạn, các phòng đều đi kèm với điều hòa, bàn làm việc, sân hiên với view thành phố, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Tất cả các phòng đều có tủ quần áo và ấm đun nước để khách sử dụng.  Khách tại May homestay có thể thưởng thức bữa sáng thực đơn à la carte.  Các điểm tham quan nổi tiếng gần chỗ nghỉ bao gồm Bảo tàng Museum of Royal Antiquities, Redemptorist Church và Bảo tàng Hồ Chí Minh. Sân bay quốc tế Phú Bài cách 13 km.', 0, 842960079, '(+84)8323156941', 'aa6voter8a@yahoo.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (405, 'Minh Tai Hotel', 'Minh Tai Hotel tọa lạc tại thành phố Mỹ Tho. Khách sạn cung cấp Wi-Fi miễn phí. Mỗi phòng nghỉ tại đây đều có TV, máy lạnh và ban công. Khu vực ăn uống hoàn chỉnh với tủ lạnh, đồng thời có cả ấm đun nước điện. Phòng tắm riêng đi kèm vòi sen và bồn tắm/vòi sen và máy sấy tóc. Du khách có thể ngắm nhìn quang cảnh thành phố từ phòng nghỉ của mình. Ngoài ra, trong phòng còn có minibar, ổ cắm cho iPod và các kênh truyền hình cáp.  Tại Minh Tai Hotel, du khách sẽ tìm thấy quầy lễ tân 24 giờ. Dịch vụ đặt vé, chỗ để hành lý và dịch vụ giặt hấp cũng nằm trong số các tiện nghi của chỗ nghỉ này. Khách sạn có chỗ đỗ xe miễn phí.  Sân bay Quốc tế Tân Sơn Nhất cách đó 62 km.', 0, 181202702, '(+84)6503599409', 'd5hgkskcnq@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (406, 'Khách Sạn Ngọc Huệ', 'Khách Sạn Ngọc Huệ cung cấp chỗ nghỉ tại Ấp Bắc. Ngoài sân hiên, khách sạn 1 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, phòng nào cũng có tủ quần áo. Mỗi phòng đều được thiết kế có bàn làm việc và TV màn hình phẳng, ngoài ra một số phòng tại Khách Sạn Ngọc Huệ có ban công. Tại chỗ nghỉ, các phòng đều đi kèm với ga trải giường và khăn tắm.  Khách tại Khách Sạn Ngọc Huệ có thể thưởng thức bữa sáng thực đơn buffet.  Sân bay Quốc tế Tân Sơn Nhất cách 54 km.', 0, 459273926, '(+84)8300721901', 'mmxbetrmd4@outlook.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (407, 'Phụng Kim Thảo Hotel Long An', 'Tọa lạc ở Long An, cách Trung tâm Triển lãm và Hội nghị Sài Gòn 27 km, Phụng Kim Thảo Hotel Long An cung cấp chỗ nghỉ có Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí. Khách sạn 2 sao này có các phòng được trang bị điều hòa. Chùa Giác Lâm cách khách sạn 28 km và Công viên văn hóa Đầm Sen 28 km.  Tại khách sạn, tất cả các phòng đều được thiết kế có bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên luôn túc trực 24/7 tại lễ tân.  Phụng Kim Thảo Hotel Long An cách Bảo tàng Mỹ thuật 30 km và Chợ Bến Thành 30 km.', 70, 452052358, '(+84)6104722205', '6rgvnpr1a4@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (408, 'Minh Kieu Hotel', 'Minh Kieu Hotel cung cấp chỗ nghỉ tại Mỹ Tho. Ngoài phòng chờ chung, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ có chỗ đậu xe riêng miễn phí và có cả dịch vụ đưa đón sân bay mất phí.  Tất cả các căn tại khách sạn đi kèm khu vực ghế ngồi và TV màn hình phẳng có truyền hình cáp. Tại Minh Kieu Hotel, tất cả các phòng có ga trải giường và khăn tắm.  Thành thạo tiếng Anh và tiếng Việt, đội ngũ nhân viên tại lễ tân 24/24 luôn sẵn lòng hỗ trợ khách vào bất kỳ thời điểm nào trong ngày.  Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách chỗ nghỉ 72 km.', 0, 467946539, '(+84)5059063628', 'fnlm46k80t@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (409, 'Cuu Long Hotel', 'Cuu Long Hotel có phòng chờ chung, sân hiên, nhà hàng và quầy bar ở Mỹ Tho. Khách sạn 3 sao này có bàn bán tour và phòng giữ hành lý. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách tại khách sạn sẽ có thể tận hưởng các hoạt động ở trong Mỹ Tho và khu vực xung quanh, như đi xe đạp.  Sân bay Quốc tế Tân Sơn Nhất cách 72 km.', 0, 869095660, '(+84)7496121782', '6c445y2coz@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (410, 'Nam Thi Holiday Home', 'Với Vinh Long Museum nằm cách đó 33 km, Nam Thi Holiday Home cung cấp chỗ nghỉ, nhà hàng, xe đạp miễn phí, khu vườn và sân hiên. WiFi và chỗ đậu xe riêng đều có sẵn tại nhà nghỉ dưỡng miễn phí.  Tại đây có phòng tắm riêng đầy đủ tiện nghi với vòi sen và máy sấy tóc.  Du khách có thể đi xe đạp gần đó.  Chỗ nghỉ cách Sân bay Quốc tế Cần Thơ 77 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 347637029, '(+84)2876833094', 'y1qo754qqz@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (411, 'Mekong Lodge Resort', 'Với dịch vụ cho thuê xe đạp miễn phí, Mekong Lodge là chỗ nghỉ tự nhiên hấp dẫn được bao quanh bởi khu vườn và Sông Tiền. Chỗ nghỉ cung cấp dịch vụ đưa đón 2 chiều miễn phí từ bến tàu du lịch Cái Bè. Wi-Fi miễn phí có tại trung tâm dịch vụ doanh nhân.  Tất cả phòng và bungalow tại đây đều được bố trí máy điều hòa cùng sân hiên nhìn ra vườn và sông. Chỗ nghỉ cung cấp màn chống muỗi. Phòng tắm riêng đi kèm bồn tắm và đồ vệ sinh cá nhân miễn phí.  Mekong Lodge nằm cách Nhà thờ Cái Bè 2,5 km. Sân bay Cần Thơ nằm trong bán kính 1,5 giờ lái xe từ chỗ nghỉ này. Thành phố Hồ Chí Minh cách đó 2,5 giờ lái xe.  Bàn đặt tour có thể sắp xếp các chuyến đi trong ngày, dịch vụ cho thuê xe hơi và dịch vụ đưa đón sân bay với một khoản phụ phí. Lễ tân tại đây làm việc 24 giờ/ngày.  Hai nhà hàng trong khuôn viên resort phục vụ thực đơn lập sẵn gồm các món địa phương. Chỗ nghỉ cũng có quầy bar và dịch vụ phòng 24 giờ.', 65, 386281341, '(+84)0999998771', '4zfgxmrlbk@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (412, 'Mekong Riverside Boutique Resort & Spa', 'Nằm giữa khu vườn trái cây nhiệt đới tươi tốt, Mekong Riverside Boutique Resort & Spa cung cấp Wi-Fi miễn phí và hồ bơi ngoài trời. Nơi nghỉ này cách Chợ Nổi Cái Bè 1,5 km.  Du khách có thể dùng bữa tại Nhà hàng Medley phục vụ ẩm thực Việt Nam và quốc tế ngay trong khuôn viên chỗ ở này hoặc chỉ đơn giản là thư giãn tại các quầy bar bên hồ bơi và bên lễ tân.  Quầy lễ tân 24 giờ có thể hỗ trợ khách với dịch vụ cho thuê xe đạp, dịch vụ giặt thường và giặt hấp. Du khách có thể tham gia các hoạt động như câu cá, chèo thuyền kayak, bơi xuồng và đi bộ đường dài. Khu nghỉ mát còn có tiện nghi BBQ cũng như trung tâm spa và chăm sóc sức khỏe.  Với tầm nhìn tuyệt đẹp, các phòng nghỉ máy lạnh tại đây được trang bị truyền hình cáp màn hình phẳng, ghế sofa, minibar và ban công rộng rãi. Các phòng tắm riêng đi kèm với tiện nghi vòi sen và đồ vệ sinh cá nhân miễn phí.  Mekong Riverside Boutique Resort & Spa nằm trong bán kính 60 km từ Thành phố Cần Thơ và 120 km từ Thành phố Hồ Chí Minh.', 25, 797231053, '(+84)9228508731', 'emp8r6kd91@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (413, 'Hotel Nhu Y 2', 'Nằm tại vị trí thuận tiện ở Quận Bình Tân, TP. Hồ Chí Minh, Hotel Nhu Y 2 nằm cách Công viên văn hóa Đầm Sen 4.9 km, Chùa Giác Lâm 6.5 km và Bảo tàng chứng tích chiến tranh 11 km. Ngoài phòng chờ chung, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Khách sạn cung cấp sân hiên và lễ tân 24/24.  Các căn đi kèm TV màn hình phẳng có truyền hình cáp, minibar, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tại khách sạn, các phòng được thiết kế có ga trải giường và khăn tắm.  Hotel Nhu Y 2 cách Bảo tàng Mỹ thuật 11 km và Chợ Bến Thành 11 km.', 50, 325235495, '(+84)1414066489', 'c1p3dh4izy@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (414, 'Long Hostel', 'Long Hostel cung cấp những phòng cơ bản với Wi-Fi miễn phí. Nằm trên đường Phạm Ngũ Lão, Quận 1, nhà trọ cung cấp bữa sáng hàng ngày từ 07:00 - 09:30. Du khách được sử dụng miễn phí trung tâm dịch vụ doanh nhân tại đây.  Chợ Bến Thành nằm trong bán kính khoảng 1 km từ Long Hostel. Những địa điểm tham quan ở địa phương bao gồm Nhà thờ Đức Bà và Dinh Thống Nhất đều cách nhà trọ 10 phút lái xe. Sân bay Quốc tế Tân Sơn Nhất cách nơi nghỉ 25 phút lái xe.  Tất cả các phòng tại đây đều được trang bị máy lạnh và truyền hình cáp. Một số phòng chọn lọc có phòng tắm riêng với vòi sen cùng nhà vệ sinh. Những phòng ngủ tập thể cung cấp cho khách khăn tắm miễn phí và sử dụng phòng tắm chung cũng như nhà vệ sinh chung.  Các dịch vụ giặt là và đưa đón sân bay được cung cấp với một khoản phụ phí. Long Hostel có chỗ để hành lý miễn phí.', 0, 550679511, '(+84)1478739390', '72yooysuuz@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (415, 'The Royal Homies - Phu My Hung', 'Nằm tại vị trí thuận tiện ở Quận 7, TP. Hồ Chí Minh, The Royal Homies - Phu My Hung tọa lạc cách Trung tâm Triển lãm và Hội nghị Sài Gòn 19 phút đi bộ, Bến cảng Nhà Rồng 6.7 km và Bảo tàng Mỹ thuật 7 km. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và máy ATM. Khách sạn nằm cách Trung tâm mua sắm Takashimaya Việt Nam 7.3 km và Chợ Bến Thành 7.4 km.  Tại khách sạn, phòng nào cũng có tủ quần áo. Với phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí, tất cả các căn tại The Royal Homies - Phu My Hung có TV màn hình phẳng và điều hòa, trong đó một số phòng có ban công. Tại chỗ nghỉ, tất cả các phòng đều có ga trải giường và khăn tắm.  The Royal Homies - Phu My Hung có phục vụ bữa sáng kiểu Á mỗi sáng.  Khách sạn cách Công viên Tao Đàn 7.5 km và Bảo tàng Thành phố Hồ Chí Minh 7.7 km. Chỗ nghỉ cách Sân bay Quốc tế Tân Sơn Nhất 13 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 70, 261544170, '(+84)6257742439', '6bnqsisjba@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (416, 'THE QUEENDOR BOUTIQUE HOTEL', 'Tọa lạc ở TP. Hồ Chí Minh, cách Chùa Giác Lâm 3.1 km, THE QUEENDOR BOUTIQUE HOTEL cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Khách sạn có bể sục và máy ATM.  Phòng khách được trang bị điều hòa, TV màn hình phẳng có truyền hình cáp, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tại khách sạn, phòng nào cũng có ga trải giường và khăn tắm.  THE QUEENDOR BOUTIQUE HOTEL cách Công viên văn hóa Đầm Sen 4.6 km và Chợ Tân Định 4.7 km.', 0, 865163538, '(+84)9374459261', 'dve40g313l@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (417, 'Cozrum Homes - Saphera Residence', 'Cách Bảo tàng Mỹ thuật 1.9 km và Trung tâm mua sắm Takashimaya Việt Nam 2.1 km ở TP. Hồ Chí Minh, Cozrum Homes - Saphera Residence cung cấp chỗ nghỉ có Wi-Fi miễn phí và khu vực ghế ngồi.  Chỗ nghỉ có điều hòa, bếp đầy đủ tiện nghi, TV màn hình phẳng, cũng như phòng tắm riêng với vòi sen, máy sấy tóc và dép đi trong phòng. Tủ lạnh và lò vi sóng, cũng như ấm đun nước đều được cung cấp.  Căn hộ có dịch vụ cho thuê xe đạp.  Cozrum Homes - Saphera Residence cách Chợ Bến Thành 2.1 km và Công viên Tao Đàn 2.2 km. Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách chỗ nghỉ 8 km.', 0, 304871551, '(+84)3177873954', '6dx5ogfe2s@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (418, 'HANZ T68 Hotel', 'HANZ T68 Hotel là chỗ nghỉ 3 sao tọa lạc ở TP. Hồ Chí Minh, cách Chùa Giác Lâm 10 km và Bảo tàng lịch sử Việt Nam 10 km. Chỗ nghỉ cách Công viên văn hóa Đầm Sen khoảng 10 km, Trung Tâm Thương Mại Diamond Plaza 11 km và Bảo tàng chứng tích chiến tranh 11 km. Đây là chỗ nghỉ không gây dị ứng và nằm cách Chợ Tân Định 9.2 km.  Với phòng tắm riêng, các phòng tại khách sạn cũng có Wi-Fi miễn phí, trong đó một số phòng có view thành phố.  HANZ T68 Hotel cách Bưu điện Trung tâm 11 km và Nhà thờ Đức Bà 11 km.', 59, 249750363, '(+84)0436655571', 'zrptohn2hf@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (419, 'Son&Henry The MarQ Luxury', 'Nhìn ra thành phố, Son&Henry The MarQ Luxury ở TP. Hồ Chí Minh cung cấp chỗ nghỉ có hồ bơi ngoài trời, trung tâm thể dục, khu vườn, phòng chờ chung và sân hiên. Chỗ nghỉ có bể sục và phòng xông hơi khô.  Chỗ nghỉ có điều hòa, bếp đầy đủ tiện nghi với khu vực ăn uống, TV màn hình phẳng, cũng như phòng tắm riêng với vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tủ lạnh và lò vi sóng, cũng như ấm đun nước đều được cung cấp.  Các điểm tham quan nổi tiếng gần căn hộ bao gồm Trung Tâm Thương Mại Diamond Plaza, Bưu điện Trung tâm và Bảo tàng lịch sử Việt Nam. Chỗ nghỉ cách Sân bay Quốc tế Tân Sơn Nhất 6 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 40, 826251819, '(+84)0146069423', 'h8eorgfj9h@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (420, 'Double E SaiGon Apartment', 'Nằm ở TP. Hồ Chí Minh, gần Bến cảng Nhà Rồng, Bảo tàng Mỹ thuật và Trung tâm mua sắm Takashimaya Việt Nam, Double E SaiGon Apartment có hồ bơi ngoài trời. Wi-Fi miễn phí có sẵn ở toàn bộ chỗ nghỉ và chỗ đậu xe riêng có sẵn trong khuôn viên.  Căn hộ có ban công nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và lò vi sóng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí.  Double E SaiGon Apartment có cả dịch vụ cho thuê xe đạp và dịch vụ cho thuê ô tô.  Chỗ nghỉ cách Chợ Bến Thành 2.3 km và Công viên Tao Đàn 2.4 km. Sân bay gần nhất là Sân bay Quốc tế Tân Sơn Nhất, cách Double E SaiGon Apartment 8 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 25, 78648245, '(+84)8857634807', 'ni0lfrahz0@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (421, 'Hotel Nikko Saigon', 'Nằm cạnh Trung tâm thương mại Now Zone, khách sạn 5 sao này cung cấp phòng nghỉ hiện đại đi kèm truyền hình cáp màn hình phẳng và phòng tắm. Chỗ nghỉ có spa đầy đủ dịch vụ, hồ bơi ngoài trời và tiện nghi thể dục.  Với tầm nhìn ra quang cảnh thành phố từ cửa sổ lớn, phòng nghỉ rộng rãi của khách sạn có ánh sáng ấm áp và tông màu đất nhẹ nhàng. Ngoài ra, phòng còn được trang bị máy pha trà/cà phê, minibar và Wi-Fi miễn phí.  Hotel Nikko Saigon cũng có trung tâm dịch vụ doanh nhân và dịch vụ trợ giúp đặc biệt. Du khách có thể tận hưởng bể sục và nhiều lựa chọn dịch vụ spa tại khách sạn.  Hotel Nikko Saigon cách Nhà hát thành phố, Nhà thờ Đức Bà và Dinh Thống Nhất 10 phút lái xe. Sân bay quốc tế Tân Sơn Nhất cách khách sạn 25 phút lái xe. Chỗ nghỉ cung cấp chỗ đỗ xe miễn phí.', 0, 28449938, '(+84)3741354961', 'vnvmkk401r@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (422, 'Lotte Hotel Saigon', 'Featuring 5-star facilities including a large outdoor pool and fitness centre, Lotte Hotel Saigon offers elegant rooms overlooking the scenic Saigon River. It provides 5 dining options, free WiFi and free parking.  Well-furnished rooms at Lotte Hotel Saigon features river or city views from over-sized windows and a cable flat-screen TV. Decorated in calming neutral shades, they come with a comfortable sitting area and washlet toilets.  Lotte Hotel Saigon is within walking distance of shopping options at Saigon Centre and Diamond Plaza. It is 7 km or a 30-minute drive from Tan Son Nhat International Airport.  Guests may spend leisurely afternoons on lounge chairs by the outdoor pool. Alternatively, relax with a soothing massage at the spa or with the hot tub and sauna facilities available.  A hearty Asian and European buffet is served at The Canvas while OTTIMO HOUSE TRATTORIA which is the ideal destination for gourmets who fancy Italian cuisine. Other dining options include Crystal Jade Restaurant and Yoshino Japanese Restaurant.  "Free swimming lessons for kids every Sunday morning (applied for in-house guests)"', 40, 709005589, '(+84)4239786873', '5e6as4lhr9@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (423, 'Vila Basi', 'Nằm ở Nguyệt Hạng, Vila Basi cung cấp Wi-Fi miễn phí, nơi khách có thể trải nghiệm xe đạp miễn phí, khu vườn và phòng chờ chung.  Khuôn viên của biệt thự đồng quê có sân hiên và du khách có thể đi xe đạp ở khu vực gần đó.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách Vila Basi 78 km, đồng thời chỗ nghỉ này cũng cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 453402931, '(+84)6462080123', 'qt210hmr6d@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (424, 'Malis Homestay', 'Với hồ bơi ngoài trời, khu vườn, cùng quầy bar, Malis Homestay cung cấp chỗ nghỉ ở Trà Vinh có Wi-Fi miễn phí và nhìn ra hồ bơi. Chỗ nghỉ này có sân hiên và chỗ đậu xe riêng miễn phí.  Khăn tắm và ga trải giường có sẵn ở nhà nghỉ B&B.  Sân bay gần nhất là Sân bay Quốc tế Cần Thơ, cách nhà nghỉ B&B 90 km.', 0, 136018010, '(+84)0755808260', 'chnxv04hux@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (425, 'FarmStay Ô A Pháo - km37 Hàm Yên', 'FarmStay Ô A Pháo - km37 Hàm Yên có xe đạp miễn phí, khu vườn, phòng chờ chung và sân hiên ở Tuyên Quang. Ngoài dịch vụ phòng, chỗ nghỉ này còn có nhà hàng để phục vụ du khách. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, bếp chung và Wi-Fi miễn phí.  Tại khách sạn, phòng nào cũng có điều hòa, bàn làm việc, sân trong với view vườn, phòng tắm riêng, TV màn hình phẳng, ga trải giường và khăn tắm. Phòng khách đều có tủ quần áo và ấm đun nước để khách sử dụng.  Khách tại FarmStay Ô A Pháo - km37 Hàm Yên sẽ có thể tận hưởng các hoạt động ở trong Tuyên Quang và khu vực xung quanh, như đi xe đạp.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách chỗ nghỉ 141 km.', 0, 483358681, '(+84)5987832903', '68t5dpf8c0@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (426, 'Muong Thanh Grand Tuyen Quang Hotel', 'Muong Thanh Grand Tuyen Quang Hotel có hồ bơi ngoài trời theo mùa, trung tâm thể dục, nhà hàng và quầy bar ở Tuyên Quang. Khách sạn 4 sao này cung cấp dịch vụ phòng, phòng giữ hành lý và Wi-Fi miễn phí. Du khách có thể thưởng thức đồ uống tại bar thức ăn nhẹ.  Các phòng tại khách sạn được trang bị điều hòa, khu vực ghế ngồi, TV màn hình phẳng có truyền hình vệ tinh, két an toàn, phòng tắm riêng, vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Tại Muong Thanh Grand Tuyen Quang Hotel, mỗi phòng đều có ga trải giường và khăn tắm.  Hằng ngày, chỗ nghỉ có các lựa chọn thực đơn buffet, kiểu lục địa hoặc kiểu Mỹ cho bữa sáng.  Khách có thể chơi bóng bàn tại chỗ nghỉ. Ngoài ra, chỗ nghỉ có dịch vụ thuê ô tô.  Chỗ nghỉ có chỗ đậu xe riêng miễn phí, dịch vụ văn phòng và lễ tân 24/24.  Sân bay Quốc tế Nội Bài cách 105 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 50, 371468168, '(+84)5337908602', '1crdyhmnjv@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (427, 'Minh Khue Hotel', 'Nằm ở Vĩnh Long, cách Trung tâm thương mại Vincom Xuân Khánh 40 km và Bến Ninh Kiều 40 km, Minh Khue Hotel cung cấp chỗ nghỉ có phòng chờ chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ cũng như chỗ đậu xe riêng miễn phí cho khách lái xe. Khách sạn 1 sao này có quầy lễ tân 24 giờ và phòng giữ hành lý. Chỗ nghỉ này cung cấp dịch vụ đưa đón sân bay và dịch vụ cho thuê xe đạp.  Các căn ở khách sạn được trang bị ấm đun nước. Các phòng được thiết kế có phòng tắm riêng với đồ vệ sinh cá nhân miễn phí, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra thành phố. Tại Minh Khue Hotel, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có sân hiên phơi nắng.  Minh Khue Hotel cách Vincom Plaza Hùng Vương 41 km và Vinh Long Museum 6 phút đi bộ.', 0, 797228286, '(+84)2929006059', 'ch43exvlo2@yahoo.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (428, 'Phuoc Thanh IV Hotel', 'Phuoc Thanh IV Hotel nằm ở Vĩnh Long, cách Trung tâm thương mại Vincom Xuân Khánh 38 km và Bến Ninh Kiều 39 km. Ngoài nhà hàng, khách sạn 2 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê ô tô cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, các phòng đều đi kèm với tủ quần áo và TV màn hình phẳng. Tất cả các phòng đều có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tại Phuoc Thanh IV Hotel, các phòng đều có ga trải giường và khăn tắm.  Lễ tân tại chỗ nghỉ có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Phuoc Thanh IV Hotel cách Vincom Plaza Hùng Vương 40 km và Vinh Long Museum 2.6 km.', 0, 41730384, '(+84)3725151047', 'jrjmkw9nfn@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (429, 'RUBY HOTEL Vĩnh Long', 'Nằm ở Vĩnh Long, cách Trung tâm thương mại Vincom Xuân Khánh 40 km, RUBY HOTEL Vĩnh Long cung cấp chỗ nghỉ có xe đạp miễn phí, chỗ đậu xe riêng miễn phí, hồ bơi ngoài trời và khu vườn. Chỗ nghỉ này có các tiện nghi như phòng chờ chung, sân hiên, cũng như quầy bar. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, câu lạc bộ trẻ em và Wi-Fi miễn phí.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình cáp, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Ngoài phòng tắm riêng với vòi sen và máy sấy tóc, một số phòng tại khách sạn cũng có view thành phố. Tại RUBY HOTEL Vĩnh Long, các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có sân chơi trẻ em.  RUBY HOTEL Vĩnh Long cách Bến Ninh Kiều 40 km và Vincom Plaza Hùng Vương 43 km.', 0, 886284248, '(+84)4780246166', '4p6sxj13bb@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (430, 'mekong riverside homestay', 'Tọa lạc ở Vĩnh Long, mekong riverside homestay cung cấp Wi-Fi miễn phí, nơi khách có thể trải nghiệm khu vườn, phòng chờ chung và sân hiên.  Một số căn có điều hòa, ban công và/hoặc sân trong, cũng như khu vực ghế ngồi.  Biệt thự đồng quê có dịch vụ cho thuê ô tô, đồng thời du khách có thể đi xe đạp gần đó.  Chỗ nghỉ cách Sân bay Quốc tế Cần Thơ 64 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 643453081, '(+84)1900796377', '9ftargwnc9@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (431, 'Phước Hưng 3 Hotel', 'Nằm ở Vĩnh Long gần Vinh Long Museum, Phước Hưng 3 Hotel cung cấp Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tất cả các căn có phòng tắm riêng, vòi xịt/chậu rửa vệ sinh, điều hòa, TV màn hình phẳng và tủ lạnh. Một số căn có khu vực ghế ngồi và/hoặc ban công.  Khách sạn căn hộ cách Trung tâm thương mại Vincom Xuân Khánh 40 km và Bến Ninh Kiều 40 km. Chỗ nghỉ cách Sân bay Quốc tế Cần Thơ 49 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 70, 113875680, '(+84)1617794292', '8co692hc6c@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (432, 'Rosalia Tam Đảo Hotel', 'Tọa lạc ở Tam Ðảo, Rosalia Tam Đảo Hotel cung cấp chỗ nghỉ 2 sao có khu vườn, sân hiên và nhà hàng. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, phòng nào cũng có điều hòa, tủ quần áo, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân trong với view thành phố. Các phòng đều có tủ lạnh.  Rosalia Tam Đảo Hotel có phục vụ bữa sáng thực đơn à la carte và kiểu Á hằng ngày.  Sân bay Quốc tế Nội Bài cách 46 km.', 25, 241051370, '(+84)9708449318', 'itjif7edeb@outlook.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (433, 'Khách Sạn Hùng Trang Hotel', 'Khách Sạn Hùng Trang Hotel có khu vườn, sân hiên, nhà hàng và quầy bar ở Tam Ðảo. Ngoài Wi-Fi miễn phí, khách sạn 2 sao này còn cung cấp dịch vụ phòng và quầy lễ tân 24 giờ. Một số căn tại chỗ nghỉ có ban công với view thành phố.  Sân bay Quốc tế Nội Bài cách 46 km.', 0, 886459761, '(+84)1779845019', 'y1rqu2cww7@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (434, 'Nhà hàng Tiến Lâm 789', 'Nhà hàng Tiến Lâm 789 tọa lạc ở Vĩnh Phúc. Ngoài nhà hàng, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Mỗi phòng đều có tủ quần áo và TV màn hình phẳng, ngoài ra một số căn tại khách sạn có ban công. Tại Nhà hàng Tiến Lâm 789, tất cả các phòng đều được thiết kế có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet và kiểu Á mỗi sáng.  Sân bay Quốc tế Nội Bài cách 46 km.', 0, 576598047, '(+84)3686606014', '3mt15fx3wk@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (435, 'Samma Stay Tam Đảo', 'Nằm ở Tam Ðảo, Samma Stay Tam Đảo cung cấp chỗ nghỉ có Wi-Fi miễn phí, điều hòa và khu vườn với sân hiên.  Nơi đây còn có phòng tắm riêng với vòi xịt/chậu rửa vệ sinh ở tất cả các căn, cùng đồ vệ sinh cá nhân miễn phí, máy sấy tóc và dép đi trong phòng.  Tại nhà nghỉ B&B, khách sẽ tìm thấy nhà hàng phục vụ ẩm thực Việt, địa phương và đồ nướng.  Du khách có thể leo núi để khám phá khu vực xung quanh.  Sân bay Quốc tế Nội Bài cách 45 km.', 0, 433614018, '(+84)6892388014', 'b4osw2yph3@yahoo.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (436, 'Bách Xanh House. Nhà Gác Lửng', 'Bách Xanh House. Nhà Gác Lửng nằm ở Vĩnh Phúc, có khu vườn, phòng chờ chung và nhà hàng. Căn hộ cung cấp chỗ đậu xe riêng miễn phí và bếp chung.  Căn hộ có sân hiên, 1 phòng ngủ, phòng khách, cùng bếp đầy đủ tiện nghi với tủ lạnh và lò nướng.  Đội ngũ nhân viên của căn hộ luôn túc trực tại lễ tân 24/24 để cung cấp đề xuất cho du khách.  Khách có thể sử dụng sân chơi trẻ em tại Bách Xanh House. Nhà Gác Lửng.  Sân bay Quốc tế Nội Bài cách 45 km.', 0, 74375254, '(+84)5655336402', 'qvrswfejo7@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (437, 'Flamigo Dai Lai Resort - Happy Villa', 'Nhìn ra thành phố, Flamigo Dai Lai Resort - Happy Villa nằm ở Ngọc Quang và có nhà hàng, câu lạc bộ trẻ em, quầy bar, khu vườn, sân hiên cũng như sân chơi trẻ em. Chỗ nghỉ có điều hòa và bồn tắm spa.  Căn hộ có ban công nơi khách có thể nhìn ra khu vườn, khu vực ghế ngồi, TV màn hình phẳng truyền hình vệ tinh, bếp đầy đủ tiện nghi gồm tủ lạnh và lò nướng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Để thuận tiện hơn cho khách, chỗ nghỉ có thể cung cấp khăn tắm và khăn trải giường với khoản phụ phí.  Chỗ nghỉ có phục vụ bữa sáng mỗi sáng, gồm các lựa chọn thực đơn buffet, kiểu lục địa và kiểu Anh/ Ai-len.  Tại Flamigo Dai Lai Resort - Happy Villa, khách có thể sử dụng hồ bơi trong nhà.  Sau một ngày leo núi, câu cá hoặc đi xe đạp, khách có thể thư giãn trong khu vực phòng chờ chung.  Chỗ nghỉ cách Phủ Thành Chương 14 km và Bảo tàng dân tộc học Việt Nam 43 km. Chỗ nghỉ cách Sân bay Quốc tế Nội Bài 22 km và cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 613996454, '(+84)2646222214', 'kr7m323osz@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (438, 'Venus Flamigo Resort- Amazing, Đại Lải', 'Nhìn ra khu vườn, Venus Flamigo Resort- Amazing, Đại Lải tọa lạc ở Ngọc Quang và có nhà hàng, câu lạc bộ trẻ em, quầy bar, khu vườn, hồ bơi ngoài trời mở quanh năm cũng như sân hiên. Biệt thự có WiFi và chỗ đậu xe riêng miễn phí.  Chỗ nghỉ có điều hòa, bếp đầy đủ tiện nghi với khu vực ăn uống, TV màn hình phẳng, cũng như phòng tắm riêng với vòi sen, đồ vệ sinh cá nhân miễn phí và máy sấy tóc. Một số căn có ban công và/hoặc sân trong nhìn ra hồ bơi.  Venus Flamigo Resort- Amazing, Đại Lải có trung tâm thể dục.  Khách có thể tìm thấy sân chơi trẻ em tại chỗ nghỉ, cùng phòng chờ chung.  Venus Flamigo Resort- Amazing, Đại Lải cách Phủ Thành Chương 15 km và Bảo tàng dân tộc học Việt Nam 43 km.', 0, 587765397, '(+84)9165864648', 'dugir3v8zt@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (439, 'Westlake Hotel & Resort Vinh Phuc', 'Nằm ở Vĩnh Yên, cách Phủ Thành Chương 28 km, Westlake Hotel & Resort Vinh Phuc cung cấp chỗ nghỉ có hồ bơi ngoài trời theo mùa, chỗ đậu xe riêng miễn phí, trung tâm thể dục và khu vườn. Ngoài câu lạc bộ trẻ em, chỗ nghỉ này còn có nhà hàng, sòng bạc và sân hiên để phục vụ du khách. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, phòng chờ chung và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có tủ quần áo, ấm đun nước, tủ lạnh, minibar, két an toàn, TV và phòng tắm riêng với vòi sen. Tại Westlake Hotel & Resort Vinh Phuc, các phòng đều đi kèm với ga trải giường và khăn tắm.  Chỗ nghỉ có sân chơi trẻ em. Câu cá và đi xe đạp là hoạt động được ưa chuộng trong khu vực. Ngoài ra, khách sạn 5 sao này có dịch vụ thuê xe đạp.  Khách có thể sử dụng dịch vụ văn phòng hoặc thư giãn tại quầy bar.  Westlake Hotel & Resort Vinh Phuc cách Bảo tàng dân tộc học Việt Nam 42 km và Sân vận động Quốc gia Mỹ Đình 44 km.', 25, 19003787, '(+84)5319310737', 'yd94xcxxbo@outlook.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (440, 'Khách sạn Hoàng Hà River Town', 'Khách sạn Hoàng Hà River Town tọa lạc ở Hào Gia. Ngoài sân hiên, khách sạn 2 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và phòng giữ hành lý cho khách.  Phòng khách ở khách sạn được trang bị TV màn hình phẳng có truyền hình vệ tinh. Tất cả các phòng đều được thiết kế có ấm đun nước, trong đó một số phòng có ban công. Tại Khách sạn Hoàng Hà River Town, phòng nào cũng có ga trải giường và khăn tắm.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách chỗ nghỉ 128 km.', 0, 779514344, '(+84)4952102509', 'vpwkewz8r5@hotmail.com', 2);
