INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (442, 'Khách sạn Phương Thuý 2', 'Nằm ở Yen Bai, Khách sạn Phương Thuý 2 cung cấp chỗ nghỉ 3 sao có khu vườn, sân hiên và nhà hàng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Các căn đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và tủ quần áo. Với phòng tắm riêng được trang bị vòi sen và dép đi trong phòng, các phòng tại khách sạn cũng có Wi-Fi miễn phí, trong đó một số phòng có view thành phố.  Sân bay Quốc tế Nội Bài cách 128 km.', 0, 937859550, '(+84)9753763225', 'mqhjany82d@gmail.com', 3);
