INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (444, 'Mường Lò Retreat Nghia Lo', 'Nhìn ra thành phố, Mường Lò Retreat Nghia Lo tọa lạc ở Yên Bái và có nhà hàng, dịch vụ phòng, quầy bar, khu vườn, hồ bơi ngoài trời mở quanh năm cũng như sân hiên. WiFi miễn phí có sẵn.  Tất cả các căn đều được thiết kế có ban công nhìn ra núi.  Lodge có phục vụ bữa sáng thực đơn à la carte hằng ngày.  Du khách có thể đi xe đạp để khám phá khu vực xung quanh.  Sân bay Quốc tế Nội Bài cách 170 km.', 73, 294811757, '(+84)2870316650', 'l272ymhmpr@outlook.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (445, 'Khách sạn Hậu Giang', 'Nằm ở Vị Thanh, cách Trung tâm thương mại Vincom Xuân Khánh 46 km, Khách sạn Hậu Giang cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, khu vườn và sân hiên. Chỗ nghỉ này có các tiện nghi như nhà hàng, dịch vụ phòng và quầy lễ tân 24 giờ, cùng với Wi-Fi miễn phí. Du khách có thể tận hưởng cảnh thành phố.  Tất cả các phòng đi kèm điều hòa, TV màn hình phẳng có truyền hình vệ tinh, tủ lạnh, ấm đun nước, vòi xịt/chậu rửa vệ sinh, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Tất cả các phòng có két an toàn, trong đó một số phòng có ban công. Tại khách sạn, các phòng đều có ga trải giường và khăn tắm.  Khách sạn Hậu Giang có phục vụ bữa sáng thực đơn à la carte và kiểu Á mỗi buổi sáng.  Chỗ nghỉ cách Bến Ninh Kiều 48 km và Vincom Plaza Hùng Vương 49 km.', 0, 134586740, '(+84)7203986980', '38kytjkxbb@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (446, 'SOJO Hotel Hau Giang', 'Tọa lạc ở Vị Thanh, cách Trung tâm thương mại Vincom Xuân Khánh 46 km, SOJO Hotel Hau Giang cung cấp chỗ nghỉ có trung tâm thể dục, chỗ đậu xe riêng miễn phí, phòng chờ chung và nhà hàng. Ngoài quầy bar, khách sạn 4 sao này có các phòng được trang bị điều hòa và phòng tắm riêng. Chỗ nghỉ này cung cấp bếp chung, quầy lễ tân 24 giờ và phòng giữ hành lý cho khách.  Tại khách sạn, tất cả các phòng đều được thiết kế có bàn làm việc. Các phòng ở SOJO Hotel Hau Giang được trang bị TV màn hình phẳng và đồ vệ sinh cá nhân miễn phí.  Chỗ nghỉ cách Bến Ninh Kiều 48 km và Vincom Plaza Hùng Vương 49 km.', 0, 254821771, '(+84)6484788817', '03r725t7po@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (447, 'Linh San Hotel', 'Linh San Hotel cung cấp chỗ nghỉ ở Thinh Làng. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Đây là chỗ nghỉ không hút thuốc và nằm cách Vietnam National University 37 km.  Sân bay Quốc tế Nội Bài cách 95 km.', 0, 284689614, '(+84)9404925092', '31e9yw8nv5@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (448, 'Hùng Mạnh Plaza Hotel', 'Hùng Mạnh Plaza Hotel có khu vườn, phòng chờ chung, sân hiên và nhà hàng ở Hương Tân Lạc. Khách sạn 2 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Chỗ đậu xe riêng miễn phí có sẵn và khách sạn còn cung cấp dịch vụ thuê xe đạp cho những khách muốn khám phá khu vực xung quanh.  Tại khách sạn, các phòng đều đi kèm với điều hòa, bàn làm việc, TV màn hình phẳng, phòng tắm riêng, ga trải giường, khăn tắm và sân trong với view thành phố. Tất cả các phòng đều có tủ quần áo và máy pha cà phê để khách sử dụng.  Sân bay Thọ Xuân cách 113 km.', 0, 631392377, '(+84)4411706328', 'l4kn6nofas@gmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (449, 'MEDDOM Park', 'MEDDOM Park có khu vườn, sân hiên, nhà hàng và quầy bar ở Cao Phong. Ngoài Wi-Fi miễn phí, khách sạn 3 sao này còn cung cấp câu lạc bộ trẻ em và dịch vụ phòng. Chỗ nghỉ này cung cấp quầy lễ tân 24 giờ, dịch vụ tiền sảnh và tổ chức các tour du lịch cho khách.  Các phòng đều có phòng tắm riêng với vòi xịt/chậu rửa vệ sinh, trong đó một số phòng có ban công và một số phòng khác cũng nhìn ra sông. Tại khách sạn, tất cả các phòng đều có khu vực ghế ngồi.  MEDDOM Park có phục vụ bữa sáng kiểu Á mỗi buổi sáng.  Khách tại chỗ nghỉ sẽ có thể tận hưởng các hoạt động ở trong Cao Phong và khu vực xung quanh, như leo núi.  Sân bay Quốc tế Nội Bài cách 110 km.', 0, 87595107, '(+84)8955284593', '4g4n70f978@outlook.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (450, 'Halo Retreat', 'Halo Retreat ở Hòa Bình cung cấp chỗ nghỉ 3 sao có khu vườn. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Một số phòng có bếp với tủ lạnh và lò vi sóng.  Dịch vụ thông tin 24/7 luôn có sẵn tại lễ tân với đội ngũ nhân viên thành thạo tiếng Anh và tiếng Việt.  Sân bay gần nhất là Sân bay Quốc tế Nội Bài, cách khách sạn 107 km.', 0, 867995190, '(+84)8275166370', 'vbdhyhgsik@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (451, 'Serena Kim Boi Resort - Hoa Binh', '"Serena Kim Boi Resort - Hoa Binh" là chỗ nghỉ nhìn ra sông Bôi. Khách có thể thưởng thức cảnh quan tuyệt đẹp của những cánh đồng lúa hoặc ngâm mình trong bồn tắm nước khoáng nóng Kim Bôi. Khu nghỉ dưỡng này cũng có suối tắm nước nóng Onsen, phòng xông hơi ướt và bể bơi.  Quý khách có thể thưởng thức một tách trà trong lúc ngắm nhìn quang cảnh núi non/khu vườn.  Chỗ nghỉ có lễ tân phục vụ 24 giờ/ngày.  Khu nghỉ dưỡng cũng cung cấp xe đạp cho khách sử dụng miễn phí. Sân bay gần nhất là sân bay quốc tế Nội Bài, cách chỗ nghỉ 73 km.  Quý khách có thể dùng bữa tại nhà hàng trong khuôn viên và thưởng thức đồ uống tại quầy bar.', 27, 247273373, '(+84)4362052967', 'qackftj4vq@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (452, 'Mai Chau Ecolodge', 'Được bao quanh bởi những ngọn núi và cánh đồng lúa, Mai Chau Ecolodge cung cấp các phòng và suite hiện đại với tầm nhìn và Wi-Fi miễn phí. Nơi nghỉ này có nhà hàng, quán bar, hồ bơi ngoài trời và spa trong nhà để khách thư giãn.  Mai Chau Ecolodge cách Làng Pom Coọng 500 m và cách Làng Lạc 1 km. Trung tâm thị trấn Mai Châu và Làng Vạn cách đó lần lượt 1,5 km và 3 km.  Mỗi phòng và suite đều có ban công, khu vực tiếp khách và minibar. Phòng tắm riêng đi kèm vòi sen, máy sấy tóc và đồ vệ sinh cá nhân miễn phí.  Xe đạp miễn phí có sẵn cho khách nghỉ tại Mai Chau Ecolodge sử dụng. Nằm trong số các tiện nghi tại đây còn có sảnh khách chung, dịch vụ đặt vé và bàn đặt tour.  Thực đơn tự chọn được phục vụ cho bữa sáng.', 58, 351282658, '(+84)0658559885', '2igep3xxc8@hotmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (453, 'Mandala Retreats Kim Bôi', 'Mandala Retreats Kim Bôi có xe đạp miễn phí, hồ bơi ngoài trời, khu vườn và nhà hàng ở Hòa Bình. Khách sạn 5 sao này cung cấp dịch vụ phòng, quầy lễ tân 24 giờ và Wi-Fi miễn phí. Chỗ nghỉ này cung cấp bể sục, nhân viên phục vụ hoạt động giải trí và phòng gia đình.  Khách sạn sẽ cung cấp cho khách các phòng được trang bị điều hòa có bàn làm việc, ấm đun nước, minibar, két an toàn, TV màn hình phẳng, ban công và phòng tắm riêng với vòi xịt/chậu rửa vệ sinh. Tại Mandala Retreats Kim Bôi, tất cả các phòng đều có ga trải giường và khăn tắm.  Chỗ nghỉ có phục vụ bữa sáng thực đơn buffet mỗi sáng.  Mandala Retreats Kim Bôi có tắm suối nước nóng.  Sân bay Quốc tế Nội Bài cách 111 km.', 0, 249409050, '(+84)5489074729', 'rkc5xcorur@gmail.com', 5);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (454, 'My My Hotel', 'My My Hotel tọa lạc ở Quảng Ngãi. Ngoài sân hiên, khách sạn 1 sao này còn có các phòng với điều hòa được trang bị Wi-Fi miễn phí, trong đó mỗi phòng đều có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng và quầy lễ tân 24 giờ cho khách.  Tại khách sạn, tất cả các phòng đều được thiết kế có tủ quần áo. Mỗi phòng đều có bàn làm việc và TV, ngoài ra một số căn tại My My Hotel có ban công. Các phòng đều có tủ lạnh.  Sân bay gần nhất là Sân bay Chu Lai, cách chỗ nghỉ 32 km.', 0, 275231985, '(+84)8013188072', '0gzme4s12t@gmail.com', 1);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (455, 'Mộc Coffee - Hotel', 'Tọa lạc giáp biển ở Quảng Ngãi, Mộc Coffee - Hotel có khu vườn. Khách sạn 2 sao này có bếp chung và quầy lễ tân 24 giờ. Tại đây có sân hiên và khách có thể sử dụng Wi-Fi miễn phí và chỗ đậu xe riêng miễn phí.  Tại khách sạn, các phòng đều có sân trong. Tất cả các phòng đều có ấm đun nước, trong đó một số phòng có ban công và một số khác thì nhìn ra thành phố. Tất cả các căn tại Mộc Coffee - Hotel có điều hòa và bàn làm việc.  Sân bay gần nhất là Sân bay Chu Lai, cách chỗ nghỉ 39 km.', 0, 378388513, '(+84)3410420028', '483wt13khl@yahoo.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (456, 'Gia Thành Đạt', 'Gia Thành Đạt là chỗ nghỉ 2 sao nằm ở Quảng Ngãi Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Sân bay gần nhất là Sân bay Chu Lai, cách khách sạn 33 km.', 0, 578024814, '(+84)1517209888', '6nmyceqr9a@hotmail.com', 2);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (457, 'Nhà nghỉ Bình Yên - Miễn phí khăn lạnh, nước suối. Giá chỉ 40k/1h đầu (giờ sau +10k)', 'Tọa lạc ở Quảng Ngãi, Nhà nghỉ Bình Yên - Miễn phí khăn lạnh, nước suối. Giá chỉ 40k/1h đầu (giờ sau +10k) cung cấp phòng chờ chung, Wi-Fi miễn phí, bếp chung, cùng dịch vụ phòng.  Khăn tắm và ga trải giường có sẵn ở nhà nghỉ B&B.  Lễ tân tại nhà nghỉ B&B có thể cung cấp các thông tin hữu ích để giúp du khách tham quan khu vực xung quanh một cách thuận tiện.  Nhà nghỉ Bình Yên - Miễn phí khăn lạnh, nước suối. Giá chỉ 40k/1h đầu (giờ sau +10k) cung cấp sân hiên phơi nắng.  Sân bay gần nhất là Sân bay Chu Lai, cách chỗ nghỉ 33 km.', 15, 182433665, '(+84)7106143661', 'cj5ik5ui2g@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (458, 'Cam Thanh Hotel', 'Cam Thanh Hotel cung cấp chỗ ở tại tỉnh Quảng Ngãi và Wi-Fi miễn phí. Trong khách sạn còn có quầy bar.  TV truyền hình cáp màn hình phẳng, đầu đĩa DVD và máy vi tính được trang bị trong các phòng nghỉ tại đây. Một số phòng nhất định có khu vực tiếp khách để thư giãn sau một ngày bận rộn. Mỗi phòng còn đi kèm phòng tắm riêng với bồn tắm/vòi sen và bồn rửa vệ sinh (bidet). Để tạo thuận tiện cho du khách, dép và máy sấy tóc cũng được cung cấp.  Khách sạn có cửa hàng quà tặng và quầy lễ tân làm việc 24 giờ.  Chỗ đỗ xe riêng miễn phí được cung cấp ngay trong khuôn viên.  Khách sạn cũng cung cấp dịch vụ cho thuê xe đạp và xe hơi. Sân bay Quốc tế Chu Lai cách chỗ nghỉ 34 km.', 0, 412512856, '(+84)4568796166', 'ml28a4dzp4@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (459, 'Cocoland River Beach Resort & Spa', 'Nằm ở Quảng Ngãi, Cocoland River Beach Resort & Spa có spa và WiFi miễn phí. Chỗ nghỉ có nhiều tiện nghi khác nhau, trong đó bao gồm khu vườn, sảnh khách chung, Nhà hàng trong khuôn viên phục vụ các món ăn châu Âu và châu Á.  Tất cả các phòng đều được trang bị TV màn hình phẳng, ấm đun nước, đồ vệ sinh cá nhân miễn phí và bàn làm việc. Các phòng còn có phòng tắm riêng với chậu rửa vệ sinh và máy sấy tóc. Ngoài ra, phòng cũng đi kèm máy điều hòa và tủ quần áo.  Du khách có thể thưởng thức bữa sáng tự chọn, kiểu Mỹ hoặc Á.  Khách sạn có hồ bơi ngoài trời.  Lễ tân tại Cocoland River Beach Resort & Spa có thể cung cấp thông tin giúp khách tham quan khu vực xung quanh một cách thuận tiện.  Sân bay quốc tế Chu Lai cách đó 50 km.', 0, 410371674, '(+84)8466697451', 'n63rkaalym@gmail.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (460, 'Central Hotel', 'Nằm ở trung tâm của tỉnh Quảng Ngãi, Central Hotel cách đài tưởng niệm Sơn Mỹ (thôn Mỹ Lai) 15 phút lái xe. Chỗ ở này có 1 hồ bơi, sân tennis và truy cập Wi-Fi miễn phí.  Bãi biển Mỹ Khê đầy cát trắng chỉ cách Hotel Central 20 phút lái xe. Đà Nẵng cách đó 130 km. Tầng trên cùng của khách sạn tự hào với tầm nhìn ra Núi Thiên Bút và Sông Trà Khúc. Bãi đỗ xe có miễn phí.  Khách có thể xem truyền hình vệ tinh trong phòng máy lạnh tiện nghi. Mỗi phòng đều có minibar và phòng tắm riêng.  Việc thư giãn thật dễ dàng với phòng tắm hơi, hiên tắm nắng và dịch vụ mát-xa có tại Central Hotel. Trung tâm thể dục và phòng hát karaoke cũng có ở đây.  Coconut Palm Restaurant rộng rãi phục vụ các món địa phương, Á và Âu. Bar ở sảnh có các món ăn nhẹ và đồ uống. Hoa Sua Garden Bar phục vụ đồ ăn ngay cạnh sân tennis và hồ bơi.', 0, 419516755, '(+84)1089192871', '4ti1cly9aj@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (461, 'Keypad Hotel - Ocean Park 2 - Self check - in', 'Tọa lạc ở Hòa Bình, cách Trung tâm mua sắm AEON MALL Long Biên 13 km, Keypad Hotel - Ocean Park 2 - Self check - in có sân hiên và nhìn rathành phố. Ngoài khu vườn, khách sạn 3 sao này có các phòng được trang bị điều hòa và Wi-Fi miễn phí, trong đó mỗi phòng sẽ có phòng tắm riêng. Chỗ nghỉ này cung cấp dịch vụ phòng, cùng phòng giữ hành lý cho khách.  Tại khách sạn, các phòng đều đi kèm với tủ quần áo. Các phòng được thiết kế có bàn làm việc và TV màn hình phẳng, ngoài ra một số căn tại Keypad Hotel - Ocean Park 2 - Self check - in có ban công. Tại chỗ nghỉ, tất cả các phòng đều có ga trải giường và khăn tắm.  Keypad Hotel - Ocean Park 2 - Self check - in cách Nhà hát múa rối Thăng Long 19 km và Ô Quan Chưởng 19 km.', 55, 114174640, '(+84)6354586704', 'lt2iwhrv4n@gmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (462, 'Khách sạn Phương Anh', 'Nằm ở Hưng Yên, cách Trung tâm mua sắm AEON MALL Long Biên 12 km, Khách sạn Phương Anh cung cấp chỗ nghỉ có hồ bơi ngoài trời theo mùa, chỗ đậu xe riêng miễn phí, khu vườn và phòng chờ chung. Ngoài nhà hàng, chỗ nghỉ còn có sân hiên, phòng xông hơi khô và bể sục. Chỗ nghỉ cung cấp lễ tân 24/24, dịch vụ đưa đón sân bay, dịch vụ phòng và Wi-Fi miễn phí ở toàn bộ chỗ nghỉ.  Tại khách sạn, các phòng đều có tủ quần áo. Các phòng được thiết kế có ấm đun nước, trong đó một số phòng có bếp với tủ lạnh và lò nướng. Tại Khách sạn Phương Anh, tất cả các phòng đều có điều hòa và TV màn hình phẳng.  Chỗ nghỉ có sân chơi trẻ em. Khách tại Khách sạn Phương Anh sẽ có thể tận hưởng các hoạt động ở trong Hưng Yên và khu vực xung quanh, như leo núi.  Khách sạn cách Nhà hát múa rối Thăng Long 19 km và Ô Quan Chưởng 19 km.', 0, 752345575, '(+84)0425762039', 'pm68rv7vvj@hotmail.com', 3);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (463, 'Sue homestay Ecopark', 'Nhìn ra hồ, Sue homestay Ecopark ở Hưng Yên cung cấp chỗ nghỉ có xe đạp miễn phí, khu vườn, phòng chờ chung và nhà hàng. Chỗ nghỉ có điều hòa và bồn tắm spa.  Căn hộ có sân hiên nơi khách có thể nhìn ra thành phố, khu vực ghế ngồi, TV màn hình phẳng, bếp đầy đủ tiện nghi gồm tủ lạnh và lò nướng, cùng phòng tắm riêng được trang bị vòi xịt/chậu rửa vệ sinh và đồ vệ sinh cá nhân miễn phí. Lò vi sóng và bếp, cũng như ấm đun nước đều được cung cấp.  Khuôn viên của Sue homestay Ecopark có sân chơi trẻ em và du khách có thể leo núi hoặc đi xe đạp ở khu vực gần đó.  Chỗ nghỉ cách Trung tâm mua sắm AEON MALL Long Biên 12 km. Sân bay Quốc tế Nội Bài cách 37 km, đồng thời chỗ nghỉ có cung cấp dịch vụ đưa đón sân bay mất phí.', 0, 824260737, '(+84)5760981935', '18hebqmz5e@yahoo.com', 4);
INSERT INTO "hotel" (id, name, description, discount, "ownerId", phone, email, star) VALUES (464, 'Sam''s homestay- Swan lake studio apartment', 'Tọa lạc ở Kim Quan, cách Trung tâm mua sắm AEON MALL Long Biên 10 km, Sam''s homestay- Swan lake studio apartment cung cấp chỗ nghỉ có sân hiên, Wi-Fi miễn phí, máy ATM, cùng dịch vụ tiền sảnh. Với hồ bơi riêng, căn hộ nằm ở khu vực mà khách có thể tham gia vào các hoạt động như leo núi và đi xe đạp.  Căn hộ điều hòa này có 1 phòng ngủ, phòng khách, bếp đầy đủ tiện nghi với tủ lạnh và ấm đun nước, 1 phòng tắm với vòi sen và bể sục. Khăn tắm và ga trải giường có sẵn ở căn hộ.  Căn hộ có dịch vụ cho thuê xe đạp.  Sam''s homestay- Swan lake studio apartment cách Nhà hát múa rối Thăng Long 15 km và Ô Quan Chưởng 16 km.', 0, 659147473, '(+84)7372834358', 'fckskexveg@hotmail.com', 4);
